 engages in the construction for the development and maintenance of electric utilities-related facilities; and manufacture of materials and machinery for electric utilities-related facilities. Further, the company is involved in the gas supply, on-site energy, consulting and investment, real estate management, IT businesses, etc. Chubu Electric Power Company, Incorporated was founded in 1951 and is headquartered in Nagoya, Japan.","BHG Group AB (publ) operates as a consumer e-commerce company in Sweden, Finland, Denmark, Norway, rest of Europe, and internationally. It operates in two segments, Do-It-Yourself (DIY) and Home Furnishing. The company offers a range of brands totalling approximately 1.5 million products within DIY, leisure, furniture, and furnishings. It operates approximately 100 online sites comprising bygghemma.se, trademax.se, chilli.se, nordicnest.se, and furniturebox.se, as well as approximately 70 showrooms. The company was formerly known as Bygghemma Group First AB (publ) and changed its name to BHG Group AB (publ) in May 2020. BHG Group AB (publ) was founded in 2006 and is headquartered in Malm\u00f6, Sweden.","Space Co.,Ltd. engages in the planning, design, supervision, and construction of commercial facilities in Japan. The company's commercial facilities include shopping centers, department stores, specialty stores, restaurants, and cafes. It is also involved in the planning, design, supervision, and construction of museums and other cultural, sports, and entertainment facilities; and planning, design, production, sale, and import and export of display equipment and fixtures, indoor and outdoor decorative items, furniture, etc. The company plans, designs, supervises, and executes construction and interior finishing works; and plans, designs, supervises, and constructs projects related to shows and exhibitions. Further, it is involved in the planning, design, and production related to public relations and advertising; research, consultation, and publishing related to various items; provision of information; and real estate dealings, leasing, and brokerage activities. The company was founded in 1948 and is headquartered in Tokyo, Japan.","Yung Chi Paint &amp; Varnish Mfg.Co.,Ltd manufactures and sells coatings and paints primarily in Taiwan. The company offers architecture coatings, including water and solvent-based cement mortar paints, exterior wall paints and clear coatings, water-based epoxy paints, wood coatings, and other used architecture coatings; and waterproof coatings comprising water based waterproof paints, polyurea elastomer, and polyurethane waterproof paints. It also provides heavy duty coatings, such as ready-mixed, top-long, enamel, PU, epoxy, vinyl ester, chlorinated rubber, yung flon, polyurethane, and polysiloxane paints. In addition, the company offers marine paints that include supermarine products; anti-fouling, marine primers and paints, and rainbow paints; and fire-retardant coatings and spray-applied fire resistive materials. Further, it provides specialty coatings, which comprise galvanized steel emulsions, anti-midew, baking, and heat-resisting paints; and varnishes, putty, traffic paints, black board paints, paint removers, hammer tone paints, paint oils, flash rust inhibitors, magnetic paints, weldable anti-corrosive primers, gold paints, and flat paints. Additionally, the company offers coil coatings and maintenance paints; continental coatings, including epoxy, heat resisting paints, thinners, polyurethane and zinc coatings, and siloxane; and floor coatings, such as epoxy floor coating and water-based epoxy paints. It also provides paint pigments, synthetic resins, fire protection coatings, cement made products, and steel drums, as well as can, nuclear, and curtain wall coatings; and engages in the coating, anti-corrosive, lining coating, rust removal by water-jet, and wet sand blasting construction, as well as electrolytic protection activities. The company was founded in 1951 and is based in Kaohsiung, Taiwan.","Shin-Etsu Polymer Co.,Ltd. manufactures and sells polyvinyl chloride (PVC) products worldwide. The company operates through Precision Molding Products, Electronic Devices, Housing and Living Materials, and Others segments. It offers touch switches and pads, rubber contacts, short strokes, metal domes, in-molds, pressure sensitive devices, view/light path control films, and anisotropic conductive rubber connectors; and silicone rubber tubes and sheets, silicone sponge sheets, medical tube transitions, office automation rollers, medical and chemical products, culture plugs, embossed carrier tapes, top cover tapes, wafer cases, and light frames. The company also provides PVC pipes and corrugated sheets, sealing materials, wrap films, material for infrastructure maintenance, low friction PVC and TPV compounds, thermoplastic urethane compounds, polythiophene base conductive polymers, and engineering plastic films; and silicone adhesive sheets. It serves automotive, semiconductors and electronic components, information devices, medical and chemical products, packaging, and construction and infrastructure maintenance markets. The company was founded in 1960 and is headquartered in Tokyo, Japan. Shin-Etsu Polymer Co., Ltd. is a subsidiary of Shin-Etsu Chemical Co., Ltd.","Matador Resources Company, an independent energy company, engages in the exploration, development, production, and acquisition of oil and natural gas resources in the United States. It operates through two segments, Exploration and Production; and Midstream. The company primarily holds interests in the Wolfcamp and Bone Spring plays in the Delaware Basin in Southeast New Mexico and West Texas. It also operates the Eagle Ford shale play in South Texas; and the Haynesville shale and Cotton Valley plays in Northwest Louisiana. In addition, the company conducts midstream operations in support of its exploration, development, and production operations; provides natural gas processing and oil transportation services; and offers oil, natural gas, and produced water gathering services, as well as produced water disposal services to third parties. As of December 31, 2021, its estimated total proved oil and natural gas reserves were 323.4 million barrels of oil equivalent, including 181.3 million stock tank barrels of oil and 852.5 billion cubic feet of natural gas. The company was formerly known as Matador Holdco, Inc. and changed its name to Matador Resources Company in August 2011. Matador Resources Company was founded in 2003 and is headquartered in Dallas, Texas.","Koninklijke Ahold Delhaize N.V. operates retail food stores and e-commerce primarily in the United States and Europe. Its store formats include supermarkets, convenience stores, drugstores, and hypermarkets. It also subleases its stores to franchisees. As of January 2, 2022, it operated 7,452 stores primarily under local brands serving approximately 55 million customers, as well as online. The company was formerly known as Koninklijke Ahold N.V. and changed its name to Koninklijke Ahold Delhaize N.V. in July 2016. Koninklijke Ahold Delhaize N.V. was founded in 1887 and is headquartered in Zaandam, the Netherlands.","Lockheed Martin Corporation, a security and aerospace company, engages in the research, design, development, manufacture, integration, and sustainment of technology systems, products, and services worldwide. It operates through four segments: Aeronautics, Missiles and Fire Control, Rotary and Mission Systems, and Space. The Aeronautics segment offers combat and air mobility aircraft, unmanned air vehicles, and related technologies. The Missiles and Fire Control segment provides air and missile defense systems; tactical missiles and air-to-ground precision strike weapon systems; logistics; fire control systems; mission operations support, readiness, engineering support, and integration services; manned and unmanned ground vehicles; and energy management solutions. The Rotary and Mission Systems segment offers military and commercial helicopters, surface ships, sea and land-based missile defense systems, radar systems, sea and air-based mission and combat systems, command and control mission solutions, cyber solutions, and simulation and training solutions. The Space segment offers satellites; space transportation systems; strategic, advanced strike, and defensive missile systems; and classified systems and services in support of national security systems. This segment also provides network-enabled situational awareness and integrates space and ground-based systems to help its customers gather, analyze, and securely distribute critical intelligence data. It serves primarily serves the U.S. government, as well as foreign military sales contracted through the U.S. government. Lockheed Martin Corporation was founded in 1912 and is headquartered in Bethesda, Maryland.","LyondellBasell Industries N.V. operates as a chemical company in the United States, Germany, Mexico, Italy, Poland, France, Japan, China, the Netherlands, and internationally. The company operates in six segments: Olefins and Polyolefins\u0097Americas; Olefins and Polyolefins\u0097Europe, Asia, International; Intermediates and Derivatives; Advanced Polymer Solutions; Refining; and Technology. It produces and markets olefins and co-products; polyolefins; polyethylene products, which consist of high density polyethylene, low density polyethylene, and linear low density polyethylene; and polypropylene (PP) products, such as PP homopolymers and copolymers. The company also produces and sells propylene oxide and its derivatives; oxyfuels and related products; and intermediate chemicals, such as styrene monomers, acetyls, ethylene glycols, and ethylene oxides and derivatives. In addition, it produces and markets compounds and solutions, such as polypropylene compounds, engineered plastics, masterbatches, engineered composites, colors, and powders; and advanced polymers. Further, the company refines crude oil and other crude oils of varied types and sources into gasoline and distillates; develops and licenses chemical and polyolefin process technologies; and manufactures and sells polyolefin catalysts. LyondellBasell Industries N.V. was incorporated in 2009 and is headquartered in Houston, Texas.","Acerinox, S.A., together with its subsidiaries, manufactures, process, and markets stainless steel products in Spain, the Americas, Africa, Asia, Rest of Europe, and internationally. It operates through Stainless steel, and High-performance Alloys segments. The company offers flat products, including hot and cold rolled coils and sheets, strips, flat bars, and discs, as well as engraved coil, slabs, billets, and plates. It provides long products, which include steel and color coated wires, hexagonal wire rods, peeled, bars, hot and cold reinforcement bars, black bars, and steel profiles. In additions, it offers stainless steel grades, such as austenitic, ferritic, duplex, martensitic, and welding. Acerinox, S.A. was incorporated in 1970 and is headquartered in Madrid, Spain.","Inghams Group Limited, together with its subsidiaries, produces and sells chicken and turkey products in Australia and New Zealand. The company provides fresh, fresh with flavor, frozen, gluten free, and ready to cook chicken and turkey products under the Ingham's brand name. It also offers stock feeds for poultry and pig industries. The company was founded in 1918 and is based in North Ryde, Australia.","Quest Diagnostics Incorporated provides diagnostic testing, information, and services in the United States and internationally. The company develops and delivers diagnostic information services, such as routine testing, non-routine and advanced clinical testing, anatomic pathology testing, and other diagnostic information services. It offers diagnostic information services primarily under the Quest Diagnostics brand, as well as under the AmeriPath, Dermpath Diagnostics, ExamOne, and Quanum brands to patients, clinicians, hospitals, independent delivery networks, health plans, employers, direct contract entities, and accountable care organizations through a network of laboratories, patient service centers, phlebotomists in physician offices, call centers and mobile paramedics, nurses, and other health and wellness professionals. The company also provides risk assessment services for the life insurance industry; and healthcare organizations and clinicians robust information technology solutions. Quest Diagnostics Incorporated was founded in 1967 and is headquartered in Secaucus, New Jersey.","Bouygues SA, together with its subsidiaries, operates in the construction, telecom, and media sectors in France and internationally. The company designs, builds, renovates, operates, and deconstructs building, infrastructure, and industrial projects; develops urban planning, residential, and commercial projects; constructs and maintains roads and motorways, airport runways, ports, industrial logistics and commercial hubs, urban roads and amenities, external works, reserved-lane public transport facilities, leisure facilities, and environmental amenities, as well as undertakes civil engineering activities; produces and recycles construction materials; and distributes bitumen. It also engages in the construction, renewal, and maintenance of rail networks; fitting of road safety and signaling equipment; and laying and maintenance of pipes and pipelines. In addition, the company produces TF1, TMC, TFX, TF1, and LCI complementary TV channels; operates TV Breizh, Histoire, Ushua\u00efa, and Serieclub channels; produces, broadcasts, and distributes content; produces cinemas; operates la seine musicale entertainment and concert venue; and licenses, publishes, and boards games, as well as musical and events. Further, it offers telecom services; mobile and fixed Internet services; and Bbox Miami, an Android box for TV. Bouygues SA was founded in 1952 and is based in Paris, France.","Weiss Korea Opportunity Fund Ltd.is a closed-ended equity mutual fund launched and managed by Weiss Asset Management LP. The fund invests in the public equity markets of South Korea. It seeks to invest in stocks of companies operating across diversified sectors. The fund invests in stocks of companies across diversified market capitalizations. The fund primarily invests in value stocks and preferred shares of companies. It focuses on such factors as dividend yield, liquidity, and common shares weighting to create its portfolio. The fund benchmarks the performance of its portfolio against the MSCI Korea 25/50 Net Total Return Index. Weiss Korea Opportunity Fund Ltd. was formed on May 14, 2013 and is domiciled in Guernsey.","Freund Corporation develops, manufactures, and sells granulation and coating equipment for the pharmaceutical, food, and chemical industries in Japan and internationally. The company offers granulating, coating, drying, printer, tester and analyzer, encapsulation, and dust collector machines, as well as drug formulation machines. It also offers pharmaceutical excipients, food preservatives, machinery for food preservatives, and supplement materials. The company was founded in 1964 and is headquartered in Tokyo, Japan.","Five Point Holdings, LLC, through its subsidiary, Five Point Operating Company, LP, owns and develops mixed-use and planned communities in Orange County, Los Angeles County, and San Francisco County. The company operates in four segments: Valencia, San Francisco, Great Park, and Commercial. It sells residential and commercial land sites to homebuilders, commercial developers, and commercial buyers; operates and owns a commercial office, medical campus, and other properties; and provides development and property management services. The company was formerly known as Newhall Holding Company, LLC and changed its name to Five Point Holdings, LLC in May 2016. Five Point Holdings, LLC was incorporated in 2009 and is headquartered in Irvine, California.","BorgWarner Inc. provides solutions for combustion, hybrid, and electric vehicles worldwide. The company operates through four segments: Air Management, E-Propulsion &amp; Drivetrain, Fuel Injection, and Aftermarket. The Air Management segment offers turbochargers, eBoosters, eTurbos, timing systems, emissions systems, thermal systems, gasoline ignition technology, smart remote actuators, powertrain sensors, canisters, cabin heaters, battery modules and systems, battery packs, battery heaters, and battery charging. The E-Propulsion &amp; Drivetrain segment provides rotating electrical components, power electronics, control modules, software, friction, and mechanical products for automatic transmissions and torque-management products. The Fuel Injection segment develops and manufactures gasoline and diesel fuel injection components and systems. The Aftermarket segment sells products and services to independent aftermarket customers and original equipment service customers. This segment provides a range of solutions, including fuel injection, electronics and engine management, maintenance, and test equipment and vehicle diagnostics. The company sells its products to original equipment manufacturers of light vehicles, which comprise passenger cars, sport-utility vehicles, vans, and light trucks; commercial vehicles, including medium-duty and heavy-duty trucks, and buses; and off-highway vehicles, such as agricultural and construction machinery, and marine applications, as well as to tier one vehicle systems suppliers and the aftermarket for light, commercial, and off-highway vehicles. The company was formerly known as Borg-Warner Automotive, Inc. BorgWarner Inc. was incorporated in 1987 and is headquartered in Auburn Hills, Michigan.","Graub\u00fcndner Kantonalbank provides various banking and products services to private individuals and companies. It offers private and savings accounts; stock deposit, foreign currency, current, and rent accounts; and business and corporate cards, maestro cards, and debit master cards. The company also provides investment advice and wealth management services; investment and provident funds; investment saving plans; investment depots; variable, fixed, money market, and eco mortgages; and construction and personal loans. In addition, it offers financial planning services; and digital banking and payment transaction services. The company operates 46 branches in Graub\u00fcnden. Graub\u00fcndner Kantonalbank was founded in 1870 and is headquartered in Chur, Switzerland.","Fox Corporation operates as a news, sports, and entertainment company in the United States (U.S.). The company operates through Cable Network Programming; Television; and Other, Corporate and Eliminations segments. The Cable Network Programming segment produces and licenses news, business news, and sports content for distribution through traditional and virtual multi-channel video programming distributors (MVPDs) and other digital platforms, primarily in the U.S. It operates FOX News, a national cable news channel; FOX Business, a business news national cable channel; FS1 and FS2 multi-sport national networks; FOX Sports Racing, a video programming service that comprises motor sports programming; FOX Soccer Plus, a video programming network for live soccer and rugby competitions; FOX Deportes, a Spanish-language sports programming service; and Big Ten Network, a national video programming service. The Television segment acquires, produces, markets, and distributes programming. It operates The FOX Network, a national television broadcast network that broadcasts sports programming and entertainment; Tubi, an advertising-supported video-on-demand service; Fox Alternative Entertainment, a full-service production studio that develops and produces unscripted and alternative programming; MyNetworkTV, a programming distribution service; and Blockchain Creative Labs, which is focuses on the creation, distribution and monetization of Web3 content. This segment owns and operates 29 broadcast television stations. The Other, Corporate and Eliminations segment owns the FOX Studios Lot that provides production and post-production services, including 15 sound stages, two broadcast studios, theaters and screening rooms, editing rooms, and other television and film production facilities in Los Angeles, California. The company was incorporated in 2018 and is based in New York, New York.","Skandinaviska Enskilda Banken AB (publ) provides corporate, retail, investment, and private banking services. It operates through Large Corporates &amp; Financial Institutions, Corporate &amp; Private Customers, Baltic, Life, and Investment Management divisions. The company offers research and strategy services; analysis, advisory, execution, and trading services in the foreign exchange, fixed income, equities, and commodities markets; transaction services, including cash management, trade and supply chain finance, and business services; and investor services. It also provides investment banking services, such as corporate finance advisory services related to acquisitions, divestments, and mergers; equity capital market services related to initial public offerings, rights issues, and placings; debt transaction services comprising bonds, corporate acquisition financing, and general corporate refinancing services; leveraged and structured finance services, as well as real estate and shipping finance services. In addition, the company offers venture capital for entrepreneurs and innovators; asset management products that include equities, fixed income securities, hedge funds, commodities, and private equity solutions; and pensions, life insurance, health care insurance, and disability insurance. It serves large corporations and financial institutions, private customers, and small and medium-sized corporates. The company offers its services through 156 branch offices. It operates in Sweden, Norway, Denmark, Finland, Estonia, Latvia, Lithuania, Germany, the United Kingdom, the United States, Ireland, Luxembourg, China, Singapore, Russia, Poland, Hong Kong, Ukraine, and internationally. The company was founded in 1856 and is headquartered in Stockholm, Sweden.","Bank of America Corporation, through its subsidiaries, provides banking and financial products and services for individual consumers, small and middle-market businesses, institutional investors, large corporations, and governments worldwide. Its Consumer Banking segment offers traditional and money market savings accounts, certificates of deposit and IRAs, noninterest-and interest-bearing checking accounts, and investment accounts and products; and credit and debit cards, residential mortgages, and home equity loans, as well as direct and indirect loans, such as automotive, recreational vehicle, and consumer personal loans. The company's Global Wealth &amp; Investment Management segment offers investment management, brokerage, banking, and trust and retirement products and services; and wealth management solutions, as well as customized solutions, including specialty asset management services. Its Global Banking segment provides lending products and services, including commercial loans, leases, commitment facilities, trade finance, and commercial real estate and asset-based lending; treasury solutions, such as treasury management, foreign exchange, and short-term investing options and merchant services; working capital management solutions; and debt and equity underwriting and distribution, and merger-related and other advisory services. The company's Global Markets segment offers market-making, financing, securities clearing, settlement, and custody services, as well as risk management products using interest rate, equity, credit, currency and commodity derivatives, foreign exchange, fixed-income, and mortgage-related products. As of December 31, 2021, it served approximately 67 million consumer and small business clients with approximately 4,200 retail financial centers; approximately 16,000 ATMs; and digital banking platforms with approximately 41 million active users. The company was founded in 1784 and is based in Charlotte, North Carolina.","PepsiCo, Inc. manufactures, markets, distributes, and sells various beverages and convenient foods worldwide. The company operates through seven segments: Frito-Lay North America; Quaker Foods North America; PepsiCo Beverages North America; Latin America; Europe; Africa, Middle East and South Asia; and Asia Pacific, Australia and New Zealand and China Region. It provides dips, cheese-flavored snacks, and spreads, as well as corn, potato, and tortilla chips; cereals, rice, pasta, mixes and syrups, granola bars, grits, oatmeal, rice cakes, simply granola, and side dishes; beverage concentrates, fountain syrups, and finished goods; ready-to-drink tea, coffee, and juices; dairy products; and sparkling water makers and related products. It serves wholesale and other distributors, foodservice customers, grocery stores, drug stores, convenience stores, discount/dollar stores, mass merchandisers, membership stores, hard discounters, e-commerce retailers and authorized independent bottlers, and others through a network of direct-store-delivery, customer warehouse, and distributor networks, as well as directly to consumers through e-commerce platforms and retailers. The company was founded in 1898 and is headquartered in Purchase, New York.","Royal Bank of Canada operates as a diversified financial service company worldwide. The company's Personal &amp; Commercial Banking segment offers checking and savings accounts, home equity financing, personal lending, private banking, indirect lending, including auto financing, mutual funds and self-directed brokerage accounts, guaranteed investment certificates, credit cards, and payment products and solutions; and lending, leasing, deposit, investment, foreign exchange, cash management, auto dealer financing, trade products, and services to small and medium-sized commercial businesses. This segment offers financial products and services through branches, automated teller machines, and mobile sales network. Its Wealth Management segment provides a suite of advice-based solutions and strategies to high net worth and ultra-high net worth individuals, and institutional clients. The company's Insurance segment offers life, health, home, auto, travel, wealth, annuities, and reinsurance advice and solutions; and business insurance services to individual, business, and group clients through its advice centers, RBC insurance stores, and mobile advisors; digital, mobile, and social platforms; independent brokers; and travel partners. Its Investor &amp; Treasury Services segment provides asset servicing, custody, payments, and treasury services to financial and other investors; and fund and investment administration, shareholder, private capital, performance measurement and compliance monitoring, distribution, transaction banking, cash and liquidity management, foreign exchange, and global securities finance services. The company's Capital Markets segment offers corporate and investment banking, as well as equity and debt origination, distribution, advisory services, sale, and trading services for corporations, institutional investors, asset managers, private equity firms, and governments. The company was founded in 1864 and is headquartered in Toronto, Canada.","Viad Corp operates as an experiential leisure travel, and live events and marketing services company in the United States, Canada, the United Kingdom, Continental Europe, the United Arab Emirates, and Iceland. It operates through two segments, Pursuit and GES. The Pursuit segment offers vertically integrated attractions and hospitality in destinations with a collection of attractions, lodges, and sightseeing tours. The GES is a full-service live events company that offers a range of services for exhibitions, conferences, brand experiences, and venues. In addition, the company offers a collection of travel experiences in recreational attractions, food and beverage, retail, and ground transportation services. It serves event organizers and corporate brand marketers directly, as well as through a distribution channel network that include tour operators, tour wholesalers, destination management companies, and retail travel agencies. Viad Corp was founded in 1926 and is headquartered in Scottsdale, Arizona.","Inmobiliaria del Sur, S.A. operates as a property development and management company in Spain. It develops, manages, and rents out houses; offices and commercial premises; and parking lots. The company was incorporated in 1945 and is headquartered in Sevilla La Nueva, Spain.","CTS Co., Ltd. primarily provides ICT construction services for the construction industry in Japan. The company also offers IT infrastructures systems for construction sites; cloud storage services; mobaden mobile fixed IP phone service; outdoor network construction; network camera; remote work support; multifunction device and cloud scan; and provides AI face recognition and non-contact temperature detector. In addition, it offers 3D and one-man survey, 3D design data, ICT construction, construction management, electronic delivery, and other surveying and measuring equipment, such as lasers; and inspects and repair surveying instruments. Further, the company sells unit houses, office furniture, home appliances, air conditioners, and heating equipment; and rents and sells office desks, meeting tables, chairs, bookshelves, etc., as well as provides sterilization cleaning services. Additionally, it also engages in the lane marking and road sign construction activity; installation of guard fences; and designing and construction of disaster prevention shelters, solar lights, and playground equipment. CTS Co., Ltd. was founded in 1972 and is headquartered in Ueda, Japan.","Nomad Foods Limited manufactures, markets, and distributes frozen food products in the United Kingdom, Italy, Germany, France, Sweden, Austria, Norway, Spain, and rest of Europe. The company offers fish products, including fish fingers, coated fish, and natural fish; vegetables, such as peas and spinach; and poultry and meat products comprising nuggets, grills, and burgers. It also provides meals products that include ready to cook noodles, pasta, lasagna, pancakes, and other ready-made meals; ice-creams; and other products, such as soups, pizzas, bakery goods, and meat substitutes. The company sells its products to supermarkets and food retail chains directly or through distribution arrangements primarily under the Birds Eye, Iglo, Findus, Goodfella's, La Cocinera, Ledo, Frikom, San Marco, and Aunt Bessie's brands. Nomad Foods Limited is headquartered in Feltham, the United Kingdom.","Tokyo Gas Co., Ltd. engages in the production, supply, and sale of city and liquid gas, and LNG in Japan. The company operates through five segments: Gas, Electric Power, Overseas, Energy Related, and Real Estate. It offers engineering solutions; gas installation work and construction; and gas pipelines services, as well as engages in gas appliances business. The company is also involved in overseas resource development and investment, and energy supply activities. In addition, it engages in the real estate development business; and leasing and management of land and buildings. The company was incorporated in 1885 and is headquartered in Tokyo, Japan.","Webster Financial Corporation operates as the bank holding company for Webster Bank, National Association that provides a range of banking, investment, and financial services to individuals, families, and businesses in the United States. It operates through three segments: Commercial Banking, HSA Bank, and Retail Banking. The Commercial Banking segment provides lending, deposit, and cash management services; commercial and industrial lending and leasing, commercial real estate lending, equipment financing, and asset-based lending, as well as treasury and payment services; wealth management solutions to business owners, operators, and consumers; and trust, asset management, financial planning, insurance, retirement, and investment products. The HSA Bank segment offers health savings accounts, health reimbursement arrangements, flexible spending accounts, and commuter services that are distributed directly to employers and individual consumers, as well as through national and regional insurance carriers, consultants, and financial advisors. The Retail Banking segment provides deposit and fee-based services, residential mortgages, home equity lines, secured and unsecured loans, and credit cards to consumers. The company also offers online and mobile banking services. As of December 31, 2021, it operated 130 banking centers and 251 ATMs. The company was founded in 1935 and is headquartered in Stamford, Connecticut.","Ita\u00fasa S.A., through its subsidiaries, operates in the financial and industrial markets in Brazil and internationally. The company offers credit products and other financial services to individuals and corporate clients. It also manufactures and sells footwear, apparel, and textile items and related components, as well as leather, resin and natural or artificial rubber, and sports articles. In addition, the company engages in the transportation of gas through gas pipelines to distribution companies. Further, it manufactures and sells bathroom porcelain and metals, showers, and electric taps; ceramic tiles, including floor and wall coatings under the Deca, Ceusa, Cecrisa, Hydra, and Portinari brands; and pine and eucalyptus wood panels primarily used in the manufacture of medium, high, and super-density fiberboards, as well as and fiberboards and chipboards under the Durafloor brand. The company was formerly known as Ita\u00fasa - Investimentos Ita\u00fa SA. Ita\u00fasa S.A. was founded in 1966 and is headquartered in S\u00e3o Paulo, Brazil.","Aspen Insurance Holdings Limited, through its subsidiaries, engages in insurance and reinsurance businesses in Australia/Asia, the Caribbean, Canada, the United States, the United Kingdom, Europe, and internationally. Its Aspen Insurance segment offers first party and specialty insurance, including the U.S. and the U.K. commercial property, specie, inland and ocean marine, marine and energy liability, onshore energy physical damage, offshore energy physical damage, credit and political risks, crisis management, accident and health, and surety risks. This segment also provides casualty and liability lines, such as commercial liability, U.S. primary casualty, excess casualty, and environmental and railroad liability; and financial and professional lines comprising financial and corporate risks, professional and management liability, and cyber liability. The company's Aspen Reinsurance segment offers property catastrophe reinsurance products; other property reinsurance products; casualty reinsurance products, including U.S. treaty, international treaty, and casualty facultative reinsurance products; and specialty reinsurance products comprising credit and surety, agriculture, mortgage, marine, aviation, terrorism, engineering, cyber, and other specialty lines. It distributes its products primarily through brokers and reinsurance intermediaries. The company was incorporated in 2002 and is headquartered in Hamilton, Bermuda. Aspen Insurance Holdings Limited is a subsidiary of Highlands Bermuda Holdco, Ltd.","Obara Group Incorporated engages in the manufacture and sale of resistance welder, arc welder, laser equipment, polisher, cleaner/washer, and the consumables in Japan and internationally. The company offers resistance welding systems to weld metal sheets mainly of car bodies; arc welders to weld steel parts by melting welding wires. It also provides polishing equipment for electronic and precision industries, such as polishers for material substrates used for electronic components on PC, mobile phones, etc.; cleaners to clean minute particles off from parts, such as memory disks, flat panel displays, and other opto-electronic parts; laser equipment for the local welding of various metals; and consumable sets, including slurry, abrasives, carriers, pads, and plates for various applications. Obara Group Incorporated was founded in 1955 and is headquartered in Yamato, Japan.","Promotora y Operadora de Infraestructura, S. A. B. de C. V. engages in the construction, operation, maintenance, financing, and promotion of infrastructure projects in Mexico. Its projects include heavy construction projects, such as toll roads, ports, tunnels, dams, bridges, airports, and railways; industrial construction projects comprising petrochemical, industrial, wastewater treatment, and power generating plants; and urban construction projects, such as parking lots, museums, parks, education centers, buildings, water systems, public transportation systems, landfills, and hospitals. The company produces various asphalt concretes; basalt aggregates, including gravel, sand, seal, ballast, hydraulic base, sub-base, and tepetate; and central guard rails for roads, and various other precast concrete materials, as well as exploits stone aggregates. In addition, the company provides services, such as reception, storage, and shipment of goods; hauling or transfer of goods; loading and unloading ships; container filling and emptying; general cargo storage; and mooring and unmooring of ropes, as well as foreign trade merchandise handling, storage, and custody services. Promotora y Operadora de Infraestructura, S. A. B. de C. V. was founded in 1969 and is based in Mexico City, Mexico.","Red El\u00e9ctrica Corporaci\u00f3n, S.A. engages in the electricity transmission, and system operation and management of the transmission network for the electricity system in Spain and internationally. Its transmission network comprises approximately 44,687 kilometers; and has 93,871 MVA of transformation capacity. The company also provides advisory, engineering, and construction services; telecommunications infrastructure services to telecommunications operators comprising leasing of dark fiber; and line and sub-station maintenance services. In addition, it manages and constructs energy storage facilities and the water cycle; operates satellite communications system and offers space segment services for the geostationary orbital slots; sells and leases satellites and spatial capacity; and offers technical consultancy and satellite telecommunications services. The company was incorporated in 1985 and is based in Alcobendas, Spain.","The Kraft Heinz Company, together with its subsidiaries, manufactures and markets food and beverage products in the United States, Canada, the United Kingdom, and internationally. Its products include condiments and sauces, cheese and dairy products, meals, meats, refreshment beverages, coffee, and other grocery products. The company also offers dressings, healthy snacks, and other categories; and spices and other seasonings. It sells its products through its own sales organizations, as well as through independent brokers, agents, and distributors to chain, wholesale, cooperative and independent grocery accounts, convenience stores, drug stores, value stores, bakeries, pharmacies, mass merchants, club stores, and foodservice distributors and institutions, including hotels, restaurants, hospitals, health care facilities, and government agencies; and online through various e-commerce platforms and retailers. The company was formerly known as H.J. Heinz Holding Corporation and changed its name to The Kraft Heinz Company in July 2015. The Kraft Heinz Company was founded in 1869 and is headquartered in Pittsburgh, Pennsylvania.","RenaissanceRe Holdings Ltd. provides reinsurance and insurance products in the United States and internationally. The company operates through Property, and Casualty and Specialty segments. The Property segment writes property catastrophe excess of loss reinsurance and excess of loss retrocessional reinsurance to insure insurance and reinsurance companies against natural and man-made catastrophes, including hurricanes, earthquakes, typhoons, and tsunamis, as well as claims arising from other natural and man-made catastrophes comprising winter storms, freezes, floods, fires, windstorms, tornadoes, explosions, and acts of terrorism; and other property class of products, such as proportional reinsurance, property per risk, property reinsurance, binding facilities, and regional U.S. multi-line reinsurance. The Casualty and Specialty segment writes various classes of products, such as directors and officers, medical malpractice, and professional indemnity; automobile and employer's liability, casualty clash, umbrella or excess casualty, workers' compensation, and general liability; financial and mortgage guaranty, political risk, surety, and trade credit; and accident and health, agriculture, aviation, cyber, energy, marine, satellite, and terrorism. The company distributes its products and services primarily through intermediaries. RenaissanceRe Holdings Ltd. was founded in 1993 and is headquartered in Pembroke, Bermuda.","Bank of America Corporation, through its subsidiaries, provides banking and financial products and services for individual consumers, small and middle-market businesses, institutional investors, large corporations, and governments worldwide. Its Consumer Banking segment offers traditional and money market savings accounts, certificates of deposit and IRAs, noninterest-and interest-bearing checking accounts, and investment accounts and products; and credit and debit cards, residential mortgages, and home equity loans, as well as direct and indirect loans, such as automotive, recreational vehicle, and consumer personal loans. The company's Global Wealth &amp; Investment Management segment offers investment management, brokerage, banking, and trust and retirement products and services; and wealth management solutions, as well as customized solutions, including specialty asset management services. Its Global Banking segment provides lending products and services, including commercial loans, leases, commitment facilities, trade finance, and commercial real estate and asset-based lending; treasury solutions, such as treasury management, foreign exchange, and short-term investing options and merchant services; working capital management solutions; and debt and equity underwriting and distribution, and merger-related and other advisory services. The company's Global Markets segment offers market-making, financing, securities clearing, settlement, and custody services, as well as risk management products using interest rate, equity, credit, currency and commodity derivatives, foreign exchange, fixed-income, and mortgage-related products. As of December 31, 2021, it served approximately 67 million consumer and small business clients with approximately 4,200 retail financial centers; approximately 16,000 ATMs; and digital banking platforms with approximately 41 million active users. The company was founded in 1784 and is based in Charlotte, North Carolina.","Sempra operates as an energy-services holding company in the United States and internationally. The company's San Diego Gas &amp; Electric Company segment provides electric services; and supplies natural gas. It offers electric services to approximately 3.6 million population and natural gas services to approximately 3.3 million population that covers 4,100 square miles. Its Southern California Gas Company segment owns and operates a natural gas distribution, transmission, and storage system that supplies natural gas to a population of approximately 22 million covering an area of 24,000 square miles. The company's Sempra Texas Utilities segment engages in the regulated transmission and distribution of electricity serving 3.8 million homes and businesses, and operation of 140,000 miles of transmission and distribution lines. Its transmission system includes 18,249 circuit miles of transmission lines, a total of 1,174 transmission and distribution substations, and interconnection to 130 third-party generation facilities totaling 45,403 megawatts. The company was formerly known as Sempra Energy and changed its name to Sempra in July 2021. Sempra was founded in 1998 and is headquartered in San Diego, California.","NZX Limited operates a stock exchange in New Zealand. The company operates through five segments: Capital Markets Origination, Secondary Markets, Data &amp; Insights, Funds Management, and Wealth Technologies. The Capital Markets Origination segment provides issuer services for current and prospective customers. The Secondary Markets segment provides trading and post-trade services for securities and derivatives markets, as well as provides central securities depository; and acts as a market operator for Fonterra Co-Operative Group, the Electricity Authority, and the Ministry for the Environment. The Data &amp; Insights segment offers information services for the securities and derivatives markets; and analytics for the dairy sector. The Funds Management segment provides superannuation and KiwiSaver, and Smartshares exchange traded funds. The Wealth Technologies segment offers funds administration and custodian services. It also offers NZX Wealth Technologies, a platform that enables advisers and brokers to manage client investments. NZX Limited was founded in 1866 and is headquartered in Wellington, New Zealand.","Allegion plc manufactures and sells mechanical and electronic security products and solutions worldwide. The company offers door closers, controls, and exit devices; locks, locksets, portable locks, and key systems and services; electronic security products and access control systems; time, attendance, and workforce productivity systems; doors and door systems; and other accessories. The company sells its products and solutions to end-users in commercial, institutional, and residential facilities, including education, healthcare, government, hospitality, commercial office, and single and multi-family residential markets under the CISA, Interflex, LCN, Schlage, SimonsVoss, and Von Duprin brands. It sells its products and solutions through distribution and retail channels, such as specialty distribution, e-commerce, and wholesalers, as well as through various retail channels comprising do-it-yourself home improvement centers, on-line and e-commerce platforms, and small specialty showroom outlets. Allegion plc was incorporated in 2013 and is headquartered in Dublin, Ireland.","Centrepoint Alliance Limited, together with its subsidiaries, engages in the financial services industry in Australia. It operates through Licensee and Advice Services, Fund Management and Administration, and Consulting Services segments. The Licensee and Advice Services segment offers license services, which include licensing, systems, compliance, training, and technical advises to financial advisers and their clients, as well as mortgage aggregation services to mortgage brokers. The Fund Management and Administration segment provides investor directed portfolio services and investment management services to financial advisers, accountants, and their clients. The Consulting Services segment provides consulting services to self-licensed advisers and licensees. The company also provides lending solutions, such as mortgage lending, asset financing, and commercial finance. In addition, it offers loans to advisers, packages investment platforms, and managed funds; and financial advisory, support, and salaried advisory services, as well as employee share plans. The company was formerly known as Alliance Finance Corporation Limited and changed its name to Centrepoint Alliance Limited in September 2005. Centrepoint Alliance Limited was founded in 1982 and is headquartered in Sydney, Australia.","H &amp; M Hennes &amp; Mauritz AB (publ) provides clothing, accessories, footwear, cosmetics, home textiles, and homeware for women, men, teenagers, children, and babies worldwide. It offers sportswear, shoes, bags, beauty products, and ready-to-wear; and interior products, including bed linens, dinnerware, textiles, furniture, and lighting. The company provides its products under the H&amp;M, H&amp;M HOME, COS, &amp; Other Stories, Monki, Weekday, ARKET, Afound, Singular Society, Treadler, Creator Studio, and Sellpy brands. As of November 30, 2021, the company had 54 online markets and approximately 4,801 stores in 75 markets, including franchise markets. H &amp; M Hennes &amp; Mauritz AB (publ) was founded in 1947 and is headquartered in Stockholm, Sweden.","Assurant, Inc. engages in the provision of lifestyle and housing solutions for consumer purchases. It operates through the following segments: Global Lifestyle, Global Housing, and Corporate and Other. The Global Lifestyle segment offers mobile device solutions and extended service products and related services for mobile devices, consumer electronics and appliances, vehicle protection, and related services. The Global Housing segment includes lender-placed homeowners\u2019 insurance, lender-placed manufactured housing insurance, lender-placed flood insurance, renters' insurance, and related products, voluntary manufactured housing insurance, voluntary homeowners\u2019 insurance and other specialty products. The Corporate and Other segment refers to the corporate employee-related expenses and activities of the holding company. The company was founded in 1892 and is headquartered in Atlanta, GA.","Chofu Seisakusho Co., Ltd. manufactures and sells residential appliances in Japan. It offers water heaters, such as oil-fired/gas-fired/electric water heaters, and oil-fired/gas-fired boilers; bath/kitchen products, including bath units, kitchen units, and bath tubs; air conditioners and heating appliances; and appliances for commercial use. The company also provides eco-friendly appliances comprising co-generation systems, CO2 heat pump water heaters, and solar equipment. It offers products through its showrooms, as well as through a network of dealers. Chofu Seisakusho Co., Ltd. was incorporated in 1950 and is headquartered in Shimonoseki, Japan.","Basler Kantonalbank offers various banking products and services to private and business customers in Switzerland. The company offers personal and savings accounts; mortgages and other loans; debit and credit cards; investment advisory and wealth management services; pension advisory and retirement accounts; financial planning and inheritance advisory services; and digital banking services. It also provides business accounts; business and investment loans, real estate financing, trade financing, and capital goods leasing; consulting services to companies; investment funds; forex trading, precious metal trading, securities trading, and interest rate trading services, as well as corporate finance services; and e-banking and mobile banking services. Basler Kantonalbank was founded in 1899 and is based in Basel, Switzerland.","Atlantic Union Bankshares Corporation operates as the holding company for Atlantic Union Bank that provides banking and related financial services to consumers and businesses. The company accepts various deposit products, including checking, savings, NOW, time deposit, and money market accounts; certificates of deposit; and other depository services. It also provides loans for commercial, industrial, residential mortgage, and consumer purposes. In addition, the company offers credit cards, automated teller machine (ATM) services, mobile and internet banking services, and online bill payment services, as well as financial planning, trust, and wealth management services. Further, it provides securities, brokerage, and investment advisory products and services; and originates and sells residential loan products in the secondary market. As of February 25, 2022, it operated 130 branches and approximately 150 ATMs in Virginia, Maryland, and North Carolina. The company was formerly known as Union Bankshares Corporation and changed its name to Atlantic Union Bankshares Corporation in May 2019. Atlantic Union Bankshares Corporation was founded in 1902 and is headquartered in Richmond, Virginia.","Uni-President Enterprises Corp. manufactures, processes, and sells soft drinks, foods, animal feeds, and flour in Taiwan, China, and internationally. The company provides edible oils, instant noodles, dairy products, tea beverages, coffee drinks, baking products, ice cream products, frozen prepared foods, meat products, healthy food products, sauce and seasoning, flour, animal and aquatic feeds, soft drinks, rice, juices, bottled water, dessert, and vegetables. It also offers tinplate and cans, PET bottles, containers, and glass products for packaging; information services; cosmetics; elevators; and cleaning instruments, as well as researches, manufactures, distributes, and sells, pharmaceutical products. In addition, the company engages in construction of buildings; wholesale and retail of food; advertising activities; management of professional baseball team; entertainment business; operation of shopping malls, department stores, international trades, etc.; construction, development, and operation of an MRT stations; car rental activities; tourist agency business; and manufacture of chemical materials, instruments, etc. Further, it is involved in sales and leasing of real estate properties; enterprise management consultancy business; delivery of magazines, etc.; personal and property insurance activities; arts and culture activities; operation of gymnasiums and spas, fast food and coffee chain restaurants, and electronic tickets and electronic related business; wholesale of medicines and medical appliances; and professional investment activities. Additionally, the company operates gas stations, retail channels and distribution centers, book stores, etc., as well as acts as a collection agent for government institutions. Uni-President Enterprises Corp. was incorporated in 1967 and is headquartered in Tainan City, Taiwan.","Red Violet, Inc., a software and services company, specializes in proprietary technologies and applying analytical capabilities to deliver identity intelligence in the United States. It offers idiCORE, an investigative solution used to address various organizational challenges, which include due diligence, risk mitigation, identity authentication, and regulatory compliance; and FOREWARN, an app-based solution that provides instant knowledge before face-to-face engagement with a consumer, as well as helps professionals to identify and mitigate risk. The company serves financial services, insurance, healthcare, retail, and telecommunication companies; law enforcement and government agencies; and collections, corporate security, and investigative firms, as well as solutions used for purposes, such as risk mitigation, due diligence, fraud detection and prevention, regulatory compliance, and customer acquisition. It markets its products and services through value-added distributors, resellers, and strategic partners; and trade shows and seminars, advertising, public relations, distribution of sales literature, and product specifications and ongoing communication with prospective customers, distributors, resellers, strategic partners, and installed base of current customers, as well as through direct sales. Red Violet, Inc. was incorporated in 2017 and is headquartered in Boca Raton, Florida.","Nagaileben Co., Ltd. produces and sells medical clothing in Japan. It offers hospital, clinic, and operation room wear products. The company was founded in 1915 and is headquartered in Tokyo, Japan.","Takakita Co., Ltd. engages in the manufacture and sale of agricultural machinery in Japan and internationally. The company provides grass and straw packing machine, such as mini, self-propelled mini, variable diameter, and powerful round balers; mini, automatic, remote control, and self-propelled bale wrapper; and combi bale wrappers. It also offers machines for shredded material bailing, including round balers for chopped materials, chopping whole crop harvesting-balers, chopping combi bale wrappers, and general-purpose type forage harvesters. The company was formerly known as Takakita Agricultural Machinery Co., Ltd. and changed its name to Takakita Co., Ltd. in 1988. Takakita Co., Ltd. was founded in 1912 and is headquartered in Nabari, Japan.","PC Connection, Inc., together with its subsidiaries, provides various information technology (IT) solutions. The company operates through three segments: Business Solutions, Enterprise Solutions, and Public Sector Solutions. It offers IT products, including computer systems, data center solutions, software and peripheral equipment, networking communications, and other products and accessories, as well as provides services related to design, configuration, and implementation of IT solutions. The company markets its products and services through its websites comprising connection.com, connection.com/enterprise, connection.com/publicsector, and macconnection.com. It serves small to medium-sized businesses (SMBs) that include small office/home office customers; government and educational institutions; and medium-to-large corporate accounts through outbound telemarketing and field sales, and marketing programs targeted to specific customer populations, as well as through digital, web, and print media advertising. The company was founded in 1982 and is headquartered in Merrimack, New Hampshire.","OSG Corporation, together with its subsidiaries, manufactures and sells cutting tools in Japan, the Americas, Europe and Africa, and Asia. The company's products include taps, drills, end mills, indexable tools, thread mills, rolling dies, gauges, machine tools, machine parts, and tooling systems, as well as reconditioning services to worn tools. It also offers special products and accessories, such as tap holders, holder/arbor related products, circular saws/bandsaws, diameter correction tools, tool storage cabinets, parts/accessories, LHSTIX/bits, and coating rods. In addition, the company imports and sells tools. The company's products are used in automotive, die/mold, aerospace, energy, and heavy industry applications. OSG Corporation was incorporated in 1938 and is headquartered in Toyokawa, Japan.","transcosmos inc. provides business outsourcing services worldwide. The company offers outsourcing services to back-office operations, including accounting/finance and human resources; order placement services; operation and maintenance of IT systems; and mechanical, architectural, and other design operations. It also provides contract center services, such as outsourcing services for customer support operations comprising dealing with inquires and complaints from consumers, providing products and services information to the customers, and supporting marketing and sales. In addition, the company offers digital marketing services that make use of Internet infrastructures, Internet promotions, Website design and operations, omni cahnnel marketing, and analysis and research services. Further, it provides e-commerce services, including various functions required for e-commerce, such as e-commerce Website development and operation, fulfillment, customer care, online promotions, and analysis services. The company serves financial, telecommunication, high-tech, medical, cosmetics, distribution, automobile, and airline industries, as well as the public sector. transcosmos inc. was founded in 1966 and is based in Tokyo, Japan.","Bufab AB (publ) operates as a trading company that provides solutions for sourcing, quality control, and logistics for C-parts in Sweden and internationally. It offers metal or plastic fasteners comprising screws, bolts, nuts, rivets, pins, washers, etc.; and other small metal, rubber, and plastic parts, including cables, springs, and electronic fasteners. The company also provides stainless steel bolts under the BUMAX brand name; and special products, such as access hardware, cold formed parts, die cast parts, electrical products, machined parts, magnets, plastic parts, rubber parts, stamping and pressing parts, tools and equipment, and turned parts. In addition, it offers assembled parts, add on products, and special packaging and kitting solutions. Further, the company provides supply chain services. It serves customers in a range of manufacturing industries, including the technology, electronics/telecommunications, consumer goods, transportation and construction, furniture, and automotive sectors, as well as the offshore and refining industry. The company was formerly known as Bufab Holding AB (publ) and changed its name to Bufab AB (publ) in June 2015. Bufab AB (publ) was founded in 1977 and is headquartered in V\u00e4rnamo, Sweden.","Webster Financial Corporation operates as the bank holding company for Webster Bank, National Association that provides a range of banking, investment, and financial services to individuals, families, and businesses in the United States. It operates through three segments: Commercial Banking, HSA Bank, and Retail Banking. The Commercial Banking segment provides lending, deposit, and cash management services; commercial and industrial lending and leasing, commercial real estate lending, equipment financing, and asset-based lending, as well as treasury and payment services; wealth management solutions to business owners, operators, and consumers; and trust, asset management, financial planning, insurance, retirement, and investment products. The HSA Bank segment offers health savings accounts, health reimbursement arrangements, flexible spending accounts, and commuter services that are distributed directly to employers and individual consumers, as well as through national and regional insurance carriers, consultants, and financial advisors. The Retail Banking segment provides deposit and fee-based services, residential mortgages, home equity lines, secured and unsecured loans, and credit cards to consumers. The company also offers online and mobile banking services. As of December 31, 2021, it operated 130 banking centers and 251 ATMs. The company was founded in 1935 and is headquartered in Stamford, Connecticut.","Lintes Technology Co., Ltd. designs, develops, and manufactures consumer electronics and communication connectivity products worldwide. The company offers active and passive electric cables, adaptors, travel docks, PD chargers, tether cables, docking station and wireless chargers, and dongles. It serves original equipment manufacturers and original design manufacturers. The company was founded in 2011 and is based in New Taipei City, Taiwan.","Centene Corporation operates as a multi-national healthcare enterprise that provides programs and services to under-insured and uninsured individuals in the United States. Its Managed Care segment offers health plan coverage to individuals through government subsidized programs, including Medicaid, the State children's health insurance program, long-term services and support, foster care, and medicare-medicaid plans, which cover dually eligible individuals, as well as aged, blind, or disabled programs. Its health plans include primary and specialty physician care, inpatient and outpatient hospital care, emergency and urgent care, prenatal care, laboratory and X-ray, home-based primary care, transportation assistance, vision care, dental care, telehealth, immunization, specialty pharmacy, therapy, social work, nurse advisory, and care coordination services, as well as prescriptions and limited over-the-counter drugs, medical equipment, and behavioral health and abuse services. This segment also offers various individual, small group, and large group commercial healthcare products to employers and directly to members. The company's Specialty Services segment provides pharmacy benefits management services; nurse advice line and after-hours support services; vision and dental services, as well as staffing services to correctional systems and other government agencies; and services to Military Health System eligible beneficiaries. This segment offers its services and products to state programs, correctional facilities, healthcare organizations, employer groups, and other commercial organizations. The company provides its services through primary and specialty care physicians, hospitals, and ancillary providers. Centene Corporation was founded in 1984 and is headquartered in St. Louis, Missouri.","ATCO Ltd., together with its subsidiaries, engages in the provision of housing, logistics and transportation, agriculture, water, real estate, and energy and energy infrastructure solutions in Canada, Australia, and internationally. The company offers workforce and residential housing, modular facilities, construction and site support, workforce lodging, facility operations and maintenance, defense operations, and disaster and emergency management services. It also provides commercial real estate services, including sale, lease, and development of commercial and industrial properties; and engages in processing and marketing of fly ash. In addition, it generates electricity through hydro, solar, wind, and natural gas facilities, as well as provides electricity distribution, transmission, storage, and related infrastructure services; offers natural gas transmission, distribution, storage, and retail sales; natural gas liquids storage services; and provides integrated water services, including pipeline transportation, storage, water treatment, recycling, and disposal to various industrial customers. ATCO Ltd. was founded in 1947 and is headquartered in Calgary, Canada. ATCO Ltd. operates as a subsidiary of Sentgraf Enterprises Ltd.","OMER S.p.A. designs, develops, manufactures, and sells components and interior furnishings for railway vehicles in Italy, rest of European Union countries, and internationally. Its products include high speed and regional trains, and subway interiors; upper, side, and lower external fairings and girths for carriages and locomotives; and sanitary modules for trains. The company works in partnership with rolling stock manufacturers engaging in the construction of finished railway vehicles. OMER S.p.A. was founded in 1990 and is headquartered in Carini, Italy.","WEX Inc. provides financial technology services in the United States and internationally. It operates through three segments: Fleet Solutions, Travel and Corporate Solutions, and Health and Employee Benefit Solutions. The Fleet Solutions segment offers fleet vehicle payment processing services. Its services include customer, account activation, and account retention services; authorization and billing inquiries, and account maintenance services; credit and collections services; merchant services; analytics solutions with access to web-based data analytics platform that offers insights to fleet managers; and ancillary services and tools to fleets to manage expenses and capital requirements. This segment markets its products directly and indirectly to commercial and government vehicle fleet customers with small, medium, and large fleets, as well as with over-the-road and long haul fleets; and indirectly through co-branded and private label relationships. The Travel and Corporate Solutions segment provides payment solutions, including embedded payments; and accounts payable automation and spend management solutions. Its products include virtual cards that are used for transactions where no card is presented. This segment markets its products directly and indirectly to commercial and government organizations. The Health and Employee Benefit Solutions segment offers healthcare payment products and software-as-a-service consumer directed platforms for healthcare market, as well as payroll related and employee benefit products in Brazil. This segment markets its products through health plans, third-party administrators, financial institutions, payroll companies benefits consultants, software providers, and individuals. The company was formerly known as Wright Express Corporation and changed its name to WEX Inc. in October 2012. WEX Inc. was founded in 1983 and is based in Portland, Maine.","Cass Information Systems, Inc. provides payment and information processing services to manufacturing, distribution, and retail enterprises in the United States. It operates through two segments, Information Services and Banking Services. The company's services include freight invoice rating, payment processing, auditing, and the generation of accounting and transportation information. It also processes and pays facility-related invoices, such as electricity, gas, waste, and telecommunications expenses; and provides telecom expense management solutions. In addition, the company, through its banking subsidiary, Cass Commercial Bank, provides a range of banking products and services, such as checking, savings, and time deposit accounts; commercial, industrial, and real estate loans; and cash management services to privately-owned businesses and faith-related ministries. Further, it provides B2B payment platform for clients that require an agile fintech partner. It operates through its banking facility near downtown St. Louis, Missouri; operating branch in the Bridgeton, Missouri; and leased facilities in Fenton, Missouri and Colorado Springs, Colorado. The company was formerly known as Cass Commercial Corporation and changed its name to Cass Information Systems, Inc. in January 2001. Cass Information Systems, Inc. was founded in 1906 and is headquartered in St. Louis, Missouri.","KeyCorp operates as the holding company for KeyBank National Association that provides various retail and commercial banking products and services in the United States. It operates in two segments, Consumer Bank and Commercial Bank. The company offers various deposits, investment products and services; and personal finance and financial wellness, student loan refinancing, mortgage and home equity, lending, credit card, treasury, business advisory, wealth management, asset management, investment, cash management, portfolio management, and trust and related services to individuals and small and medium-sized businesses. It also provides a suite of banking and capital market products, such as syndicated finance, debt and equity capital market products, commercial payments, equipment finance, commercial mortgage banking, derivatives, foreign exchange, financial advisory, and public finance, as well as commercial mortgage loans comprising consumer, energy, healthcare, industrial, public sector, real estate, and technology loans for middle market clients. In addition, the company offers community development financing, securities underwriting, brokerage, and investment banking services. As of December 31, 2021, it operated through a network of approximately 999 branches and 1,317 ATMs in 15 states, as well as additional offices, online and mobile banking capabilities, and a telephone banking call center. KeyCorp was founded in 1849 and is headquartered in Cleveland, Ohio.","Sunlands Technology Group, through its subsidiaries, provides online education services in the People's Republic of China. It offers various degree- and diploma-oriented post-secondary courses, including preparation courses for the self-taught higher education examination (STE) for learners pursuing associate diplomas or bachelor's degrees, as well as for the entrance examinations of Master of Business Administration programs. The company's STE courses include Chinese language and literature, law, pre-school education, marketing, English, human resource management, business administration, business management, modern corporate governance, financial management, advertising, accounting, administrative management, computer information management, finance, convention management, chain operation management, and visual communication and design. It also provides professional certification preparation courses in various industries and professions, such as accounting, human resources, teaching, and finance. The company was formerly known as Sunlands Online Education Group and changed its name to Sunlands Technology Group in August 2018. Sunlands Technology Group was founded in 2003 and is headquartered in Beijing, the People's Republic of China.","Cembra Money Bank AG provides consumer finance products and services in Switzerland. The company offers savings products, including medium-term notes and deposit accounts; loans comprising cash, consumer, personal, business, and auto loans; credit card receivables; and leasing services for new and used vehicles, including cars, light commercial vehicles, motorcycles, and caravans, as well as corporate leasing services. It also provides financial protection products in case of involuntary unemployment, accident, illness, or disability; travel and flight, and card protection insurance products; investment products; and credit cards, mobile payment, and e-services. In addition, the company offers financing solutions to small businesses under the Cembra Business brand, as well as invoice financing services. The company serves private and self-employed individuals, and small and medium enterprises. It operates through a network of branches, as well as through various sales channels, such as the internet, credit card partners, independent intermediaries, and approximately 4,000 car dealers. The company was formerly known as GE Money Bank Aktiengesellschaft and changed its name to Cembra Money Bank AG in October 2013. Cembra Money Bank AG was founded in 1912 and is headquartered in Zurich, Switzerland.","ASL Marine Holdings Ltd., an investment holding company, provides marine services in the Singapore, Indonesia, Rest of Asia, Europe, Australia, and internationally. The company operates through Shipbuilding; Shiprepair, Conversion, and Engineering; and Shipchartering segments. It constructs vessels, such as offshore support vessels, dredgers, tugs, barges, and tankers; and provides ship repair and conversion services, including retrofitting and conversion, steel renewal, blasting and painting, electrical and electronic works, and mechanical works for the repair and life extension of various types of vessels. The company also owns, operates, and charters a fleet of vessels consisting of tugs, cargo barges, crane barges, split hopper barges, workboats, grab dredgers, landing crafts, tankers, anchor handling tugs, and anchor handling towing/supply vessels for marine contractors in the marine infrastructure and construction, cargoes and equipment transportation, and land reclamation industries; and provides transportation services. In addition, it offers cutting systems, pumping systems, dragheads, dredge line components, and other components, as well as dredge automation products; and market research and public opinion polling services. Further, the company engages in the provision of agency, handling, and consultancy services; and leasing of intellectual property. ASL Marine Holdings Ltd. owns and operates shipyards in Singapore and Indonesia. As of June 30, 2022, it had a fleet of 229 vessels. ASL Marine Holdings Ltd. was founded in 1974 and is based in Singapore.","Capital One Financial Corporation operates as the financial services holding company for the Capital One Bank (USA), National Association; and Capital One, National Association, which provides various financial products and services in the United States, Canada, and the United Kingdom. It operates through three segments: Credit Card, Consumer Banking, and Commercial Banking. The company accepts checking accounts, money market deposits, negotiable order of withdrawals, savings deposits, and time deposits. Its loan products include credit card loans; auto and retail banking loans; and commercial and multifamily real estate, and commercial and industrial loans. The company also offers credit and debit card products; online direct banking services; and treasury management and depository services. It serves consumers, small businesses, and commercial clients through digital channels, branches, caf\u00e9s, and other distribution channels located in New York, Louisiana, Texas, Maryland, Virginia, New Jersey, and California. Capital One Financial Corporation was founded in 1988 and is headquartered in McLean, Virginia.","Cembra Money Bank AG provides consumer finance products and services in Switzerland. The company offers savings products, including medium-term notes and deposit accounts; loans comprising cash, consumer, personal, business, and auto loans; credit card receivables; and leasing services for new and used vehicles, including cars, light commercial vehicles, motorcycles, and caravans, as well as corporate leasing services. It also provides financial protection products in case of involuntary unemployment, accident, illness, or disability; travel and flight, and card protection insurance products; investment products; and credit cards, mobile payment, and e-services. In addition, the company offers financing solutions to small businesses under the Cembra Business brand, as well as invoice financing services. The company serves private and self-employed individuals, and small and medium enterprises. It operates through a network of branches, as well as through various sales channels, such as the internet, credit card partners, independent intermediaries, and approximately 4,000 car dealers. The company was formerly known as GE Money Bank Aktiengesellschaft and changed its name to Cembra Money Bank AG in October 2013. Cembra Money Bank AG was founded in 1912 and is headquartered in Zurich, Switzerland.","Elektro Redes S.A. engages in the distribution of electricity to homes and businesses in Brazil. The company distributes electricity to 223 cities of S\u00e3o Paulo and 5 cities of Mato Grosso do Sul. It serves approximately 6 million people. The company was formerly known as Elektro Eletricidade e Servi\u00e7os S.A. and changed its name to Elektro Redes S.A. in August 2016. The company was founded in 1998 and is headquartered in Campinas, Brazil.","Triton International Limited engages in the acquisition, leasing, re-leasing, and sale of various types of intermodal containers and chassis to shipping lines, and freight forwarding companies and manufacturers. It operates in two segments, Equipment Leasing and Equipment Trading. The company primarily leases dry, refrigerated, special, and tank containers; and chassis used for the transportation of containers, as well as provides maritime container management services. As of December 31, 2021, its total fleet consisted of 4.3 million containers and chassis representing 7.3 million twenty-foot equivalent units or 8.0 million cost equivalent units. The company also purchases containers from container manufacturers, shipping line customers, and other sellers, as well as resells these containers to container retailers and users. It operates in Asia, Europe, the Americas, Bermuda, and internationally. The company was founded in 1980 and is based in Hamilton, Bermuda.","D-Market Elektronik Hizmetler ve Ticaret A.S. operates e-commerce platforms in Turkey. The company operates www.hepsiburada.com, a retail website that provides its retail customers a range of merchandise, including electronics and non-electronics, such as books, sports, toys, kids and baby products, cosmetics, furniture, etc. It also offers HepsiExpress, an app-in-app initiative and on-demand delivery service that delivers groceries, water, and flowers; HepsiJet that provides last- mile delivery services; He
