psiLojistik, which offers storage and fulfillment services; HepsiMat, a pick-up and drop-off point; HepsiAd that provides advertising service and data driven insights; HepsiGlobal for discovering and purchasing products from international merchants online; Hepsipay, which offers an e-money and payment services; and HepsiFly for buying airline tickets online. The company was incorporated in 2000 and is headquartered in Istanbul, Turkey.","Sealed Air Corporation provides food safety and security, and product protection solutions and equipment in North America, South America, Europe, the Middle East, Africa, and the Asia Pacific. It operates through two segments, Food and Protective. The Food segment offers integrated packaging materials and automation equipment solutions to provide food safety and shelf life extension, reduce food waste, automate processes, and optimize total cost for food processors in the fresh red meat, smoked and processed meats, poultry, seafood, plant-based, and dairy markets under the CRYOVAC, CRYOVAC Grip &amp; Tear, CRYOVAC Darfresh, Simple Steps, and Optidure brands. This segment sells its solutions directly to customers through its sales, marketing, and customer service personnel. The Protective segment provides foam, inflatable, suspension and retention, temperature assurance packaging solutions to protect goods to e-commerce, consumer goods, pharmaceutical and medical devices, and industrial manufacturing markets under the SEALED AIR, BUBBLE WRAP, AUTOBAG, SEALED AIR, AUTOBAG, Instapak, Korrvu, Kevothermal, and TempGuard brands. This segment sells its solutions through supply distributors, as well as directly to fabricators, original equipment manufacturers, contract manufacturers, logistics partners, and e-commerce/fulfillment operations. Sealed Air Corporation was incorporated in 1960 and is headquartered in Charlotte, North Carolina.","Winix Inc. manufactures and sells home appliances in South Korea and internationally. The company's products include air purifiers, dehumidifiers, humidifiers, fan heaters, water purifiers, and filter/accessories. It also offers refrigerator coolers, air conditioner parts, heat exchangers, cold and hot water heaters, condensers, and hot air machines. In addition, the company engages in the real estate rental business. Winix Inc. was founded in 1973 and is headquartered in Siheung, South Korea.","Zoom Video Communications, Inc. provides unified communications platform in the Americas, the Asia Pacific, Europe, the Middle East, and Africa. The company offers Zoom Meetings that offers HD video, voice, chat, and content sharing through mobile devices, desktops, laptops, telephones, and conference room systems; Zoom Phone, an enterprise cloud phone system; and Zoom Chat enables users to share messages, images, audio files, and content in desktop, laptop, tablet, and mobile devices. It also provides Zoom Rooms, a software-based conference room system; Zoom Hardware-as-a-Service allows users to access video communication technology from third party equipment; Zoom Conference Room Connector, a gateway for SIP/H.323 endpoints to join Zoom meetings; Zoom Events, which enables users to manage and host internal and external virtual events; OnZoom, a prosumer-focused virtual event platform and marketplace for Zoom users to create, host, and monetize online events; and Zoom Webinars to provide video presentations to large audiences from many devices. In addition, the company offers Zoom Developer Platform that enables developers, platform integrators, service providers, and customers to build apps and integrations using Zoom's video-based communications solutions, as well as integrate Zoom's technology into their products and services; Zoom App Marketplace, which helps developers to publish their apps, as well as third-party integrations of Zoom; and Zoom Contact Center, an omnichannel contact center solution. It serves individuals; and education, entertainment/media, enterprise infrastructure, finance, government, healthcare, manufacturing, non-profit/not for profit and social impact, retail/consumer products, and software/Internet industries. The company was formerly known as Zoom Communications, Inc. and changed its name to Zoom Video Communications, Inc. in May 2012. The company was incorporated in 2011 and is headquartered in San Jose, California.","Acomo N.V., together with its subsidiaries, engages in sourcing, trading, processing, packaging, and distributing conventional and organic food products and ingredients for the food and beverage industry worldwide. The company operates through five segments: Spices and Nuts, Edible Seeds, Organic Ingredients, Tea, and Food Ingredients. The Spices and Nuts segment provides tropical products, including pepper, nutmeg, desiccated coconut, shelled and unshelled nuts, dried fruits, dehydrated vegetables, herbs, chocolate, rice crackers, and snack products. The Edible Seeds segment offers in-shell and kernel sunflower, poppy, sesame, and other edible seeds. The Organic Ingredients segment provides a range of organic food products and ingredients in various categories, such as cocoa, coffee, fruit and vegetables, edible seeds, nuts and dried fruits, oils, and premium juice. The Tea segment sources and supplies tea products. The Food Ingredients segment produces and supplies culinary and functional ingredients, wet and dry blends, and spice mixes for food companies. The company was formerly known as Amsterdam Commodities N.V. and changed its name to Acomo N.V. in June 2022. Acomo N.V. was founded in 1819 and is based in Rotterdam, the Netherlands.","Kitron ASA operates as an electronics manufacturing services company in Norway, Sweden, rest of Europe, the United States, and internationally. It manufactures electronics that are embedded in the customers' products; and box-built electronic products. The company's services include development services, such as product development, product management, re-engineering, and value analysis/value engineering; and industrialization services, including prototype manufacturing, evaluation of new products, component engineering and database, test development, design and build of high level assembly lines, and environmental durability testing. Its services also comprise sourcing and procurement services; manufacturing, assembling, and testing of electronic products for the professional market; redesign, repair, and maintenance; logistics and distribution; and augmented reality manufacturing services. Kitron ASA was founded in 1996 and is headquartered in Billingstad, Norway.","Lassila &amp; Tikanoja Oyj operates as a service company in Finland, Sweden, and Russia. It operates through four segments: Environmental Services, Industrial Services, Facility Services Finland, and Facility Services Sweden. The company offers waste management and recycling services; sells receptacles, and related maintenance and circular economy solutions; and provides wood-based and recycled fuels, and wood raw materials, as well as forest services to forest owners. It also provides solutions for industrial material flows and their utilization, as well as industrial process cleaning solutions; and engages in the collection and disposal of hazardous waste and sewer system maintenance and repair solutions. In addition, the company offers support services and services for cleaning, property maintenance, and real estate management, as well as repair and renovation services; and building automation, refrigeration technology, and energy management services. Further, it provides support services and services for cleaning and technical services. Lassila &amp; Tikanoja Oyj was founded in 1905 and is headquartered in Helsinki, Finland.","Align Technology, Inc., a medical device company, designs, manufactures, and markets Invisalign clear aligners and iTero intraoral scanners and services for orthodontists and general practitioner dentists, and restorative and aesthetic dentistry. It operates in two segments, Clear Aligner; and Scanners and Services. The Clear Aligner segment consists of comprehensive products, including Invisalign comprehensive treatment that addresses the orthodontic needs of teenage patients, such as mandibular advancement, compliance indicators, and compensation for tooth eruption; and Invisalign First Phase I and Invisalign First Comprehensive Phase 2 package for younger patients generally between the ages of seven and ten years, which is a mixture of primary/baby and permanent teeth. This segment's non-comprehensive products comprise Invisalign moderate, lite and express packages, and Invisalign go; and non-case products include retention products, Invisalign training fees, and sales of ancillary products, such as cleaning material, and adjusting tools used by dental professionals during the course of treatment. The Scanners and Services segment offers iTero scanner, a single hardware platform with software options for restorative or orthodontic procedures; restorative software for general practitioner dentists, prosthodontists, periodontists, and oral surgeons; and software for orthodontists for digital records storage, orthodontic diagnosis, and for the fabrication of printed models and retainers. This segment also provides computer-aided design and computer-aided manufacturing services; ancillary products, such as disposable sleeves for the wand; iTero model and dies; third party scanners and digital scans; Invisalign outcome simulator, a chair-side and cloud-based application for the iTero scanner; Invisalign progress assessment tool; and TimeLapse technology, which allows doctors or practitioners to compare a patient's historic 3D scans to the present-day scan. The company sells its products in the United States, Switzerland, China, and internationally. Align Technology, Inc. was incorporated in 1997 and is headquartered in Tempe, Arizona.","Atara Biotherapeutics, Inc., an off-the-shelf T-cell immunotherapy company, develops treatments for patients with cancer, autoimmune, and viral diseases in the United States. It is developing tabelecleucel, a T-cell immunotherapy that is Phase 3 clinical trials for the treatment of epstein-barr virus (EBV) driven post-transplant lymphoproliferative disease, as well as hematologic and solid tumors, including nasopharyngeal carcinoma. The company is also developing next-generation CAR T immunotherapies for patients with hematologic malignancies and solid tumors, including ATA2271 and ATA3271 for mesothelin; and ATA2431 and ATA3219 for B-cell malignancies, as well as ATA188 for the treatment of multiple sclerosis. In addition, it develops ATA368 program for patients with human papillomavirus associated cancers. Atara Biotherapeutics, Inc. has a license agreement with Memorial Sloan Kettering Cancer Center; license, and research and development collaboration agreement with QIMR Berghofer Medical Research Institute; and strategic collaboration with H. Lee Moffitt Cancer Center, as well as Bayer AG for mesothelin-targeted CAR T-cell therapies for solid tumors. The company was incorporated in 2012 and is headquartered in South San Francisco, California.","PPG Industries, Inc. manufactures and distributes paints, coatings, and specialty materials worldwide. The company's Performance Coatings segment offers coatings, solvents, adhesives, sealants, sundries, and software for automotive and commercial transport/fleet repair and refurbishing, light industrial coatings, and specialty coatings for signs; and coatings, sealants, transparencies, transparent armor, adhesives, engineered materials, and packaging and chemical management services for commercial, military, regional jet, and general aviation aircraft. It also provides coatings and finishes for the protection of metals and structures, such as metal fabricators, heavy duty maintenance contractors, and manufacturers of ships, bridges, and rail cars; paints, wood stains, adhesives, and purchased sundries for painting and maintenance contractors, and consumers for decoration and maintenance of residential and commercial building structures; and paints, thermoplastics, pavement marking products, and other technologies for pavement marking. The company's Industrial Coatings segment offers coatings, adhesives and sealants, and metal pretreatments, as well as services and coatings applications for appliances, agricultural and construction equipment, consumer electronics, automotive parts and accessories, building products, kitchenware, and transportation vehicles and other finished products; and on-site coatings services. It also provides coatings for metal cans, closures, plastic tubes, and promotional and specialty packaging; amorphous precipitated silica for tire, battery separator, and other end-uses; TESLIN substrates for labels, e-passports, drivers' licenses, breathable membranes, and loyalty and identification cards; and organic light emitting diode materials, displays and lighting lens materials, optical lenses, color-change products, and photochromic dyes. The company was incorporated in 1883 and is headquartered in Pittsburgh, Pennsylvania.","Paycom Software, Inc. provides cloud-based human capital management (HCM) solution delivered as software-as-a-service for small to mid-sized companies in the United States. It offers functionality and data analytics that businesses need to manage the employment life cycle from recruitment to retirement. The company's HCM solution provides a suite of applications in the areas of talent acquisition, including applicant tracking, candidate tracker, background checks, on-boarding, e-verify, and tax credit services; and time and labor management, such as time and attendance, scheduling/schedule exchange, time-off requests, labor allocation, labor management reports/push reporting, and geofencing/geotracking, and Microfence, a proprietary Bluetooth. Its HCM solution also offers payroll applications comprising better employee transaction interface, payroll and tax management, Paycom pay, expense management, mileage tracker/fixed and variable rates, garnishment management, and GL concierge applications; and talent management applications that include employee self-service, compensation budgeting, performance management, position management, and Paycom learning and content subscriptions, as well as my analytics, which offer employment predictor reporting. In addition, its HCM solution provides manager on-the-go that gives supervisors and managers the ability to perform a variety of tasks, such as approving time-off requests and expense reimbursements; direct data exchange; ask here, a tool for direct line of communication to ask work-related questions; document and checklist; government and compliance; benefits administration/benefits to carrier; COBRA administration; personnel action and performance discussion forms; surveys; and affordable care act applications, as well as Clue, which securely collect, track, and manage the vaccination and testing data of the workforce. Paycom Software, Inc. was founded in 1998 and is headquartered in Oklahoma City, Oklahoma.","Regency Centers is the preeminent national owner, operator, and developer of shopping centers located in affluent and densely populated trade areas. Our portfolio includes thriving properties merchandised with highly productive grocers, restaurants, service providers, and best-in-class retailers that connect to their neighborhoods, communities, and customers. Operating as a fully integrated real estate company, Regency Centers is a qualified real estate investment trust (REIT) that is self-administered, self-managed, and an S&amp;P 500 Index member.","Formycon AG develops and markets biosimilar products. Its product pipeline includes FYB201, a biosimilar candidate for Lucentis, an ophthalmic drug used in the treatment of neovascular age-related macular degeneration and other serious eye diseases; FYB202, a biosimilar candidate for Stelara, a biopharmaceutical used in the treatment of inflammatory diseases, such as moderate to severe psoriasis, as well as for the treatment of Crohn's disease and ulcerative colitis, which is in the Phase III clinical trial; and FYB203, a biosimilar candidate for Eylea to treat neovascular age-related macular degeneration and other eye diseases that is in Phase III clinical trials. The company is also developing FYB206; and FYB207, an antiviral drug for the treatment of COVID-19. It has a collaboration agreement with Leukocare AG to develop stable formulations for various candidates in its product pipeline. The company was formerly known as Nanohale AG and changed its name to Formycon AG in 2012. Formycon AG was founded in 1999 and is headquartered in Planegg, Germany.","WORLDEX INDUSTRY &amp; TRADING CO., Ltd. is a Korea-based company mainly engaged in the manufacturing and distribution of silicon parts used in semiconductor surface etching process. The Company's product portfolio consists of silicon parts, including silicon electrodes, silicon rings, silicon boats, silicon solar batteries and others, quartzes as well as alumina products used for semiconductor, liquid crystal display (LCD) and liquid emitting diode (LED) parts. The Company distributes its products within domestic market and to the overseas markets. It is also engaged in the manufacturing and distribution of LED lightings through its subsidiary.","Rexon Industrial Corp.,Ltd designs, manufactures, and sells bench top/stationary machinery, and consumer and commercial grade fitness products in Taiwan, the United States, Europe, the rest of Asia, and internationally. The company offers power tools, including sawing, drilling, demolishing, grinding, polishing/sanding, cutting, and planning/routing. It also provides fitness equipment, such as treadmills, as well as after-sale services. In addition, the company engages in merchandise trading activities; and the manufacture and sale of electric components and woodworking tools. The company was formerly known as KuoHsing Machinery Ltd. and changed its name to Rexon Industrial Corp.,Ltd in 1976. The company was founded in 1972 and is based in Taichung, Taiwan.","China Metal Products Co., Ltd. designs, manufactures, and retails iron casting products in Taiwan, the United States, Japan, China, Europe, South America, and internationally. The company operates through three segments: Metal Manufacturing, Real Estate Development, and Lifestyle Hospitality. The company designs, develops, manufactures, and sells vehicle and machinery parts; retails auto parts; and offers management and consulting services. It also develops and leases resident, commercial buildings, and factories; and operates hotels under the Hotel National and Splendor Hotel Taichung names, as well as amusement park under the Shangrila Paradise name. In addition, the company operates Park Lane by CMP and Park Lane by Splendor lifestyle shopping malls; and foundation for arts and culture. Further, it develops, manufactures, and sells farm and industrial wagon parts, and household appliances parts, as well as provides after sales services. China Metal Products Co., Ltd. was founded in 1972 and is based in Taipei City, Taiwan.","Airmate (Cayman) International Co Limited researches, develops, manufactures, and sells household appliances in China, Japan, South Korea, and internationally. The company offers electric fans and heaters, air purifiers, humidifiers, dehumidifiers, and fresh air systems. It also provides precision molds treatment services. The company also offers its products through online store. Airmate (Cayman) International Co Limited was founded in 1973 and is based in George Town, the Cayman Islands.","China Man-Made Fiber Corporation manufactures and sells man-made fibers, cellophane, polyamine fiber, polyester fiber, chemicals, and the raw materials primarily in Taiwan. The company offers monoethylene, diethylene, and triethylene glycol; ethylene oxide (EO), and nonyl-phenol; polyester chips, polyester partially oriented yarns, polyester spin drawn yarns, and polyester drawn textured yarns; and polyethylene glycol and alkane ether, polyethylene glycol and alkyl ether, castor oil EO addenda, polyethylene glycol propanamine, polyethylene glycol and fatty acid esters, polyethylene glycol, poly-propylene glycol and polyethylene glycol, trimethylolpropane EO additive, polyol EO, PO addenda, spinning oil agent, lubricating oil esters, plastic slip agents, cosmetic esters, cleaning agent esters, and bath softeners. It also offers machinery; leases and sells national housing and commercial buildings; distributes, sorts, and stores various products; manages supermarkets; trades in fresh foods, vegetables, fish, dried merchandise, and various seasonings; and operates gas stations. In addition, the company manufactures and sells steam, and industrial and commercial electricity by cogeneration; oxygen, liquid oxygen, nitrogen, liquid nitrogen, air argon, liquid argon, carbon dioxide, and compressed air; cosmetics and cleaning appliances; and food products. Further, it distributes and warehouses beverages; and engages in restaurant business. Additionally, the company provides short-term accommodation services; deposit, lending, foreign exchange, wealth management, corporate banking, electronic finance, trust, and investment products; insurance and general investment services; and securities brokerage services, as well as agency, distribution, and contract bidding services for installation of cogeneration and pollution control equipment. The company also exports its products. China Man-Made Fiber Corporation was founded in 1955 and is headquartered in Taipei City, Taiwan.","Maxigen Biotech Inc. engages in the development, manufacture, and marketing of biomedical and skincare products in Taiwan and internationally. The company offers Formagraft, a bone graft substitute; Formasetin, a bone void filler; and intra-articular injections under the ArtiAid, ArtiAid Plus, and ArtiBest names for use in orthopedic area. It also provides Foramic, a bone substitute granule; MaxiBone, a calcium phosphate ceramic; and GingivAid, a collagen dental grafts for use in orthopedic and dental areas. In addition, the company offers FormaAid, a collagen membrane; and E-TECH DENTISTAR II sterilizer and disinfectant for use in dental area, as well as HealiAid, a collagen wound dressing product for use in dental and wound dressing area. Further, it provides ophthalmic viscoelastic device under the ViscAid, PreviscAid, and BiVisc names; and Formaderm, a dermal filler injection for use in plastic surgery. Additionally, the company offers skincare products, including face, neck, body, limbs, and other masks; and make up remover, cleansing, exfoliating, toner, essence, men's care, sunscreen, body care, hand/foot care, and special care products. Maxigen Biotech Inc. was founded in 1998 and is based in Taoyuan City, Taiwan.","Kao Hsing Chang Iron &amp; Steel Corp. produces and sells steel pipes and plates and tin plates in Taiwan. It offers cold and hot rolled and coated steel coils. The company also engages in metal building structures, components manufacturing, leasing, parking lot management, and other wholesale business activities. The company was founded in 1966 and is based in Kaohsiung City, Taiwan.","King Slide Works Co., Ltd., together with its subsidiaries, manufactures furniture hardware in Taiwan, China, the United States, and internationally. It also designs, manufactures, and sells server rail, industrial slide, home furniture fittings, and other mechanical products. The company offers kitchen/furniture solutions, including metal and wood drawer systems, undermount slides, ball bearing slides, epoxy coating drawer slides, and hinges; consumer electronics, such as mobile phones; and ultra-thin server slide rail kits, electronic device rail kits, and cable management arm for cloud computing data centers. In addition, it provides products for special applications, such as home appliances, motorhome and RVs, office equipment, medical storage, and other applications. King Slide Works Co., Ltd. was incorporated in 1986 and is headquartered in Kaohsiung, Taiwan.","Koshidaka Holdings Co., Ltd. operates a karaoke business and a bath house business in Japan and internationally. The company has Karaoke Manekineko, a karaoke network; and One Kara, a karaoke box for people who sing alone. It also has Maneki no Yu bath houses to enjoy a natural hot spring bath, as well as enjoy outstanding food, relax, or even hold a banquet or other event. In addition, the company also provides real estate leasing and management services. Koshidaka Holdings Co., Ltd. was founded in 1967 and is headquartered in Tokyo, Japan.","Lite-On Technology Corporation, together with its subsidiaries, manufactures and markets computer software, hardware, peripherals, and components in Asia and internationally. It also offers monitors, multifunction and all-in-one printers, cameras, and Internet systems and image-processing equipment; information storage and processing equipment, electronic components, and office equipment; electronic coils, transformers, power suppliers, and electronic hardware parts; light-emitting diode (LED) products; automotive electronic products; and optical lens modules and optoelectronic components. In addition, it provides modules and plastic, LED optical, rubber products, system, power control, and energy management products; medical equipment, mobile phone modules and assembly lines, phone chargers, energy-saving lights, keyboards, display devices, power supplies, printers, scanners, mobile terminal equipment, automotive parts and components, modules of automotive recorders, and rectifiers; computer cases and hosts; and optical disc drives. Further, the company produces, manufactures, sells, imports, and exports photovoltaic devices, key electronic components, telecommunications and information technology equipment, semiconductor applications, general lighting, and renewable energy products and systems; and wholesales, imports, exports, and installs street, signal, and scenery lights, as well as electronic components. Additionally, it offers information outsourcing and system integration, investment, electronic contract manufacturing, import and export, automotive industry maintenance, project construction and maintenance, energy technology, solar energy engineering, sales agent, technology consulting, maintenance equipment, real estate management, leasing, and ODM services; and market research, after-sales, and customer services. The company was founded in 1975 and is headquartered in Taipei, Taiwan.","Echomarketing Co.,Ltd. provides marketing services in South Korea and internationally. It offers marketing automation, performance analytics, campaign optimization, search marketing management, and customer value management solutions. The company was founded in 2003 and is headquartered in Seoul, South Korea.","STUDIO ALICE Co.,Ltd. operates children's photo studios in Japan. The company offers maternity photo, new born photo, hundred days celebration, peach/double fifth festival, half birthday, birthday photo, happy birthday Shichigosan, admission/enrollment/graduation, 1/2 coming-of-age ceremony, thirteen celebration, coming-of-age ceremony, bridal, family photo/longevity celebration, portrait photo, Disney character shooting, and business trip shooting services. It also provides print, album, photo mount, display photo, postcard, photography accessories, and other products. The company was founded in 1974 and is headquartered in Osaka, Japan.","Digital Arts Inc. develops and markets internet security software and appliances in Japan, the United States, Europe, and the Asia Pacific. It offers DigitalArts@Cloud that provides web security and email security in the cloud; i-FILTER, a web filtering software for corporations; i-FILTER Browser &amp; Cloud, a web security solution for smart devices that prevents private usage, visualizes web access with logs and reports, and prevents leaks of critical information; i-FILTER for consumers, a parental control software; D-SPA, a proxy appliance product; m-FILTER, an email filtering software for corporations; and FinalCode, a persistent password-less file security and tracking solution. The company also provides consulting services related to information security solutions; and support services, software version updates, and web filtering databases. Digital Arts Inc. was founded in 1995 and is headquartered in Tokyo, Japan.","RITEK Corporation manufactures and markets optical storage media products in Taiwan, the United States, rest of Asia, Europe, and internationally. The company offers storage media product lines, including optical storage media comprising CDs, DVDs, and Blu-ray discs; electronic storage media, which include flash memory cards, USB flash drives, portable hard disc drives, solid state drives, and others. It also provides solar modules comprising mono and poly-crystalline solar modules; and integrating solar systems; OLED display panels, ITO glasses, and patterned sapphire substrate solutions; metal masks; and biological detection discs. In addition, the company engages in organic light emitting diode, conductive glass, and battery manufacturing and trading; lighting equipment manufacturing; venture capital investment; property development and trading; micro bubble system manufacturing and sale; and electronic parts and components manufacturing businesses, as well as offers silicone chemicals, concrete waterproofing, DIY repairs, home cleaning/personal care products, plastic precision injection products, and management consulting services. RITEK Corporation was founded in 1957 and is headquartered in Hsinchu City, Taiwan.","Twinhead International Corp. offers rugged notebooks, rugged tablets, embedded solutions, and vehicle mount computers worldwide. The company provides mobile computers; rugged tablet PCs; semi-rugged mobile computers; mobile thin clients; medical tablet PCs; and other customized mother boards/systems. It also offers ODM, and partial or full customization services; project management services; manufacturing services, including fully rugged product and special feature validations, flexible production system, supply chain management, and purchasing models; and certification application services. The company serves government, military, health care, field sales/insurance, public safety, retail, hospitality, transportation/distribution, utilities/oil and gas, communication, agriculture, and field service industries. Twinhead International Corp. was incorporated in 1984 and is headquartered in Taipei, Taiwan.","Weltrend Semiconductor, Inc., a fabless semiconductor company, engages in planning, designing, testing, developing, and distributing integrated circuit (IC) products in Taiwan and internationally. The company offers display ICs, including advanced driver assistance system SoC, display MCU, FPD SoC, 3D active shutter glasses ICs and smart projectors; and consumer ICs, such as consumer MCUs, touch device controllers, heart rate monitors, USB HID controllers, boosted NFC card solutions, and MSR and barcode decoders. It also provides power management and analog ICs comprising USB power and charging port controllers, motor drivers, LED drivers, SPS supervisors, and OP amplifiers; and microcontrollers include 8-bit ADC type MCUs, Andes and Arm based 32-bit MCUs products, and BLDC motor control ICs. In addition, the company distributes electronic components. Weltrend Semiconductor, Inc. was founded in 1989 and is headquartered in Hsinchu City, Taiwan.","Visual Photonics Epitaxy Co., Ltd. researches, develops, manufactures, and sells optoelectronic semiconductors epitaxy and optoelectronic components products in Taiwan, the United States, and internationally. The company offers gallium arsenide (GaAs) heterojunction bipolar transistor (HBT), low turn-on voltage HBT, high voltage HBT, InP HBT and HEMT, GaAs pseudomorphic high electron mobility transistor (PHEMT) and BiHEMT, and GaN epi wafers. It also provides GaAs PD, InGaAs PD and APD, Zn diffusion ready InGaAs PD and APD, long wavelength InGaAs PD, F-P and DFB LD, and VCSEL epi wafers; and solar cell epi wafers, as well as customerized epi foundry services. The company was incorporated in 1996 and is based in Taoyuan City, Taiwan.","Cathay Real Estate Development Co.,Ltd. engages in the construction of residential and commercial buildings for leasing or selling in Taiwan. It operates in two segments, Movable Property and Real Estate Development Department; and Others. The company offers construction management, consultancy, and business management services. It is also involved in the wholesale of drugs and medical goods; general trade and investing; and service industry businesses. Cathay Real Estate Development Co.,Ltd. was founded in 1964 and is headquartered in Taipei, Taiwan.","Prince Housing &amp; Development Corp. engages in the construction business primarily in Taiwan. The company constructs, leases, and sells public housings, commercial buildings, and parking lots/parking towers, as well as tourism/recreation places, such as children's playgrounds, water parks, etc. It is also involved in the hotels and catering, plywood manufacturing, real estate management, real estate trading and leasing, apartment management, security, electricity and water pipe maintenance, and general investment activities, as well as offers security services. The company was incorporated in 1973 and is based in Taipei City, Taiwan.","Shan-Loong Transportation Co., Ltd engages in freight transportation, container trucking, truck repair and maintenance, gas station, and import and export business in Taiwan and internationally. The company provides the container, bulk, fuel, and hazardous material transportation services. It also offers container loading/unloading, warehouse management, order processing, temperature warehousing, delivery, and reverse logistics, as well as handling, picking, and processing services. In addition, the company provides customs brokerage services; sea, air, and land shipping services; and product storage management services. Further, it owns a network of 76 gas stations that offers fuels, such as diesel and octane, as well as provides car and scooter wash services. The company was formerly known as Wang Pai Transportation Co., Ltd. and changed its name to Shan-Loong Transportation Co., Ltd in 1982. Shan-Loong Transportation Co., Ltd was incorporated in 1976 and is headquartered in New Taipei City, Taiwan.","Gourmet Master Co. Ltd., an investment holding company, operates and franchises a chain of cafes in China, Taiwan, the United States, and internationally. The company operates its cafes under the 85\u00b0C name that provide coffee, cake, and bakery goods. As of December 31, 2019, it operated approximately 400 stores in Taiwan, 600 stores in China, 65 stores in the United States, 18 stores in Australia, and 8 stores in Hong Kong. It also provides birthday cakes, delicacy cakes, cake rolls, specialty cakes, toasts, Taiwanese/Japanese/European/Danish bread, sandwiches, donuts, coffee, tea, milk tea, smoothies, shakes, and juices; and others, including pineapple cakes, nougats, egg rolls, and gift boxes. Gourmet Master Co. Ltd. was founded in 2005 and is based in Taichung, Taiwan.","PAL GROUP Holdings CO., LTD. engages in the apparel, and miscellaneous goods and accessories businesses primarily in Japan. The company engages in the manufacture, wholesale, and retail of apparel products, including men's and women's clothing and accessories. It also offers miscellaneous daily goods. As of February 28, 2022, the company operated through a network of 902 stores. The company was formerly known as Pal Co., Ltd. and changed its name to PAL GROUP Holdings CO., LTD. in September 2016. PAL GROUP Holdings CO., LTD. was incorporated in 1973 and is headquartered in Osaka, Japan.","Wowprime Corp. operates restaurants and coffee/tea shops in Taiwan and Mainland China. The company engages in the retail sale of agricultural and husbandry products, food products, and groceries; and catering management, investment, management consulting, and food trading activities, as well as manufactures bakery products. It also provides catering services, including Western-style steak, Japanese-style creative cuisine, original Yakiniku, Hokkaido kombu pot, Kaiseki creative cuisine, French-style teppanyaki, Japanese pork chop curry, stone pot and shabu-shabu, vegetable dishes, etc. The company was incorporated in 1993 and is based in Taichung, Taiwan.","IEI Integration Corp. provides industrial computer products worldwide. It provides AIoT and edge computing products, DevCloud solutions, PUZZLE Dev. Kits, FLEX AIoT developer kits, TANK AIoT developer kits, AIoT edge insights solutions, embedded systems, AI training server systems, VPU, FPGA, and CPU accelerators, backplanes, and assistant robots; networking products comprising network appliances, including routers, VPN, switches, firewalls, UTMs, etc.; and storage servers, network modules, and industrial network switches. The company also offers embedded computers consisting of full size and half size single board computers; industrial motherboards and embedded boards; ETX/COM EXPRESS/Q7; PEMUX series backplanes; rackmount, embedded, and compact chassis; LCD converter boards; PCI/PCIe expansion cards; and wireless, mini-PCIe, and TPM modules. In addition, it provides embedded systems, including AI-powered box PCs, DIN-rail embedded systems, rugged box PCs, compact size embedded systems, medical box PCs, transportation embedded systems, digital signage embedded systems, and QTS gateways, as well as rackmount, embedded, and compact chassis; panel PC and monitor products, such as heavy and light industrial, RISC-based, healthcare, and transportation PCs; industrial monitors; and handheld devices. Further, the company offers power supply products, adapters, DC UPS modules, DC to DC modules, and peripherals, such as industrial compact flash cards, CPU coolers, cables and connectors, mounting kits and stands, drive bays, and e-window tool kits. Its products are used in computer-based applications, such as factory automation, computer telephony integration, networking appliances, security, and systems, as well as in various fields comprising the Internet of Things, national defense, police administration, transportation, communication base stations, and medical instruments. IEI Integration Corp. was founded in 1997 and is headquartered in New Taipei City, Taiwan.","SINBON Electronics Co., Ltd. manufactures and sells computer peripherals, connectors, wires, and other parts in Mainland China, the United States, Taiwan, and internationally. It operates through New Energy Business Unit, Industrial Application Business Unit, Medical Health Business Unit, Automotive Business Unit, and iComponent Solution Business Unit segments. The New Energy Business Unit segment develops, manufactures, and sells cable assembly and control modules for green energy industries, such as solar photovoltaic, wind power and offshore wind power. The Industrial Application Business Unit segment develops, manufactures, and sells industrial application products comprising robot arm control cable assemblies, control cabinet cable assemblies, and panel connection cables. The Medical Health Business Unit segment develops, manufactures, and sells medical equipment cables, including electrocardiographs, oximeters, and X-ray wiring harnesses. The Automotive Business Unit segment develops, manufactures, and sells electric vehicle charging guns and charging piles, automotive oxygen sensors, and parking-related equipment cables. The iComponent Solution Business Unit segment develops, manufactures, and sells communication related cables, such as smart phones, smart wearable devices and VR /AR HMD devices. The company also engages in the logistics, renewable energy investment management consulting, and new energy technology development businesses; and sale of electronic material. The company was incorporated in 1989 and is headquartered in New Taipei City, Taiwan.","Novatek Microelectronics Corp., together with its subsidiaries, engages in research and development, manufacture, and sale of integrated circuit chips for speech, communication, computer peripheral, LCD driver IC system, embedded MCU, DSP, and system applications. The company provides display driver ICs for LCD displays, televisions (TVs), notebook computers, desktop monitors, cameras, tablet PCs, automotive display screens, smart phones, and wearable products; and system on chips products for digital and smart TVs, notebook computers, desktop monitors, mobile phones, tablet PCs, camera modules, dashcam recording, IP cams, car backup camera modules, automotive safety assistance systems, and multimedia and mobile phone camera module applications. It is also involved in the trading and consulting services; offers electronic spare parts; and provision of design, development, amendment, testing, and related consulting services for multimedia VLSI software. The company has operations in Taiwan, Asia, and internationally. Novatek Microelectronics Corp. was incorporated in 1997 and is headquartered in Hsinchu, Taiwan.","Aopen Inc. provides digital signage technologies in Taiwan. It offers embedded PCs, such as digital signage media players, video wall controllers, network video recorders, industrial media players, medical box PC, and chrome boxes; touch panel PCs and chrome bases; commercial displays, including digital signage, industrial, medical, and commercial monitors. It also provides gaming, consumer, and portable monitors, as well as mini projectors, all-in-one PCs, gaming gadgets, and home entertainment products. In addition, the company offers accessories, including wall mounts, stands, panel PC peripherals, medical IT, and USB webcam. It serves QSR, smart retail, smart manufacturing, hospitality, healthcare, education, and transportation industries. Aopen Inc. was founded in 1996 and is based in Taipei, Taiwan.","Channel Well Technology Co.,Ltd. engages in the processing, manufacturing, and trading of power supply and electrical appliances worldwide. It offers PC and IPC power supply, industrial power supply, wireless charging transmitter and receiver, LED lighting driver/power, enclosed switching power, and open frame power products, as well as telecom power systems, wireless chargers/power banks, adapters, USB chargers, electric vehicle chargers, power cables/electronic wires, magnetic components, and heat sinks. The company was incorporated in 1993 and is headquartered in Taoyuan City, Taiwan.","DOUTOR NICHIRES Holdings Co., Ltd. manages restaurants and cafes in Japan. It manufactures and sells bread and pastry products; roasts and sells coffee; and imports, exports, purchases, and sells food products. The company also engages in the manufacture and wholesale of confectionary products; operation of bakery shops; wholesale of coffee machines, etc.; wholesale of fruits and vegetables; processing and wholesale of meat; manufacture of hams, sausages, and bacons; manufacture and wholesale of dressing products; and import of coffee beans and tea. In addition, it designs, constructs, maintains, and cleans stores; and operates natural food stores. DOUTOR NICHIRES Holdings Co., Ltd. was founded in 2007 and is headquartered in Tokyo, Japan.","The Investment Corporation was listed on the Tokyo Stock Exchange real estate investment trust market on February 7, 2014 with the support of all stakeholders, including unitholders, and gradually expanded its asset size. I've come. The Investment Corporation is investing heavily in \u0093Tokyo Com n recognition solution; TOPSIC, an online and in real time cloud solution to evaluate a range of engineers' programming skills from beginner to advanced; SI Object Browser, a database development support tool; SI Object Browser ER, a data modeling tool; and SI Object Browser Designer, an AI design document preparation tool. Its products also comprise SI Object Browser PM, an integrated project management tool; SI Web Shopping, an EC site construction package software; and GRANDIT, a Web-based ERP. In addition, the company offers consulting services. System Integrator Corp. was founded in 1995 and is headquartered in Saitama, Japan.","PCI Holdings, Inc. engages in the information service business. It develops embedded control software for automobiles, heavy machinery, construction machinery, etc.; and equipment for telecommunications field, including mobile communication, as well as other information home appliances, various industrial equipment, semiconductor manufacturing equipment, etc. The company also develops software, middleware, and application that control various devices; firmware, such as shooting control for digital cameras; and software for control semiconductor inspection equipment. In addition, it develops information software for finance, manufacturing, distribution, and other companies; and social infrastructure software for transportation and broadcasting, and IT systems. Further, the company constructs and sells solutions utilizing packaged software products; operates and maintains system; and purchases and sells other hardware, etc. Additionally, it develops Internet of Things/Internet of everything solutions; and remote monitoring systems for the power generation industry, as well as provides operation and maintenance support services for renewable energy generation facilities. The company also offers services for semiconductor development, including LSI design, test design, evaluation, and others. PCI Holdings, Inc. was incorporated in 2005 and stry Co., Ltd. and changed its name to KEIWA Incorporated in 1999. KEIWA Incorporated was founded in 1948 and is headquartered in Tokyo, Japan.","SOLXYZ Co., Ltd. develops software solutions in Japan. It engages in the development, design, manufacture, sale, leasing, and import/export of computers, peripheral devices, telecommunications equipment, and related software; collection, processing, and sale of information through telecommunications systems; and provision of servicing and consulting services related to the use of computers, and peripheral devices and software. The company is also involved in the operation, maintenance, and monitoring of computer systems; internet access service business and information provision service business; training of information processing engineers and dispatch of information processing engineers; and other businesses. The company was incorporated in 1981 and is headquartered in Tokyo, Japan.","Living Technologies Inc. engages in the real estate platform business. The company develops and manages products combining Web technology and real estate, which include real estate vertical media, real estate business support system, human resources for the real estate industry, and Internet advertising services. It provides a service for real estate and housing companies to match companies and consumers on the Web. The company's platform offers real estate sales, house and renovation, rental management, real estate personnel, business information, and real estate review services. Living Technologies Inc. was founded in 2004 and is headquartered in Tokyo, Japan.","World Known MFG (Cayman) Limited produces and sells commercial vehicle parts in the United States, the United Kingdom, Sweden, Denmark, and Japan. The company offers exhaust manifolds, disc brakes, gearbox and pump housing products, and knuckles; and diesel engine and air disc brake components. It serves customers in commercial vehicle, green energy, construction machinery, agricultural machinery, and other industrial equipment industries. The company was founded in 2015 and is based in Grand Cayman, the Cayman Islands.","OBIC Co.,Ltd., together with its subsidiaries, provides system integration, system support, office automation, and package software services. It offers system integration services, including developing ERP software products to provide integrated administrative systems comprising personnel, payroll, working condition management, marketing, and production systems, as well as related training courses. The company also provides system support services, including system operation support and maintenance, and hardware maintenance. In addition, it offers office automation services, such as sale of package software, and peripheral equipment and supplies, as well as processing of printed materials. The company was incorporated in 1968 and is headquartered in Tokyo, Japan.","Future Corporation provides IT consulting and services primarily in Japan. The company offers its services in digital marketing, IT education, e-commerce, and various other fields. The company was formerly known as Future Architect, Inc. and changed its name to Future Corporation in April 2016. Future Corporation was founded in 1989 and is headquartered in Tokyo, Japan.","ITFOR Inc. provides support services for the implementation of information technology in Japan. It develops solutions comprising consulting, system configuration, customer specific solution development, operation, and management for network security. The company also offers financial solution systems, such as credit collection, loan assessment management, scoring, collecting, tele-marketing, and local governments systems; CTI systems that offer call-center productivity enhancements; consultation and installation of open platform for retail service customers; and e-commerce systems. In addition, it provides network systems, including corporate infrastructure network, backbone network consultation and design, IP services, edge solutions for telecom carriers, network security solutions, and personal information management; and professional and consultation services, as well as customer services. The company was formerly known as CJK Co. Ltd. and changed its name to ITFOR Inc. in 2000. ITFOR Inc. was founded in 1972 and is headquartered in Tokyo, Japan.","Kobayashi Pharmaceutical Co., Ltd., together with its subsidiaries, manufactures and sells consumer products in Japan and internationally. The company provides products in the areas of healthcare, skincare, body warmer, and household. It also offers Ammeltz, a topical analgesic; Inochi no Haha, a women's health medicine; Shirt Coola, a summer cooling spray for cloths; Sarasaty lingerie soap; Bluelet Decoral, a toilet bowl cleaner and freshener; Nightmin Nasal Respiration Tape; Naishitol, a Chinese medicine; Eaude Muge, a medicated lotion for preventing acne; Itoyoji, a dental floss pick; BreathCare, an oral breath freshener capsule; Eybon, an eye wash; Netsusama sheet, a cooling gel sheet for forehead; and Sawaday, a toilet air freshener. Additionally, the company manufactures and sells pharmaceuticals, quasi-drugs, cosmetics, hygiene and paper products, health foods, and processed synthetic resin products; markets nutritional supplements and skin care products through sales promotional campaigns, such as advertising and direct mail; and sells skincare products, health foods, and other items through e-commerce channels. Further, it engages in transportation, real estate management, and advertising planning and production businesses. Kobayashi Pharmaceutical Co., Ltd. was founded in 1886 and is headquartered in Osaka, Japan.","Earth Corporation engages in the manufacture, marketing, import, and export of pharmaceutical products, quasi-drug products, medical tools, and household products in Japan and internationally. It operates through Household Products Business and General Environment and Sanitation Business segments. The company offers insecticides and repellents; gardening supplies; household products, such as mouthwash, denture-related supplies, toothpaste and related products, bath salts, deodorizing air fresheners, etc.; pet products; and chemical agents for communicable disease control, agriculture, forestry, and animal husbandry; and raw materials. In addition, it provides hygiene management services. The company markets its products under the various brands, including Earth Red, Earth No-mat, Earth Jet, ZEROdeKNIGHT, Earth Mosquito Coil, Earth Mushi Yoke Net EX, Ari no Su Korori, Goki Push Pro, Gokiburi Hoi-Hoi, Goki Jet Pro, Kobae ga Hoi Hoi, Saratect, Dani Earth, Naturas, Vapona, Mamo room, Black Cap, White Cap, Mushi Konai Earth, Mushi Korori Ground, natuvo, Mondahmin, Bath Roman, Onpo, Onso, Yu Meguri, Pirepara Earth, Ulmore, Sukki-ri!, Earth Garden, Polident, Poligrip, Aquafresh, N.act, Sensodyne, Kamutect, Biotene, Tachiiri Kinshi, Ouchi no Kusa Korori, Oniwa no Mushi Korori, Weed Killer, Mihariban, Aller Block, Helper Tasuke, Raku Hapi, Sebon, and Cleverin. Earth Corporation was founded in 1892 and is headquartered in Tokyo, Japan.","Sanyo Special Steel Co., Ltd., together with its subsidiaries, manufactures and sells special steel products in Japan and internationally. The company operates through Specialty Steel, Metal Powder, Formed and Fabricated Materials, and Others segments. The Specialty Steel segment provides various special steel products, including bearing, engineering, stainless, heat resistant, and tool steel products. The Metal Powder segment manufactures and sells metal powders and powder metallurgy products. The Formed and Fabricated Materials segment offers cut rings, die-forged/rolled, forged rings, and cold-rolled ring products made from special steel bars and tubes. The Other segment provides information processing services. The company also engages in the trading of special steel products, steelmaking raw materials, and other materials; and the provision of security and facilities maintenance services, and machinery maintenance services. Its steel products are used in a range of automobiles, railroads, construction machines, electronics products, and information communication devices. The company was formerly known as Sanyo Steel Works and changed its name to Sanyo Special Steel Co., Ltd. in 1959. The company was founded in 1933 and is headquartered in Himeji, Japan. Sanyo Special Steel Co., Ltd. is a subsidiary of Nippon Steel Corporation.","Sweeten Real Estate Development Co.,Ltd. constructs, develops, leases, and sells residential, commercial, and industrial projects. It is also involved in the development, rental, and sale of office building, specific professional zones, and urban renewal; trading of construction materials; rental of hotel; and civil construction and land development activities. The company was incorporated in 1987 and is based in Taichung, Taiwan.","Zoom Video Communications, Inc. provides unified communications platform in the Americas, the Asia Pacific, Europe, the Middle East, and Africa. The company offers Zoom Meetings that offers HD video, voice, chat, and content sharing through mobile devices, desktops, laptops, telephones, and conference room systems; Zoom Phone, an enterprise cloud phone system; and Zoom Chat enables users to share messages, images, audio files, and content in desktop, laptop, tablet, and mobile devices. It also provides Zoom Rooms, a software-based conference room system; Zoom Hardware-as-a-Service allows users to access video communication technology from third party equipment; Zoom Conference Room Connector, a gateway for SIP/H.323 endpoints to join Zoom meetings; Zoom Events, which enables users to manage and host internal and external virtual events; OnZoom, a prosumer-focused virtual event platform and marketplace for Zoom users to create, host, and monetize online events; and Zoom Webinars to provide video presentations to large audiences from many devices. In addition, the company offers Zoom Developer Platform that enables developers, platform integrators, service providers, and customers to build apps and integrations using Zoom's video-based communications solutions, as well as integrate Zoom's technology into their products and services; Zoom App Marketplace, which helps developers to publish their apps, as well as third-party integrations of Zoom; and Zoom Contact Center, an omnichannel contact center solution. It serves individuals; and education, entertainment/media, enterprise infrastructure, finance, government, healthcare, manufacturing, non-profit/not for profit and social impact, retail/consumer products, and software/Internet industries. The company was formerly known as Zoom Communications, Inc. and changed its name to Zoom Video Communications, Inc. in May 2012. The company was incorporated in 2011 and is headquartered in San Jose, California.","Waffer Technology Corporation engages in the manufacture and sale of light metal products. The company is involved in the provision of light-metal solution of magnesium and aluminum alloy, mold and tooling research and development, magnesium alloy injection and die-casting, CNC, and painting and assembly of vertical integration OEM/ODM processing services. Its products include cosmetic and internal parts for notebooks; handheld scanners and mobile phone parts; camera, video cam, projector, and monitoring optical parts; and auto parts, as well as other products, such as wearable, tool, and sports products. The company also manufactures and processes automotive aluminum alloy die-cast tools, 3C product magnesium injection tools, and other light metal die-casting tools, as well as fixtures and gauges. It serves medical, industrial, telecommunications, construction, automotive, sporting goods, aeronautical, transportation, national defense, and other industries. The company was formerly known as Waffer Industrial Company, Limited and changed its name to Waffer Technology Corporation in 2000. Waffer Technology Corporation was founded in 1950 and is headquartered in Taoyuan City, Taiwan.","Lanner Electronics Inc. provides design, engineering, and manufacturing services for advanced network appliances and rugged applied computing platforms for system integrators, service providers, and application developers worldwide. The company offers network appliances, such as modules and acceleration cards, industrial security appliances, wide temperature network appliances, desktop network appliances, and rackmount network appliances, as well as Wi-Fi access points; and telecom datacenter appliances consisting of cloud storage, HybridTCA, vCPE/uCPE, and video transport platforms, as well as modules and blades, hyper-converged appliances, and open RAN platforms. It also provides intelligent edge appliances, including DIN-Rail industrial gateway, embedded platform, intelligent video platform, rackmount industrial computer, rugged wireless gateway, vehicle gateway, and vehicle/rail computer; edge AI appliances, such as deep learning accelerators, inference server, and appliances, as well as AI starter kits; and extension modules comprising POE NIC, 100G+ NIC, 10/25/40G NIC, Radio, storage NIC, acceleration, and 1G NIC modules, as well as industrial GbE PCIe cards. The company offers its products for use in various applications, such as network computing, telecommunication, transportation, power and energy, industrial automation, intelligent systems, and software-defined wide area network. Lanner Electronics Inc. was founded in 1986 and is headquartered in New Taipei City, Taiwan.","SAMCO Inc. manufactures and sells operates as a semiconductor and materials company. The company primarily offers thin film deposition, microfabrication, cleaning, and surface treatment products. Its deposition systems include anode and cathode PECVD systems, atomic layer deposition systems, and silicon carbide (SiC) chemical vapor deposition systems; and etching systems comprise reactive ion etching systems, inductively coupled plasma (ICP) etch systems for general purpose, ICP etch systems for SiC etching, ICP etch systems for batch processing, silicon deep reactive ion etching systems, and XeF2 etch systems for MEMS release. The company also provides cleaning systems consisting of plasma cleaners, remote source plasma cleaners, and UV-ozone cleaners; and basic plasma research kits. It serves MEMS, laser diode, high brightness LED, TSV, SAW device, and RF device markets. The company was formerly known as SAMCO International, Inc. and changed its name to SAMCO Inc. in December 2004. SAMCO Inc. was founded in 1979 and is headquartered in Kyoto, Japan.","Hycon Technology Corporation designs, produces, and sells mixed signal microcontroller units, and battery management and touch panel ICs in Taiwan and China. The company offers battery management ICs, such as single cell and multi-cell, and secondary protectors, as well as balance ICs and gas gauges; mixed signal microcontroller units, including microcontroller units, data converters, digital multi-function meters, AC impedance measurement, sensor signal conditioners, low-dropout voltage regulators, LCD controllers and drivers, and application specific standard parts; and capacitive touch ICs. Its products are used in no-switch electronic scale, blood pressure monitor, PIR detector, digital multi-meter, and touch panel applications. In addition, the company provides its products under the HYCON brand name. Hycon Technology Corporation was founded in 2007 and is headquartered in Taipei City, Taiwan.","Taiwan Optical Platform Co., Ltd. operates as a channel copyright distributor. It also engages in the provision of investment, shareholding, consultancy, and channel copyright agency services; production of TV shows; information maintenance services; online shopping services; wholesale and retail of telecommunications equipment; film production and distribution of films; and advertising businesses. The company was formerly known as Bao Yue Investment Co., Ltd. and changed its name to Taiwan Optical Platform Co., Ltd. in January 2013. Taiwan Optical Platform Co., Ltd. was founded in 2006 and is based in Taichung City, Taiwan.","Nachi-Fujikoshi Corp. operates as a machinery manufacturer in Japan, rest of Asia, China, the Americas, and Europe. The company provides cutting tools, including drills, taps, end mills, gear cutters, broaches, and cut-off and re-grinding tools; and machine tools, such as broaching machines, precision roll forming machines, grinding machines, machining cells, and power finishers, as well as skiving machining center for gears. It also offers robots for spot and arc welding, handling, palletizing, heavy duty, cleanroom, and option, as well as controllers and support services; and radial ball, radial roller, thrust ball, and thrust roller bearings, as well as bearing units and plummer block housings. In addition, the company provides hydraulic equipment comprising valves, pumps, motors, units, and rotary center joints; special steels consisting of high speed tool and alloy tool steels, bearing and martensitic stainless steels, cermet, and micron hard products; and industrial furnaces, including vacuum carburizing furnace, and vacuum degreasing machine and system, as well as coating equipment and services. Further, it offers forming tools, cutting saws, machining systems, and automotive hydraulics. Additionally, the company provides engineering services for regrinding and recoating of tools, robots, machining equipment, heat treatment equipment, bearings, hydraulic equipment, and special steels. It serves customers in the automotive, machinery and retail, energy, and infrastructure markets. Nachi-Fujikoshi Corp. was incorporated in 1928 and is headquartered in Tokyo, Japan.","DAIHEN Corporation manufactures and sells power products, welding machines, and industrial and clean transfer robots. The company operates through Power Products Business, Welding &amp; Mechatronics Business, Semiconductor and FPD Related Business, and Other segments. It offers transformers, power distribution equipment, distribution equipment for electric power companies, solar inverters, and others; and welding/cutting machines, such as CO2/MAG, TIG, MIG, DC/AC, plasma welding and cutting, submerged arc, and resistance welding machines, as well as welding and cutting torches, peripheral devices for welding, thermal spray machines, and welding accessories. The company also provides robots, teach pendants, sensors for robot welding, positioners and sliders, PC software, and welding power sources and welding peripherals for robots. In addition, it offers RF/MW generators and automatic matching units for plasma applications; clean transfer robots; and wireless power transfer systems. Further, the company manufactures electronic devices, luminaire stabilizers, calorifiers, switches, housing equipment, distribution and control panels, monitoring and control systems, etc.; control and telecommunications equipment, and RF generators; hot charge; fuses; ballasts for discharge lamps; and material handling equipment for semiconductor and flat panel manufacturing systems. Additionally, it is involved in the installation, repair, inspection, maintenance, and remodeling of welding machines, cutting machines, and industrial robots, as well as transformers and switchgear systems; manufacture, processing, and coating of transformer parts; dispatch of personnel; health, welfare, and pension work for employees; and metal processing and real estate leasing activities. The company was formerly known as Osaka Transformer Co., Ltd. and changed its name to DAIHEN Corporation in December 1985. DAIHEN Corporation was incorporated in 1919 and is headquartered in Osaka, Japan.","Tera Probe, Inc. engages in wafer testing, final testing, and test engineering business in Japan and internationally. The company provides testing and test related services for various semiconductor devices, including DRAM, SoC, CPU, image sensors, and analog devices; and test program cross-platform conversion services for debugging, as well as test patterns conversion services to work with testers. It also offers design and development support services, and mass production for various probe cards; and provides card evaluation and parallelism testing services. The company was founded in 2005 and is headquartered in Yokohama, Japan. Tera Probe, Inc. is a subsidiary of Powertech Technology Inc.","Ventec International Group Co., Ltd. designs, develops, manufactures, and sells copper clad laminates and prepreg bonding materials. The company's products include standard FR4, lead free assembly, halogen free products, tec-thermal/thermal management and insulated metal substrate, polyimide, tec-speed/signal integrity and high frequency products, flex/flex rigid products, plastic interleaver and release film consumables, drill entry and exit material, copper foils and ACF, and masslam and drill products, as well as products for special applications. Its products are used for the fabrication of various printed circuit board and associated applications. In addition, the company engages in the general investment and international trade business. Further, it operates in China, the United Kingdom, the United States, Germany, and Taiwan. Ventec International Group Co., Ltd. was founded in 2000 and is headquartered in Grand Cayman, the Cayman Islands.","Fujitsu Limited operates as an information and communication technology company in Japan and internationally. The company operates through three segments: Technology Solutions, Ubiquitous Solutions, and Device Solutions. The company offers multi cloud and hybrid IT services; assessment and consultative services; SAP landscape transformation services; new workplace; datacentre products comprising integrated systems, storage solutions, servers, network switches, and infrastructure management; workplace products including personal computers, workstations, thin clients, displays, and peripheral devices; consumption based IT services; installation and implementation services; and hardware, software, and infrastructure support services, as well as electronic devices, air conditioning products, and network solutions. It also provides cyber security solutions, including cyber security consulting, managed security servies, and security operation and advanced threat centers; internet of things, artificial intelligence platform and solutions; and software products comprising FUJITSU Software Infrastructure Manager and FUJITSU Software ServerView Suite. Further, the company offers electronic components, such as semiconductor packages and batteries. It serves automotive, manufacturing, retail, financial services, transport, telecommunications, healthcare, and energy and utilities industries; the public sectors; and services providers. Fujitsu Limited was founded in 1923 and is headquartered in Tokyo, Japan.","Enplas Corporation engages in the engineering plastic, semiconductor peripherals, plastic optical businesses in Japan and internationally. It offers mechanical solutions, including gears and fluid control products; semiconductor solutions comprising general-purpose IC sockets; optical solutions, such as optical devices that include lens array for parallel communications and plastic barrels; LED solutions, including controlling LED lights; and life science products comprising microfluidic chips, endotoxin-free products, and other life science-related products. The company was founded in 1962 and is headquartered in Tokyo, Japan.","Hamamatsu Photonics K.K. manufactures and sells photomultiplier tubes, imaging devices, light sources, opto-semiconductors, and imaging and analyzing systems in Japan and internationally. The company operates through three segments: Electron Tube, Opto-Semiconductor, and Imaging and Measurement Instruments. The Electron Tube segment provides photomultiplier tubes, electron multipliers, microchannel plates, image intensifiers, X-ray products, and various light sources for use in medical, chemical analysis, measurement, industrial testing, and academic research applications. The Opto-Semiconductor segment offers silicon photodiodes, photo IC components, position sensitive and infrared detectors, image sensors for low-light-level imaging and X-ray imaging, mini-spectrometers, and light emitting devices for applications in medical imaging, high-energy physics, and scientific measurement. The Imaging and Measurement Instruments segment provides a range of cameras for scientific and industrial applications, as well as specialized instruments for use in the fields of pharmaceutical development, semiconductor manufacturing, X-ray nondestructive inspection, spectrophotometry, and optical communications. Hamamatsu Photonics K.K. is also involved in the semiconductor laser and hotel operation businesses. The company was formerly known as Hamamatsu TV Co., Ltd. Hamamatsu Photonics K.K. was founded in 1953 and is headquartered in Hamamatsu, Japan.","Mitsubishi Heavy Industries, Ltd. manufactures and sells heavy machinery worldwide. The company operates through Energy Systems; Plants &amp; Infrastructure Systems; Logistics, Thermal &amp; Drive Systems; and Aircraft, Defense &amp; Space segments. It offers thermal, renewable energy, nuclear, engine, nuclear power generation, and chemical power plants, lithium-ion battery products, and oil and gas production plants, as well as fuel cells; civil aircrafts and engines, aviation equipment, and maintenance, repair, and overhaul of aircrafts; and launch vehicles and services, rocket engines, reaction control systems, space stations, rocket launchers, rocket engine combustion test facilities, and electronic parts. The company also provides passenger and commercial ships, LNG and LPG carriers, special purpose vessels, and IT services and systems; marine machineries, boilers, turbines, engines, and structures; and intelligent transport systems products and solutions, such as electronic toll collection system, road user charging system, highway traffic management system, EV management system, and development system. In addition, it offers organic solvent exhaust gas treatment system, waste-to-energy system, sludge treatment system, air quality control system, and bio-treatment system; turbochargers, car air-conditioning and refrigeration systems, rubber and tire machinery, and testing equipment; forklift trucks; and printing, paper converting, and metals, and food &amp; packaging machinery, pumps, compressors &amp; mechanical turbines, hydraulic components. Further, the company provides gas holders, vibration control systems, water pipes, tunnel excavation machinery, and cybersecurity solutions for industrial control systems; special vehicles, naval ship &amp; maritime systems, defense aircrafts, helicopters, defense aeroengines, and guided weapon systems; and CO2 capture plants, as well as provides after-sales services. The company was founded in 1884 and is headquartered in Tokyo, Japan.","Topy Industries, Limited engages in the steel, automotive, industrial machinery components, power generation, and other businesses in Japan. The company provides section steel, such as H-section steel, channel steel, equal and unequal angle steel, unequal non-isopachous steel, flat steel, R-flat steel, bulb plate, ultra-thick wide flat, and deformed section steel products, including rims, super giant off-the-road rim wheels, track shoes, blades, forklift mast materials, segment components, HSST rails, and Z-steel products, as well as deformed bar steel products. It also offers steel wheels, aluminum wheels, and construction machinery wheels for passenger cars, trucks, buses, and small and large construction vehicles; and undercarriage components, such as tracks, rollers, cutting edges for motor graders, and city pads for hydraulic shovels, bulldozers, and other construction equipment, as well as parts. In addition, the company provides crawler robots and synthetic mica products. Topy Industries, Limited was founded in 1921 and is headquartered in Tokyo, Japan.","Suzuden Corporation engages in purchasing and selling products related to electrical and electronic components in Japan. It offers FA equipment, including RFID equipment, relay equipment, sensors, control equipment, etc.; information and communication equipment, such as CPUs, personal computers for industrial use, routers, network equipment, etc.; electronics and devices comprising connectors, switching power supplies, noise filters, etc.; and materials for electric facilities, including terminal blocks, cable accessories, boxes, etc. The company was founded in 1948 and is headquartered in Tokyo, Japan. Suzuden Corporation is a subsidiary of Yamato Corporation.","FP Corporation manufactures and markets polystyrene and compound resin disposable food containers in Japan. It offers general-purpose trays; and sashimi, sushi, prepared food, audible, and heat-resistant containers. The company also markets related packaging materials. It serves supermarkets, convenience stores, food manufacturers, and restaurants. The company was formerly known as Fukuyama Pearl Paper Manufacturing Corporation and changed its name to FP Corporation in January 1989. FP Corporation was incorporated in 1962 and is headquartered in Fukuyama, Japan.","Supreme Electronics Co., Ltd. engages in the import and export dealership of various electronic products and components in Taiwan, Hong Kong, China, the United States, and internationally. It offers electronic components, such as lithium-ion batteries, semiconductors, chips, flash memory, and DRAM; SYSTEM LSI products; mobile and display LED's; multilayer ceramic capacitors; polarizer; SiP and MCP products; high-precision analog and mixed-signal integrated circuits; USB3.0 host and device solutions; LCD products, including TN, STN, TFT-LCD, and 3D applications; DSC/DV, DVR/PVR, door phone cameras, rear car video recorders, and digital cameras; and timing controller ICs. The company also provides display interface products; audio IC and chip design solutions; automated digitization technology; and LED driver ICs. In addition, it is involved in the manufacturing of batteries; provision of biotechnology related products, and warehousing services; and manufacturing and trading of electronic products. Supreme Electronics Co., Ltd. was incorporated in 1987 and is headquartered in Taipei, Taiwan.","Formosa Advanced Technologies Co., Ltd. provides wafer probe, integrated circuit (IC) assembly and testing, module turnkey, and LED chip services in Taiwan. It provides IC package solutions for portable electronic products, cell phones, memory modules, PC cards, PDAs, disc drives, and telephone handsets; DIMM products for laptops; flash cards; and LED products comprising PLCC, EMC, and UV LED products. The company also offers assembly services; and testing services, including wafer probe, burn in, and final testing services for memory, and logical and mixed-signal semiconductors, as well as testing program verification, tester/hi-fix correlation, engineering lot support, production lot verification, and periodical report. In addition, it provides module services, such as customized products, and OEM and ODM services, as well as blank DRAM modules, including U-DIMM, SO-DIMM, R-DIMM, and FB-DIMM; and LED chip back-end services, such as grinding, dicing, probing, sorting, and PI services. The company was founded in 1990 and is headquartered in Douliou City, Taiwan.","TCI Co., Ltd., an original design manufacturer company, engages in the research, development, manufactures, and sales of functional health food, food supplements, and skin care products. It offers liquid and solid supplements; immunity products; functional probiotics; basic nutrition; detox slimming; body health; sports nutrition supplements product; laundry detergents; hand sanitizers; and functional snacks, which includes, jelly, bars, chocolates, and gummies. It also provides skin care products, such as facial, body sheet, eye, and lip masks; essences; sprays; creams; and gels, as well as turnkey services. TCI Co., Ltd. was incorporated in 1980 and is headquartered in Taipei, Taiwan..","Taliworks Corporation Berhad, an infrastructure company, engages in water treatment, supply, and distribution activities. It operates through Water, Construction, Tool Highway, Waste Management, Renewables, and Others segments. The company operates, manages, and maintains water treatment plants and water distribution systems; and supplies potable water to large parts of Selangor and Kuala Lumpur. It also owns and operates highway concession that comprises two toll plazas; and offers waste management, solid waste collection, and public cleansing services in the southern region of Peninsular Malaysia; and undertakes engineering and construction activities, such as site clearance, earthworks, construction of reinforced concrete structures, and pipe laying works. The company was formerly known as Carpets International Malaysia Berhad and changed its name to Taliworks Corporation Berhad in November 2000. Taliworks Corporation Berhad was incorporated in 1965 and is headquartered in Kuala Lumpur, Malaysia.","Kuo Toong International Co., Ltd. designs, produces, and assembles water supply and division pipes in Taiwan. The company offers various concrete products, including prestressed concrete cylinder and non-cylinder pipes, reinforced concrete pipes, reinforced concrete cylinder pipes, concrete pipes for sewerage in jacking method, prestressed beams, shield-segments, and other concrete products. It also provides ductile iron pipes, DI flexible pipes, connecting closures, and accessories. Kuo Toong International Co., Ltd. was founded in 1978 and is based in Kaohsiung, Taiwan.","Premier Investment Corporat
