ion (PIC) is a J-REIT (real estate investment trust) that manages a portfolio comprised of office buildings and residential properties, investing primarily in the Tokyo Economic Bloc. PIC was the sixth J-REIT listed on the Tokyo Stock Exchange (securities code: 8956) in September 2002. Since then, PIC has steadily expanded its portfolio valued at over 200 billion yen on an acquisition price basis. PIC utilizes a hedged strategy that minimizes risk by combining the strengths of office buildings and residential properties against economic cycles, as well as employing a strategic focus on the Tokyo Economic Bloc and prudent management of debt and equity financing. This approach has enabled PIC to successfully achieve steady dividends at a high level over the past fiscal periods. PIC outsources management of its assets to Premier REIT Advisors, Co., Ltd. (PRA). Both PIC and PRA are committed to realizing stable operations over the medium to long term while working to improve the quality of the owned assets.","Seibu Holdings Inc. engages in the urban and regional transportation, hotel and leisure, real estate, construction, and other businesses in Japan. It operates through Urban Transportation and Regional, Hotel and Leisure, Real Estate, Construction, Hawaii Business, and Other Business segments. The company offers railway, bus, and transportation services; operates hotels, golf courses, ski resorts, and leisure facilities; develops Seibu Railway lines and hotel sites in city centers; leases office and residential facilities; and develops and operates stores in train stations, shopping malls, and other commercial facilities. It is also involved in the construction of railway lines, social infrastructure, hotel remodeling, private sector construction, and housing. In addition, the company produces, processes, and sells gravel, sand, and other raw materials used in civil engineering and construction projects; designs and executes landscaping projects; and maintains and operates state-run parks. Further, the company operates express ways and cruise ships; and maintains a professional baseball team. Additionally, the company offers housekeeping, child-rearing support, home, and urban development services; and insurance and pet care products, as well as builds cemeteries. Seibu Holdings Inc. was incorporated in 2006 and is headquartered in Tokyo, Japan.","Trancom Co., Ltd. provides various logistics services in Japan and internationally. It offers logistics center construction and operation services; transport matching and delivery services; and production contract and temporary staffing services. The company also provides personal delivery services; paid employment placement services; consulting services; automobile maintenance services; and freight and truck transportation services. In addition, it sells new and used cars; operates insurance agency business; and designs and develops software. The company was founded in 1955 and is headquartered in Nagoya, Japan.","Yamato Holdings Co., Ltd. provides delivery, logistics, home convenience, e-business, financial, auto works, and other related services in Japan, North America, and internationally. The company's Delivery segment offers small parcel delivery services, such as door-to-door parcel delivery and posting services. Its BIZ-Logistics segment provides intercompany logistics services to B2B supply-chain management market. The company's Home Convenience segment offers lifestyle support services, including moving and household effects delivery services. Its e-Business segment provides information services comprising ASP services and information systems development for business markets. The company's Financial segment offers settlement and collection services to customers and business customers. Its Autoworks segment provides vehicle maintenance and fuel supply services for transport companies. The company was founded in 1919 and is headquartered in Tokyo, Japan.","Japan Airlines Co., Ltd., together with its subsidiaries, provides scheduled and non-scheduled air transport services in Japan and internationally. The company operates through Air Transportation and Other segments. It offers domestic and international passenger, ground handling, and cargo air transport services. The company is also involved in the aerial work and other related business; and sale of package tours. As of March 31, 2021, it operated a fleet of 218 aircraft. The company was formerly known as Japan Airlines International Co., Ltd. and changed its name to Japan Airlines Co., Ltd. in April 2011. The company was founded in 1951 and is headquartered in Tokyo, Japan.","Nippon Television Holdings, Inc. operates as a media and content company in Japan. The company engages in the production of broadcasting programs; digital broadcasting; technical production related to studios, live broadcasting, master technology, EJ news gathering, editing, postproduction, etc.; and programming, content production, closed captioning, library, etc. It is also involved in sporting and various NTV events; the management of NTV school; art design, and lighting and sound effects; design of sets, flip charts, and TV graphics; production of pamphlets, posters, etc.; intellectual property management; management of music publishing, CD master, and merchandising rights; production CDs and DVDs; rental of recording studios; and operation of fitness clubs, insurance agencies, and museums. In addition, the company engages in the production and construction of exhibitions, sales promotion events, international sports events, theme parks, amusement facilities, national ceremonies, etc.; production of program-related merchandise goods; commercial building maintenance; race track, concerts, and events management; ICT, development of apps for business, web development, video streaming, infrastructure solutions, and advertising; shopping portal sites management; production of animation, TV programs, commercial films, graphic designs, illustrations, characters, social games, and other content; copyright management; and internet content streaming. Further, it engages in the provision of software and systems for VOD and live streaming platforms and players; news gathering, reporting, and production of information, sports programs, etc.; 3D computer graphics; services to program and technology production, clerical, and management duties; e-commerce, esports, and talent production agency businesses; contractual production of programs for broadcasters; and influencers network and production business. The company was incorporated in 1952 and is based in Tokyo, Japan.","RENOVA, Inc. operates in the renewable energy industry in Japan. It operates through Renewable Energy Power Generation Business and Renewable Energy Development and Operation Business segments. The Renewable Energy Power Generation Business segment generates and sells electricity from renewable energy power plants. The Renewable Energy Development and Operation Business segment develops and assists in the operation of renewable energy power plants. The company generates electricity through solar, biomass, wind, geothermal and hydro power plants. RENOVA, Inc. was incorporated in 2000 and is based in Tokyo, Japan.","Funai Soken Holdings Incorporated provides consulting services to manufacturing and retail businesses in Japan. The company offers logistics services, including consulting, trading, and transportation; and management consulting services for various sectors, such as housing and real estate, medical, nursing care, welfare, automotive, food and distribution, retail, and direct sales, as well as certified professional, amusement, community care, and specialist services. It also provides support services, including systems design and analysis, program creation, and systems operation and management; and training and diagnostics services. The company was formerly known as Funai Consulting Incorporated and changed its name to Funai Soken Holdings Incorporated in July 2014. Funai Soken Holdings Incorporated was incorporated in 1970 and is headquartered in Osaka, Japan.","The Great Taipei Gas Corporation supplies natural gas in Taiwan. It also manufactures and supplies gas and related equipment; sells gas appliances; and leases long-distance land cable circuits and office buildings. The company's business area covers seven districts, including Songshan, Xinyi, Daan, Wanhua, Zhongzheng, Datong, and Zhongshan, as well as two counties comprising Fuhua and Ming Sheng in the Shilin district. It serves approximately 380,000 customers. The company was founded in 1964 and is headquartered in Taipei, Taiwan.","Ascendas Real Estate Investment Trust (Ascendas Reit) is Singapore's first and largest listed business space and industrial real estate investment trust. It was listed on the Singapore Exchange Securities Trading Limited (SGX-ST) in November 2002. As at 31 December 2020, Ascendas Reit's investment properties under management stood at S$13.7 billion. The portfolio comprises 200 properties across the developed markets of Singapore, Australia, the United Kingdom and the United States. Ascendas Reit's portfolio includes business and science parks, suburban office properties, high-specifications industrial properties, light industrial properties, logistics and distribution centres, and integrated developments, amenities and retail properties. These properties house a tenant base of more than 1,450 international and local companies from a wide range of industries and activities, including research and development, life sciences, information technology, engineering, light manufacturing, logistics service providers, electronics, telecommunications, manufacturing services and back-room office support in service industries. Major tenants include Singtel, Stripe, DSO National Laboratories, Pinterest, DBS, CareFusion, Wesfarmers, Citibank and JPMorgan. Ascendas Reit is listed in several indices. These include the FTSE Straits Times Index, the Morgan Stanley Capital International, Inc (MSCI) Index, the European Public Real Estate Association/National Association of Real Estate Investment Trusts (EPRA/NAREIT) Global Real Estate Index and Global Property Research (GPR) Asia 250. Ascendas Reit has an issuer rating of \u0091A3' by Moody's Investors Service. Ascendas Reit is managed by Ascendas Funds Management (S) Limited, a wholly owned subsidiary of Singapore-listed CapitaLand Limited, one of Asia's largest diversified real estate groups.","Asset Five Group Public Company Limited engages in the development and sale of real estate properties in Thailand. It sells land, houses, and units of residential condominium. The Company was founded in 2013 and is based in Bangkok, Thailand.","African Agriculture Holdings Inc., a food security company, engages in operating a commercial-scale alfalfa farm on the African continent. The company is based in New York, New York. African Agriculture Holdings Inc. operates as a subsidiary of Global Commodities &amp; Investments Ltd.","Aarti Drugs Limited, through its subsidiaries, engages in the manufacturing and marketing of active pharmaceutical ingredients (APIs), pharmaceutical intermediates, specialty chemicals, and formulations in India and internationally. The company provides APls in various therapeutic areas, including anti-inflammatory, cardioprotectants, antidiarrhoeals, antifungals, antiarthritis/osteoporosis, antibiotics, antidiabetics, Alzheimer's treatment, sedatives, vitamins, and alcoholism treatment; and pharmaceutical intermediate products comprising tinidazole, celecoxib, ciprofloxacin, clopidogrel, diclofenac, ketoconazole, nimesulide, and raloxifene. It also offers specialty chemical products, such as benzene sulphonyl chloride, benzene sulphonic acid, benzene sulphonic acid methyl ester, sodium benzene sulfinate, para toluene sulphonyl chloride, para toluene sulphonic acid methyl ester, N,N',N'-tris-(4-toluene sulfonyl)-diethylenetriamine, sodium para toluene sulfinate, para toluene sulphonyl hydrazide, di-phenyl sulphone, formamide, ammonium sulfate, and calcium fluoride, as well as benzene sulphonic acid sodium salt, benzyl nicotinate, methyl nicotinate, ethyl para toluene sulphonate, N-methyl methane sulfonamide, benzene sulphonamide, 2-phenoxy methane sulphanilide, para toluene sulfonamides, para chloro benzene sulphonamide, para chloro benzene sulphonyl chloride, ortho para toluene sulfonamides, ortho para toluene sulfonamides acid methyl ester, and N-methyl methane sulfonamides. In addition, the company's development products portfolio comprises Itraconazole and Fluconazole for antifungal applications; Dabigatran for use as an anticoagulant; Ticagrelor for cardiovascular diseases; Sitagliptin for use as an antidiabetics; and Alpha Lipoic Acid for application as an antioxidants. Further, it provides contract manufacturing services. Aarti Drugs Limited was incorporated in 1984 and is headquartered in Mumbai, India.","Ambev S.A., through its subsidiaries, produces, distributes, and sells beer, draft beer, carbonated soft drinks, other non-alcoholic beverages, malt, and food products in the Americas. The company operates through four segments: Brazil; Central America and the Caribbean; Latin America South; and Canada. It offers beer primarily under the Skol, Brahma, Antarctica, Brahva, Brahva Gold, Extra, Bud Light, Beck, Leffe and Hoegaarden, Bucanero, Cristal, Mayabe, Cacique, Presidente, Brahma Light, Presidente Light, Presidente Golden Light, Bohemia, The One, Corona, Modelo Especial, Stella Artois, and Budweiser, Quilmes Cl\u00e1sica, Pace\u00f1a, Taqui\u00f1a, Huari, Becker, Cusque\u00f1a, Michelob Ultra, Busch, Pilsen, Ouro Fino, Banks, Deputy, Patricia, Labatt Blue, Alexander Keith's, and Kokanee brands. The company also provides bottled water, isotonic beverages, energy drinks, coconut water, powdered and natural juices, and ready-to-drink teas under the Guaran\u00e1 Antarctica, Gatorade, H2OH!, Lipton Iced Tea, Fusion, Do Bem, Pepsi, Canada Dry, Squirt, Red Rock, Pepsi-Cola, Seven Up, Nutrl, Bud Light Seltzer, Palm Bay, and Mike's brands. It offers its products through a network of third-party distributors and a direct distribution system. The company was founded in 1885 and is headquartered in S\u00e3o Paulo, Brazil. Ambev S.A. is a subsidiary of Interbrew International B.V.","Arbor Realty Trust, Inc. invests in a diversified portfolio of structured finance assets in the multifamily, single-family rental, and commercial real estate markets in the United States. The company operates in two segments, Structured Business and Agency Business. It primarily invests in bridge and mezzanine loans, including junior participating interests in first mortgages, and preferred and direct equity, as well as real estate-related joint ventures, real estate-related notes, and various mortgage-related securities. The company offers bridge financing products to borrowers who seek short-term capital to be used in an acquisition of property; financing by making preferred equity investments in entities that directly or indirectly own real property; mezzanine financing in the form of loans that are subordinate to a conventional first mortgage loan and senior to the borrower's equity in a transaction; junior participation financing in the form of a junior participating interest in the senior debt; and financing products to borrowers who are looking to acquire conventional, workforce, and affordable single-family housing. Further, it underwrites, originates, sells, and services multifamily mortgage loans through conduit/commercial mortgage-backed securities programs. The company qualifies as a real estate investment trust for federal income tax purposes. It generally would not be subject to federal corporate income taxes if it distributes at least 90% of its taxable income to its stockholders. Arbor Realty Trust, Inc. was incorporated in 2003 and is headquartered in Uniondale, New York.","ACM Research, Inc., together with its subsidiaries, develops, manufactures, and sells single-wafer wet cleaning equipment for enhancing the manufacturing process and yield for integrated chips worldwide. It offers space alternated phase shift technology for flat and patterned wafer surfaces, which employs alternating phases of megasonic waves to deliver megasonic energy in a uniform manner on a microscopic level; timely energized bubble oscillation technology for patterned wafer surfaces at advanced process nodes, which provides cleaning for 2D and 3D patterned wafers; Tahoe technology for delivering cleaning performance using less sulfuric acid and hydrogen peroxide; and electro-chemical plating technology for advanced metal plating. The company markets and sells its products under the Ultra C brand name through direct sales force and third-party representatives. ACM Research, Inc. was incorporated in 1998 and is headquartered in Fremont, California.","Accenture plc, a professional services company, provides strategy and consulting, interactive, and technology and operations services worldwide. The company offers application services, including agile transformation, DevOps, application modernization, enterprise architecture, software and quality engineering, data management, intelligent automation comprises robotic process automation, natural language processing, and virtual agents, and liquid application management services, as well as program, project, and service management services; strategy consulting services; critical data elements, data management and governance, data platform and architecture, product-based organization and skills, business adoption, and value realization services; engineering, and research and development digitization; smart connected product design and development; product platform engineering and modernization; product as-a-service enablement; products related to production and operations; autonomous robotics systems; the digital transformation of capital projects; and digital industrial workforce solutions. It also provides data-enabled operating models; technology consulting and artificial intelligence services; services related to talent and organization/human potential; digital commerce; infrastructure services, such as hybrid cloud, network, digital workplace and collaboration, service and experience management, infrastructure as code, and managed edge and IoT devices; cyber defense, applied cybersecurity, managed security, OT security, security strategy and risk, and industry security products; services related to technology innovation; and intelligent automation services. In addition, the company offers cloud, ecosystem, marketing, supply chain management, zero-based budgeting, customer experience, finance consulting, mergers and acquisitions, and sustainability services. Accenture plc was founded in 1951 and is based in Dublin, Ireland.","AAPICO Hitech Public Company Limited engages in the manufacture and distribution of automobile parts, dies, and jigs in Thailand, China, Malaysia, and Portugal. It operates in three segments: Manufacture of Auto Parts; Sales of Automobiles and Provision of Automobiles Repair Service; and Others. The company offers stamped or pressed parts, including chassis frame components, housing axles parts, pressed and stamped body parts, door check link, and brake lines, fuel lines, engine, and brazing parts; forged and machined parts, such as transmission, power train, steering and suspension systems, engine, shafts, wheel hubs, and other parts, as well as connecting rods and copper forged parts; and plastic parts and plastic fuel tanks. It also provides roof ditch mouldings, belt line mouldings, door sash products, brazed steel tubing, door checks and hinges, and parking brake lever products; assembly jigs; and stamping dies. In addition, the company is involved in the sale of automobiles; provision of automobile repair, training, technical support, and information technology consulting and advisory services; venture capital business; investment in other companies; and import and export of vehicles and parts. Further, it manufactures 3D car navigation and digital map solutions under the POWERMAP brand with voice activation software, as well as Oracle ERP systems; and operates car dealership service centers. The company was founded in 1996 and is headquartered in Phra Nakhon Si Ayutthaya, Thailand.","Auckland International Airport Limited provides airport facilities, supporting infrastructure, and aeronautical services in Auckland, New Zealand. The company operates through three segments: Aeronautical, Retail, and Property. The Aeronautical segment provides services that facilitate the movement of aircraft, passengers, and cargo, as well as utility services, which support the airport; and leases space for facilities, such as terminals. The Retail segment offers services to the retailers within the terminals; and car parking facilities for passengers, visitors, and airport staff. The Property segment leases cargo buildings, hangars, and stand-alone investment properties. The company was founded in 1966 and is based in Manukau, New Zealand.","Advanced Info Service Public Company Limited, together its subsidiaries, provides mobile network, fixed broadband, and digital services primarily in Thailand. The company operates through three segments: Mobile Phone Services, Mobile Phone and Equipment Sales, and Datanet and Broadband Services. It is involved in the operation of cellular telephone networks in the frequency of 26 GHz, 700 MHz, 900 MHz, 1800 MHz, 2100 MHz, and 2600 MHz frequencies. The company also distributes handsets, as well as cash cards; and electronic money and electronic payment services. In addition, it provides international telephone service, broadcasting network, and television broadcasting services for various channels, as well as insurance brokerage services. Further, the company offers IT system, content aggregator, and billing and collection outsourcing services; call center services; and land and building rental services, as well as related facilities. Additionally, it provides internet data center, and internet and satellite uplink-downlink services for communications; distributes internet equipment; publishes telephone directories and advertising; offers mobile contents; and provides training and online advertising services. The company was founded in 1986 and is headquartered in Bangkok, Thailand.","Alexander &amp; Baldwin, Inc. (\"A&amp;B\") is Hawai'i's premier commercial real estate company and the largest owner of grocery-anchored, neighborhood shopping centers in the state. A&amp;B owns, operates and manages approximately 3.9 million square feet of commercial space in Hawai'i, including 22 retail centers, ten industrial assets and four office properties, as well as 154 acres of ground leases. These core assets comprise nearly 72% of A&amp;B's total assets. A&amp;B's non-core assets include renewable energy generation facilities, approximately 27,000 acres of agricultural and conservation land and a vertically integrated paving business. A&amp;B is achieving its strategic objective of becoming a Hawai'i-focused commercial real estate company by expanding and strengthening its Hawai'i CRE portfolio and monetizing non-core assets. Over its 150-year history, A&amp;B has evolved with the state's economy and played a leadership role in the development of the agricultural, transportation, tourism, construction, residential and commercial real estate industries.","Alkane Resources Limited operates as a gold production company in Australia. It explores for gold, copper, nickel, zinc, and silver deposits. The company holds various interests in the Tomingley Gold project that consists of four gold deposits; and the Northern Molong Porphyry Project, which covers an area of 115 square kilometers located in the Central West of New South Wales. Its exploration projects comprise Boda and Kaiser, Cudal, Peak Hill, Elsienora, Rockley, Armstrongs, Trangie, and Mt Conqueror projects. The company also invests in junior gold mining companies and projects. Alkane Resources Limited was incorporated in 1969 and is headquartered in West Perth, Australia.","Prologue S.A. delivers IP communications, and enterprise content management (ECM) and exchange (EDI) solutions in France and internationally. It offers cloud computing solutions with a brokering platform for various needs of each business, and tools for porting and administrating applications in the cloud with deployment and management; and unified communication solutions, including telephony and fax over IP systems that are integrated within the enterprise information system. The company also provides ECM and EDI integrated solutions for the incoming and outgoing flows, as well as documents circulating within the company, such as various formats and types of media both paper and electronic for customers, suppliers, administrations or other partners, or for employees and private individuals. In addition, it offers development, integration, and maintenance solutions and services to assist companies in optimizing their application portfolio. Further, the company provides diagnostics, field studies, consulting, deployment, functional upgrade, and maintenance services, as well as dematerialization, and cloud and IP communication solutions; and information systems and development services. Its solutions and services are distributed in SaaS or license-based mode for the optimization of business information systems. Prologue S.A. was founded in 1986 and is headquartered in Gennevilliers, France.","Aon plc, a professional services firm, provides advice and solutions to clients focused on risk, retirement, and health worldwide. It offers commercial risk solutions, including retail brokerage, cyber, and global risk consulting solutions, as well as acts as a captives management; and health solutions, such as health and benefits brokerages, and health care exchanges. The company also provides treaty and facultative reinsurance, as well as insurance-linked securities, capital raising, strategic advice, restructuring, and mergers and acquisitions services; and corporate finance advisory services and capital markets solutions products. In addition, it offers strategic design consulting services on their retirement programs, actuarial services, and risk management services; advice services on developing and maintaining investment programs across a range of plan types, including defined benefit plans, defined contribution plans, endowments, and foundations for public and private companies, and other institutions; and advice and solutions that help clients in risk, health, and wealth through commercial risk, reinsurance, health, and wealth solutions. Further, the company offers CoverWallet; Affinity; Aon Inpoint; CoverWallet; and ReView services. Aon plc was founded in 1919 and is headquartered in Dublin, Ireland.","AP (Thailand) Public Company Limited, together with its subsidiaries, engages in the real estate development business in Thailand. It operates through Low\u0096Rise, High\u0096Rise, and Other segments. The Low-rise segment develops single-detached houses and townhouses. The High-rise segment develops condominiums. The Other segment provides after-sales, property brokerage, and construction services. This segment also offers education and training services. The company was formerly known as Asian Property Development Public Company Limited and changed its name to AP (Thailand) Public Company Limited in May 2013. AP (Thailand) Public Company Limited was founded in 1991 and is headquartered in Bangkok, Thailand.","AP (Thailand) Public Company Limited, together with its subsidiaries, engages in the real estate development business in Thailand. It operates through Low\u0096Rise, High\u0096Rise, and Other segments. The Low-rise segment develops single-detached houses and townhouses. The High-rise segment develops condominiums. The Other segment provides after-sales, property brokerage, and construction services. This segment also offers education and training services. The company was formerly known as Asian Property Development Public Company Limited and changed its name to AP (Thailand) Public Company Limited in May 2013. AP (Thailand) Public Company Limited was founded in 1991 and is headquartered in Bangkok, Thailand.","Arezzo Ind\u00fastria e Com\u00e9rcio S.A., together with its subsidiaries, engages in the manufacture, development, molding, and sale of women's footwear, handbags, clothing, and accessories. The company offers its products under the Arezzo, Schutz, Anacapri, Alexandre Birman, and Fiever brands. As of December 31, 2019, it had 630 franchise-operated stores, and 45 company-operated stores in Brazil. The company also sells its products through Web commerce channel. Arezzo Ind\u00fastria e Com\u00e9rcio S.A. was founded in 1972 and is headquartered in Belo Horizonte, Brazil.","Asian Paints Limited, together with its subsidiaries, engages in the manufacturing, selling, and distribution of paints, coatings, and products related to home decoration and bath fittings in Asia, the Middle East, Africa, and the South Pacific region. The company offers wall coverings; textures painting aids; waterproofing products; wall stickers; mechanized tools; adhesives; modular kitchens and wardrobes; bath fittings and sanitaryware; decorative lighting products; furniture, furnishings, and rugs; and unplasticized polyvinyl chloride windows and door systems, as well as personalized interior design, safe painting, and color consulting services. It also provides interior and exterior wall finishes, wood finishes, enamels, undercoats, thinners, and varnishers; and sanitizers and surface disinfectants. The company offers its products under the Asian Paints, Apco Coatings, Asian Paints Berger, Asian Paints Causeway, SCIB Paints, Taubmans, and Kadisco Asian Paints through a network of dealers and retail stores, as well as operates asianpaints.com, an online shop. Asian Paints Limited was founded in 1942 and is headquartered in Mumbai, India.","Alpha Astika Akinita S.A., together with its subsidiaries, provides various real estate services in Greece. It offers purchases/sales services, such as locating suitable real estate, evaluation of offers, negotiations, and action co-ordination for completing the purchase or sale; rents/lease services, such as locating leaseholds and lessees, evaluation of offers, rent-lease negotiations, and rent collection; and financial and technical studies, including real estate assessments, studies on exploiting real estate, and market research concerning rents and sales-purchases. The company also provides project management services consisting of the determination of the project's specifications, realization and supervision of studies, selection of the appropriate developers, drafting of contractual terms and conditions, project management during construction, and supervision and coordination of the project. In addition, it offers a range of consultative services for the public and private sector in the field of real estate; and supervision/management of real estate comprising rent collection, monitoring the observance of building regulations, the observance of contractual obligations, and real estate inspection services. The company also provides property management and development services for private owners, as well as offers technical consultant's advice. It provides its services to third-party customers consisting of corporations, private individuals, organizations, insurance funds, etc. Alpha Astika Akinita S.A. was founded in 1942 and is based in Athens, Greece. Alpha Astika Akinita S.A. operates as a subsidiary of Alpha Services and Holdings S.A.","Auction Technology Group plc operates marketplaces and a proprietary auction platform primarily in the United Kingdom, North America, and Germany. The company operates through four segments: Arts and Antiques, Industrial and Commercial, Auction Services, and Content. It offers watches, jewellery, furniture, fine art, decorative art, classic cars, collectables, and fashion products; used equipment, commercial vehicles, and machineries for used in laboratories and pharmaceuticals, warehousing, oil and gas, real estate, construction, agriculture, plastic moulding, metalworking, woodworking, and food and beverage production industries; and electronics, apparel, homeware, and furniture products. The company also operates marketplaces, such as Proxibid.com, BidSpotter.com, BidSpotter.co.uk, thesaleroom.com, lot-tissimo.com, liveauctioneers.com, and i-bidder.com. In addition, it offers Wavebid, a suite of products designed for auction house management; Auction Mobility, which provides digital auction technology for auctioneers, such as customized auction software, website design, and e-commerce solutions; Global Auction Platform, a digital marketplace for real-time audio and video broadcast; and Antiques Trade Gazette, a weekly industry trade magazine and guide to arts and antiques. It serves curated online marketplace, connecting bidders, and auctioneers to arts and antiques, industrial and commercial, and consumer surplus and returns industries. The company was founded in 1971 and is headquartered in London, the United Kingdom.","ATMA Participa\u00e7\u00f5es S.A., through its subsidiaries, provides contact center and trade marketing services. It offers industrial maintenance and facilities services; and information technology services. The company was formerly known as Liq Participa\u00e7\u00f5es S.A. and changed its name to ATMA Participa\u00e7\u00f5es S.A. in March 2020. ATMA Participa\u00e7\u00f5es S.A. was founded in 2000 and is based in S\u00e3o Paulo, Brazil.","Allegiant Gold Ltd. engages in the exploration and evaluation of resource properties in the United States. Its flagship project is the 100% owned Eastside Gold project covering an area of 72 square kilometers located in Tonopah, Nevada. The company was incorporated in 2017 and is headquartered in Vancouver, Canada.","AU Small Finance Bank Limited provides various banking and financial services in India. The company operates through Treasury, Retail Banking, Wholesale Banking, and Other Banking Operations segments. It provides saving, current, salary, fixed, recurring, and COVID shield deposit accounts, as well as debit and credit cards and locker services. In addition, the company offers car, two-wheeler, commercial vehicle, personal, tractor, home, gold, construction equipment, business, agriculture, and working capital loans. Further, it provides life, health, general, and motor insurance; mutual funds and national pension system; overdraft, cash credit, bank guarantee, and letters of credit; and internet and mobile banking, collection and receivables, and payment and other merchant payment services. Additionally, the company provides government banking services to central government, state governments, central and state public sector undertakings, boards, defense, urban local bodies, and other government departments. It operates bank branches, correspondents banking outlets, business correspondents, and ATMs. The company was formerly known as AU Financiers (India) Limited and changed its name to AU Small Finance Bank Limited in May 2017. AU Small Finance Bank Limited was incorporated in 1996 and is headquartered in Jaipur, India.","Aspira Women's Health Inc., together with its subsidiaries, engages in developing and commercializing diagnostic tests for gynecologic disease in the United States. The company provides OVA1, OVERA, and OVA1plus to detect risk of ovarian malignancy in women with adnexal masses. It also offers ASPiRA GenetiX, a genetic test for the risk of gynecologic cancer. In addition, the company operates Aspira Synergy, a testing platform and cloud service for decentralized access of protein biomarker and hereditary genetic testing; and owns and operates ASPiRA LABS, a lab that specializes in applying biomarker-based technologies to address critical needs in the management of gynecologic cancers and disease. Further, its pipeline products include OVAWatch, EndoCheck, and OVAInherit. The company serves physicians, physician office laboratories, and national and regional laboratories. It has a collaborative research agreement with Baylor Genetics; an agreement with Harvard Dana-Farber Cancer Institute, Brigham and Women's Hospital, and Medical University Lodz to evaluate the microRNA technology in combination with Aspira technologies for the development of an early detection test for ovarian cancer; and a strategic alliance with Quest Diagnostics, Incorporated. The company was formerly known as Vermillion, Inc. and changed its name to Aspira Women's Health Inc. in June 2020. Aspira Women's Health Inc. was incorporated in 1993 and is headquartered in Austin, Texas.","Baidu, Inc. offers internet search services in China. It operates through Baidu Core and iQIYI segments. The company offers Baidu App to access search, feed, and other services using mobile devices; Baidu Search to access its search and other services; Baidu Feed that provides users with personalized timeline based on their demographics and interests; and Haokan, a short video app. It also provides Baidu Knows, an online community where users can ask questions to other users; Baidu Wiki; Baidu Healthcare Wiki; Baidu Wenku; Baidu Scholar; Baidu Experience; Baidu Post; Baidu Maps, a voice-enabled mobile app that provides travel-related services; Baidu Drive; Baijiahao; and DuerOS, a smart assistant platform. In addition, it offers online marketing services, which include pay for performance, an auction-based services that allow customers to bid for priority placement of paid sponsored links and reach users who search for information related to their products or services; other marketing services that include display-based marketing services and other online marketing services based on performance criteria other than cost per click; mobile ecosystem, a portfolio of apps, including Baidu App, Haokan, and Baidu Post; various cloud services and solutions, such as platform as a service, software as a service, and infrastructure as a service; self-driving services, including maps, automated valet parking, autonomous navigation pilot, electric vehicles, and robotaxi fleets, as well as Xiaodu smart devices. Further, the company provides iQIYI, AN online entertainment service, including original and licensed content; other video content and membership; and online advertising services. Baidu, Inc. has strategic partnership with Zhejiang Geely Holding Group. The company was formerly known as Baidu.com, Inc. Baidu, Inc. was incorporated in 2000 and is headquartered in Beijing, China.","Bangkok Bank Public Company Limited provides various commercial banking products and services in Thailand and internationally. The company operates through Domestic Banking, International Banking, Investment Banking, and Others segments. It offers various personal banking products and services, including savings, current, fixed deposit, foreign currency, and other accounts; home and personal loans, as well as loans for pensioners; mutual funds; investments products and services, such as bonds and debentures, as well as agency services; life and non-life bancassurance products; payment, funds transfer, currency exchange and foreign instrument, and SMS services; debit, credit, and prepaid cards; and phone and Internet banking, mobile banking, ATMs, and other services. The company also provides business banking products and services comprising operating accounts; loans for SMEs, international trade, investment banking, and e-guarantee services; securities services, such as custodian, mutual fund supervisor, provident fund registrar, securities registrar, and debenture holders' representative services; personal loans for small businesses; payment, collection, and merchant services; digital banking services; and commercial cards. In addition, it offers trade finance, remittances, export and import, project, corporate finance, and financial advisory services, as well as liquidity, fund, and asset management services. Bangkok Bank Public Company Limited was founded in 1944 and is headquartered in Bangkok, Thailand.","BCB Bancorp, Inc. operates as a bank holding company for BCB Community Bank that provides banking products and services to businesses and individuals in the United States. The company offers deposit products, including savings and club accounts, interest and non-interest-bearing demand accounts, money market accounts, certificates of deposit, and individual retirement accounts. It also provides loans, such as commercial and multi-family real estate, one-to-four family mortgage, commercial business, small business administration, construction, home equity and lines of credit, and consumer loans, as well as residential loans secured by one-to-four family dwellings, condominiums, and cooperative units. In addition, the company offers retail and commercial banking services comprising wire transfers, money orders, safe deposit boxes, night depository services, debit cards, online and mobile banking services, fraud detection services, and automated teller services. As of December 31, 2021, it operated 29 branch offices in Bayonne, Carteret, Edison, Hoboken, Fairfield, Holmdel, Jersey City, Lyndhurst, Maplewood, Monroe Township, Newark, Parsippany, Plainsboro, River Edge, Rutherford, South Orange, Union, and Woodbridge, New Jersey, as well as three branches in Staten Island and Hicksville, New York. The company was founded in 2000 and is headquartered in Bayonne, New Jersey.","Banque Cantonale Vaudoise provides a range of financial services in Vaud Canton and rest of Switzerland, the European Union, North America, and internationally. The company offers current, savings, and retirement accounts; credit and payment cards; mortgage, personal, home, business, and construction loans; and production equipment financing products, and working capital and international trade finance products. It also provides a range of banking products, such as investments, financial planning services, and trading through its online platform; and cash management services, as well as instruments for hedging exchange-rate and interest-rate risk; asset management services; and investment and hedging products, such as currencies, equities, bonds, derivatives, and structured products. In addition, the company engages in the market transactions in equities, fixed-income instruments, forex, and precious metals on behalf of clients. Further, it provides life and disability insurance products, and online banking services; manages finances and investments of high-net-worth individuals; tax planning, estate planning, and financial planning; and retirement, life insurance, and disability coverages. The company operates through a network of approximately 63 branches and 220 ATMs. It primarily serves retail and business customers, and public sector institutions. The company was founded in 1845 and is headquartered in Lausanne, Switzerland.","Brown-Forman Corporation, together with its subsidiaries, manufactures, distills, bottles, imports, exports, markets, and sells various alcoholic beverages. It provides spirits, wines, whiskey spirits, whiskey-based flavored liqueurs, ready-to-drink and ready-to-pour products, ready-to-drink cocktails, vodkas, tequilas, champagnes, brandy, bourbons, and liqueurs. The company offers its products primarily under the Jack Daniel's, Reserve, Old Forester, Coopers' Craft, Herradura, el Jimador, New Mix, Korbel Champagnes, Sonoma-Cutrer, Finlandia, GlenDronach, Benriach, Glenglassaugh, Chambord, Slane, and Fords Gin brands. It is also involved in the sale of used barrels, bulk whiskey, and wine; and provision of contract bottling services. The company serves retail customers and consumers through distributors or state governments; and retailers, wholesalers, and provincial governments directly. It has operations in the United States, Germany, Australia, the United Kingdom, Mexico, and internationally. The company was founded in 1870 and is headquartered in Louisville, Kentucky.","Briscoe Group Limited, together with its subsidiaries, retails homeware and sporting goods in New Zealand. The company operates in two segments, Homeware and Sporting Goods. It operates 46 stores under the Briscoes Homeware brand; 40 stores under the Rebel Sport brand; and 1 store under the Living &amp; Giving brand, as well as sells its products online. The company was founded in 1781 and is headquartered in Auckland, New Zealand. Briscoe Group Limited is a subsidiary of JB Were (NZ) Nominees Limited.","SIIC Environment Holdings Ltd., an investment holding company, engages in the wastewater treatment, water supply, sludge treatment, solid waste incineration, and other environment related businesses primarily in the People's Republic of China. It operates through three segments: Water and Sludge Treatment; Water Supply; and Waste Incineration. The Water and Sludge Treatment segment constructs, manages, and operates water and sludge related infrastructure under service concession arrangements; and manages and operates water and sludge related infrastructure under non-service concession arrangements, as well as provides financial income under service concession arrangements. The Water Supply segment engages in the construction, management, and operation of water supply related infrastructure under service concession arrangements. The Waste Incineration segment constructs, manages, and operates waste incineration related infrastructure under service concession arrangements. The company has a portfolio of approximately 250 water treatment and supply projects, 8 waste incineration projects, and 13 sludge treatment projects in 19 municipalities and provinces in China. It also provides management and consultancy services; treats and supplies potable water; and installs water meters. The company was formerly known as Asia Water Technology Ltd. and changed its name to SIIC Environment Holdings Ltd. in November 2012. SIIC Environment Holdings Ltd. was incorporated in 2002 and is headquartered in Singapore.","BHP Group Limited operates as a resources company in Australia, Europe, China, Japan, India, South Korea, the rest of Asia, North America, South America, and internationally. The company operates through Copper, Iron Ore, and Coal segments. It engages in the mining of copper, silver, zinc, molybdenum, uranium, gold, iron ore, and metallurgical and energy coal. The company is also involved in mining, smelting, and refining of nickel; and potash development activities. In addition, it provides towing, freight, marketing and trading, marketing support, finance, administrative, and other services. The company was founded in 1851 and is headquartered in Melbourne, Australia.","Bank of Ireland Group plc provides various banking and financial products and services. The company operates through Retail Ireland, Wealth and Insurance, Retail UK, and Corporate and Treasury segments. It provides current and savings accounts, and business deposits and accounts; personal, car, home improvement, graduate, and student loans, as well as overdrafts; and business and farming loans, BREXIT loans, invoice finance, hire purchase, and leasing services. The company also offers international payments and credit cards; protection overview, mortgage protection, life cover, specified illness cover, income protection, protection for individuals, and protection for families; pensions and investments, foreign exchange, and treasury deposits and services; personal products; private banking services; and leveraged acquisition and property finance. In addition, it provides home, car, travel, and life insurance products. Bank of Ireland Group plc was founded in 1783 and is headquartered in Dublin, Ireland.","Blau Farmac\u00eautica S.A., a pharmaceutical company provides private label drugs in Brazil, Argentina, Colombia, the United States, Ecuador, Peru, and Uruguay. The company's medications cover various therapeutic classes, such as immunology, hematology, oncology, nephrology, specialties, and antibiotics. It also offers biological drugs; oral and injectable drugs for treating cancer; specialized treatments for infectious diseases; and prescription and non-prescription drugs, including dermo-medicines, condoms, and others for retail and non-retail markets. In addition, the company provides blood-derived, biological, biotechnological, and antiretroviral drugs. It serves hospitals, private clinics, chemotherapy and hemodialysis centers, and public health institutions. The company was incorporated in 1987 and is headquartered in Cotia, Brazil.","Builders FirstSource, Inc., together with its subsidiaries, manufactures and supplies building materials, manufactured components, and construction services to professional homebuilders, sub-contractors, remodelers, and consumers in the United States. It offers lumber and lumber sheet goods comprising dimensional lumber, plywood, and oriented strand board products that are used in on-site house framing; manufactured products, such as wood floor and roof trusses, steel roof trusses, wall panels, stairs, and engineered wood products; and windows, and interior and exterior door units, as well as interior and exterior trims and custom products under the Synboard brand name. The company also offers gypsum, roofing, and insulation products, including wallboards, ceilings, joint treatments, and finishes; and siding, metal, and concrete products, such as vinyl, composite, and wood siding products, as well as exterior trims, other exteriors, metal studs, and cement products. In addition, it provides other building products and services, such as cabinets and hardware, as well as turn-key framing, shell construction, design assistance, and professional installation services. The company was formerly known as BSL Holdings, Inc. and changed its name to Builders FirstSource, Inc. in October 1999. Builders FirstSource, Inc. was founded in 1998 and is based in Dallas, Texas.","Blue Star Capital plc is a private equity and venture capital firm specializing in investments in seed, early stage, and late stage companies, including buy-outs. The firm provides funding for shell companies at the founder stage, upon IPO and operating businesses prior to IPO or alternative exit. It typically invests in new, disruptive technologies in the fast growing areas of esports, blockchain, and payments. The firm invests globally. The firm typically invests between \u00a3250,000 ($387,850) and \u00a32 million ($3.1 million) over the lifetime of an investment. The firm seeks to invest in quoted and unquoted companies. It invests between \u00a350,000 ($77,570) and \u00a30.5 million ($0.78 million) in the initial round and similar amounts are invested in subsequent funding rounds. The firm may take either a minority or a majority stake in its portfolio companies. In the latter case, the firm seeks to take a strategic control of investee businesses. It seeks to invest in companies with a positive cash flow and recurring revenue streams. The firm prefers to exit its investments between three to four years. Blue Star Capital plc is based in Crawley, United Kingdom.","Byggma ASA manufactures and supplies building materials in Norway, Sweden, Denmark, Finland, the United Kingdom, the Netherlands, and internationally. It offers pre-painted ceilings and wall panels under the Huntonit brand name; I-beams for use in ceilings, walls, and floors in wood-based buildings under the brand name of Masonite; and particle boards, boards, and structural panels for use in buildings, interior ceilings, and wall panels under the Forestia brand name. The company also provides home lighting products under the Scan Lamps brand name; doors and windows for new buildings, extensions, and rehabilitation under the brand name of Uldal; a range of lamp and lighting products under the Aneta brand name; and develops, manufactures, and distributes MDF panels for walls, ceilings, bathrooms, and kitchens under the brand name of Smartpanel, as well as supplies OSB plywood and building boards under the brand name of Byggform. It exports its products. Byggma ASA is headquartered in Vennesla, Norway. Byggma ASA operates as a subsidiary of Investor As.","Barnes &amp; Noble Education, Inc. operates bookstores for college and university campuses, and K-12 institutions in the United States. It operates through three segments: Retail, Wholesale, and Digital Student Solutions. The company sells and rents new and used print textbooks, digital textbooks, and publisher hosted digital courseware through physical and virtual bookstores, as well as directly to students through Textbooks.com. It also offers First Day and First Day Complete access programs; BNC OER+, a turnkey solution for colleges and universities, that offers digital content, such as videos, activities, and auto-graded practice assessments; and general merchandise, including collegiate and athletic apparel, school spirit products, lifestyle products, technology products, supplies, graduation products, and convenience items. In addition, the company sources, sells, and distributes new and used textbooks; and sells hardware and a software suite of applications that provides inventory management and point-of-sale solutions to approximately 350 college bookstores. Further, it offers direct-to-student subscription-based writing services; and bartleby, a direct-to-student subscription-based offering that includes textbook solutions, expert questions and answers, and writing and tutoring services. The company operates 805 physical college and university bookstores; 622 virtual bookstores; 8 True Spirit e-commerce websites; pop-up retail locations; 73 customized caf\u00e9s and 11 stand-alone convenience stores; and a media channel for brands targeting the college demographic. Barnes &amp; Noble Education, Inc. was founded in 1965 and is headquartered in Basking Ridge, New Jersey.","Bon Natural Life Limited, together with its subsidiaries, engages in the research and development, manufacture, and sale of functional active ingredients extracted from natural herb plants in the People's Republic of China and internationally. The company provides personal care ingredients, such as plant extracted fragrance compounds to perfume and fragrance manufacturers; natural health supplements comprising powder drinks and bioactive food ingredient products primarily used as food additives; and nutritional supplements. Its products are principally used by manufacturer customers in the functional food, personal care, cosmetic, and pharmaceutical industries. The company was founded in 2006 and is headquartered in Grand Cayman, the Cayman Islands.","bpost NV/SA, together with its subsidiaries, provides mail and parcel services to consumers, businesses, and government in Belgium, rest of Europe, the United States, and internationally. The company operates in three segments: Mail &amp; Retail; PaLo N. Am.; and PaLo Eurasia. Its mail and parcels services include collection, transport, sorting, and distribution of addressed and non-addressed mail, printed documents, newspapers, and parcels, as well as banking and financial products, e-commerce logistics, express delivery, proximity and convenience, document management, and related services. The company also offers transactional mails, advertising mails, press, domestic and international parcels, logistic solutions, and cross-border products, as well as value-added services. bpost NV/SA was incorporated in 1830 and is headquartered in Brussels, Belgium.","Banco do Estado do Rio Grande do Sul S.A., a multiple-service bank, provides a range of banking products and services primarily in Brazil, Miami, and the Grand Cayman. It provides payroll deductible, payroll, consumer, overdraft, real estate, and rural loans, as well as debit and credit cards. The company also offers international and foreign exchange services; personal insurance products, property insurance, capitalization bonds, and supplementary pension plans; and financial agent services. It operates a network of 497 branches, 138 service stations, and 427 electronic stations. The company was incorporated in 1928 and is headquartered in Porto Alegre, Brazil.","Birlasoft Limited provides enterprise digital IT services in the Americas, Europe, the United Kingdom, and internationally. It offers digital transformation services, including data analytics, connected products, intelligent automation, cloud, customer experience, and blockchain services; and enterprise technologies and services in the areas of Oracle and JD Edwards, SAP, Infor, Microsoft, customer relationship management, manufacturing execution systems, product lifecycle management, supply chain management, IT transformation, applications management, testing, and infrastructure and cloud technology. The company also offers solutions, such as intelliOpen, an intelligent system for contactless screening of people, social distancing monitoring, and contact tracing; intelliAsset, a platform for asset visualization, analytics, and actions; TruView CLM, a cloud based contract lifecycle management solution; TruServ FSM, a cloud based touchless automation solution for field services; TruLens, a tool that provides insights into the existing Salesforce implementation; iLink, a solution for the integration of PLM applications and ERP systems; Supplier Risk Radar, an AI-powered preventive risk mitigation solution in the areas of supply chains; Akoya, an engineering analytics solution; and Submission Automation, an insurance broker submission solution. It serves banking, high tech, manufacturing, insurance, media and entertainment, energy and resources, life sciences and healthcare, and utility industries, as well as capital markets. The company was incorporated in 1990 and is based in Pune, India.","BTC Digital Ltd. engages in the cryptocurrency/bitcoin mining business. It also engages in mining machines resale and rental business. The company was formerly known as Meten Holding Group Ltd. and changed its name to BTC Digital Ltd. in August 2023. The company was founded in 2006 and is headquartered in Shenzhen, the People's Republic of China.","Jardine Cycle &amp; Carriage Limited, an investment holding company, engages in the automotive, financial services, heavy equipment, mining, construction and energy, agribusiness, infrastructure and logistics, information technology, and property businesses in Indonesia and internationally. The company produces, distributes, retails, and aftersales services of motor vehicles, as well as manufactures and distributes automotive components; manufactures, assembles, distributes, and owns dealership networks for Toyota, Daihatsu, Isuzu, Peugeot, and UD Trucks, as well as Honda motorcycles; and manufactures and retails BMW vehicles, and owns the Lexus cars dealership. It also offers financial services, such as financing for motorcycles, cars, heavy equipment, insurance protection for individual and commercial customers, lending products to retail consumers, and digital payment solutions. In addition, the company supplies heavy equipment and provides aftersales services for various sectors, including mining, plantation, construction, and forestry; distributes Komatsu, UD, SCANIA, Bomag, and Tadano heavy equipment; and owns and operates thermal and metallurgical coal, gold, and thermal power assets, as well as operates in the construction and renewable energy sectors. Further, it cultivates, harvests, and processes palm oil; develops and manages toll roads; provides printing and digital services solutions; and distributes FUJIFILM business products, as well as develops office and residential buildings. The company was formerly known as Cycle &amp; Carriage Ltd. and changed its name to Jardine Cycle &amp; Carriage Limited in 2004. The company was founded in 1899 and is based in Singapore. Jardine Cycle &amp; Carriage Limited is a subsidiary of Jardine Strategic Singapore Pte Ltd.","Cable One, Inc., together with its subsidiaries, provides data, video, and voice services in the United States. The company offers residential data services, a service to enhance Wi-Fi signal throughout the home. It also provides residential video services, such as local networks; local community programming that includes governmental and public access; and other channels, as well as digital video services, including national and regional cable networks, music channels, and an interactive and electronic programming guide with parental controls. In addition, the company offers premium channels that offer movies, original programming, live sporting events, and concerts and other features; and advanced video services, such as whole-home DVRs and high-definition set-top boxes, as well as TV Everywhere product, which enables its video customers to stream various channels and shows to mobile devices and computers. Further, it provides residential voice services comprising local and long-distance calling, voicemail, call waiting, three-way calling, caller ID, anonymous call rejection, and other features, as well as international calling by the minute services. Additionally, the company offers data, voice, and video products to business customers, including small to mid-markets, enterprises, and wholesale and carrier customers. As of December 31, 2021, it served approximately 1.2 million residential and business customers in 24 states through its Sparklight, Fidelity, and Clearwave brands. Cable One, Inc. was incorporated in 1980 and is headquartered in Phoenix, Arizona.","Cairo Mezz Plc holds and manages contributed bonds. The company was formerly known as Mairanus Ltd. and changed its name to Cairo Mezz Plc in September 2020. The company was founded in 2020 and is based in Nicosia, Cyprus.","Cars.com Inc. operates as a digital marketplace and provides solutions for the automotive industry. Its platform connects car shoppers with sellers. The company, through its marketplace, dealer websites, and other digital products, showcases dealer inventory, elevate and amplify dealers' and automotive manufacturers' (OEMs) brands, connect sellers with ready-to-buy audience, and empower shoppers with the resources and information needed to make car buying decisions. It also offers marketplace products, such as marketplace subscription advertising and social selling services; digital solutions, including Website platform hosting, AI chat tool, digital retailing, and review and reputation management; and advertising comprising display advertising, instant loan screening and approvals, digital advertising, and in-market audio services. As of December 31, 2021, the company served 19,179 dealer customers in 50 states, which included franchise and independent dealers, with digital and brick-and-mortar stores; and primary automakers selling vehicles in the United States. Its customers are local car dealers, OEMs, and other national advertisers. Cars.com Inc. was founded in 1998 and is based in Chicago, Illinois.","Commercial International Bank (Egypt) S.A.E provides retail, corporate, and investment banking services in Egypt. The company operates in four segments: Corporate Banking, Investment, Retail Banking, and Others. It offers current and saving accounts, easy accounts, time deposits, and certificates of deposit; and personal/overdraft/mortgage, educational, solar, travel, car finance, and unsecured personal loans, as well as revolving overdraft salary upfront services. The company also offers global transaction and digital banking; and cash management services, as well as corporate banking services. In addition, it provides credit, debit, and prepaid cards, smart wallet, mobile, Internet, phone banking, and ATM services. Further, the company offers other credit facilities; derivative products; financial instruments trading, structured financing, corporate leasing, and merger and acquisitions advisory; and foreign currency services, as well as assets liabilities services. Additionally, the company provides structured financing, corporate leasing, merger, and acquisition services, as well as trades in financial instruments. Furthermore, the company offers investment savings products, consumer loans and mortgage services. It operates through 215 branches. The company was formerly known as Chase National Bank. Commercial International Bank (Egypt) S.A.E was founded in 1975 and is headquartered in Giza, Egypt.","Credit Corp Group Limited provides debt ledger purchase and collection, and consumer lending services in Australia and the United States. The company operates through three segments: Debt Ledger Purchasing \u0096 Australia and New Zealand; Debt Ledger Purchasing \u0096 United States; and Consumer Lending \u0096 Australia, New Zealand and the United States. The company offers debt sale, contingency and agency collection, local government debt recovery, and hardship and insolvency management services, as well as various loan products. It provides financial services under the Wallet Wizard, ClearCash, CarStart Finance, Resolvr, and Wizpay brands. The company was founded in 1992 and is headquartered in Sydney, Australia.","CDL Investments New Zealand Limited, together with its subsidiary, CDL Land New Zealand Limited engages in the investment, development, management, and sale of residential land properties in New Zealand. It holds approximately 290 hectares of land for development. CDL Investments New Zealand Limited is based in Auckland, New Zealand.","Central Depository Services (India) Limited provides depository services in India. The company offers various services, such as account opening, dematerialization, processing delivery and receipt instructions, account statement, re-materialization, pledging, nomination, transmission of securities, change in address, bank account details, and SMS services for depository participants. It also provides facilities to issuers to credit securities to a shareholder's or applicants demat accounts; KYC services in respect of investors in capital markets to capital market intermediaries; facilities for holding of insurance policies in electronic form to the holders of these policies; and facilities for holding and transacting in electronic negotiable warehouse receipts. In addition, it offers services, such as electronic access to security information, electronic access to security information and execution of secured transaction, e-voting, e-notices, e-locker, and mobile application. It serves investors through depository participants, issuer companies, capital market intermediaries, insurance companies, and warehouse service providers/warehouses. The company was incorporated in 1997 and is based in Mumbai, India.","Companhia de Eletricidade do Estado da Bahia - COELBA engages in the distribution of electricity. It distributes electricity in 415 municipalities serving 6,205 thousand consumers in State of Bahia, as well as in the municipalities of Delmiro Gouveia in the State of Alagoas, and Dian\u00e1polis in the State of Tocantins. The company was founded in 1960 and is headquartered in Salvador, Brazil. Companhia de Eletricidade do Estado da Bahia - COELBA is a subsidiary of Neoenergia S.A.","CONSOL Energy Inc. produces and exports bituminous coal in the United States. It operates through PAMC, CONSOL Marine Terminal, and Other segments. The company engages in the mining, preparation, and marketing of bituminous coal to power generators, industrial end-users, and metallurgical end-users; and provision of coal export terminal services, as well as development of the Itmann Mine and the Greenfield reserves. It owns and operates the Pennsylvania Mining Complex (PAMC), which includes the Bailey Mine, the Enlow Fork Mine, the Harvey Mine, and the Central Preparation Plant; and CONSOL Marine Terminal located in the port of Baltimore. As of December 31, 2021, the company had 612.1 million tons of proven and probable coal reserves at PAMC. It also owns approximately 1.4 billion tons of Greenfield reserves located in the Northern Appalachian, Central Appalachian, and Illinois basins. The company was founded in 1860 and is headquartered in Canonsburg, Pennsylvania.","CEZ, a. s., an electricity generation company, engages in the production, distribution, trade, and sale of electricity and heat in Western, Central, and Southeastern Europe. The company operates through four segments: Generation, Distribution, Sales, and Mining. It operates two nuclear plants, sixteen hydroelectric plants, one combined cycle gas turbine plant, and eight fossil fuel plants in the Czech Republic. The company also operates various fossil fuel, hydro, wind, solar, gas, biogas, and biomass power plants in the Czech Republic; eleven wind power plants in Germany; and two fossil fuel plants and two hydroelectric plants in Poland. In addition, it is involved in the trade and sale of natural gas; mining of coal; quarrying and processing of construction aggregates and limestones; commodity trading business; and provision of energy services. Further, the company holds interest in the lithium ore mining project in C\u00ednovec. CEZ, a. s. was incorporated in 1992 and is headquartered in Prague, the Czech Republic.","Chennai Petroleum Corporation Limited produces and supplies petroleum products in India. The company's principal products include liquefied petroleum gas, motor spirit, superior kerosene oil, aviation turbine fuel, high speed diesel, naphtha, bitumen, hexane, mineral turpentine oil, lube base stock, petrochemical feedstocks, paraffin wax, and petcoke. It also provides furnace oil, sulphur, light diesel oil, extracts, and butene, isobutylene, and high viscosity index oil. In addition, the company offers linear alkyl benzene, methyl ethyl ketone, and propylene glycol and polyols. The company was formerly known as Madras Refineries Limited and changed its name to Chennai Petroleum Corporation Limited in June 2000. Chennai Petroleum Corporation Limited was incorporated in 1965 and is based in Chennai, India. Chennai Petroleum Corporation Limited operates as a subsidiary of Indian Oil Corporation Limited.","Chuy's Holdings, Inc., through its subsidiaries, owns and operates full-service restaurants under the Chuy's name in the United States. As of December 26, 2021, it operated 96 restaurants in 17 states, including the Southeastern and Midwestern United States. The company was founded in 1982 and is headquartered in Austin, Texas.","CNH Industrial N.V. designs, produces, markets, sells, and finances agricultural and construction equipment, trucks, commercial vehicles, buses, and specialty vehicles in North America, Europe, South America, and internationally. It operates through five segments: Agriculture, Construction, Commercial and Specialty Vehicles, Powertrain, and Financial. The Agriculture segment provides farm machinery and implements that include two-and four-wheel drive tractors, crawler tractors, combines, cotton pickers, grape and sugar cane harvesters, hay and forage equipment, planting and seeding equipment, soil preparation and cultivation implements, and material handling equipment under the New Holland Agriculture, Case IH, STEYR, Miller, Kongskilde, \u00d6verum, K-Line, and JF brands. The Construction segment offers excavators, crawler dozers, graders, wheel and backhoe loaders, and skid steer and compact track loaders under the CASE Construction and New Holland Construction brands. The Commercial and Specialty Vehicles segment provides light, medium, and heavy vehicles for the transportation and distribution of goods under the IVECO brand; commuter buses and city-buses under the IVECO BUS and Heuliez Bus brands; quarry and mining equipment under the IVECO ASTRA brand; firefighting vehicles under the Magirus brand; and vehicles for civil defense and peace-keeping missions under the Iveco Defence Vehicles brand. The Powertrain segment offers engines, transmission systems, and axles for on- and off-road applications, as well as for marine and power generation under the FPT Industrial brand. The Financial Services segment provides and administers retail financing to customers for the purchase or lease of new and used industrial equipment or vehicles, and other equipment; wholesale financing, which primarily consists of floor plan financing; and trade receivables factoring services. The company was founded in 1842 and is headquartered in London, the United Kingdom.","ContextVision AB (publ), a medical technology software company, provides image analysis and artificial intelligence software solutions to original equipment manufacturers in Asia, Europe, and the United States. The company offers image enhancement software for 2D/3D/4D ultrasound, radiography, magnetic resonance imaging (MRI), and mammography. Its products include Rivent that offers unparalleled image quality for various types of ultrasound systems for women's health, general imaging, cardiovascular, and point of care applications; VolarView, an image enhancement software for the handheld ultrasound market segment; and GOPiCE, a technology for volumetric image enhancement in real-time. The company also provides Altumira/Altumira Plus, a platform for digital radiography; and Orthopedic Package for orthopedic imaging. In addition, it offers GOPView MRI2Plus, an image enhancement solution for MRI; and INIFY Prostate Screening for digital analysis of prostate biopsies. The company was founded in 1983 and is headquartered in Stockholm, Sweden.","Carter's, Inc., together with its subsidiaries, designs, sources, and markets branded childrenswear under the Carter's, OshKosh, Skip Hop, Child of Mine, Just One You, Simple Joys, Carter's My First Love, little planet, and other brands in the United States and internationally. The company operates through three segments: U.S. Retail, U.S. Wholesale, and International. Its Carter's products include babies and young children products, such as bodysuits, pants, dresses, knit sets, blankets, layette essentials, bibs, booties, sleep and play products, rompers, and jumpers; and OshKosh brand products comprise playclothes, such as denim apparel products with multiple wash treatments and coordinating garments, overalls, woven bottoms, knit tops, and bodysuits. The company also provides products for playtime, travel, mealtime, bathtime, and homegear, as well as kid's bags and diaper bags under the Skip Hop brand. In addition, it offers bedding, cribs, diaper bags, footwear, gift sets, hair accessories, jewelry, outerwear, paper goods, socks, shoes, swimwear, and toys. The company operates 18,800 wholesale locations, including department stores, national chain stores, and specialty stores. As of December 31, 2021, it operated 980 retail stores. The company also sells its products through its eCommerce websites, such as carters.com, oshkoshbgosh.com, oshkosh.com, and skiphop.com, as well as other international wholesale accounts and licensees. Carter's, Inc. was founded in 1865 and is headquartered in Atlanta, Georgia.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. The company also offers switching portfolio encompasses campus switching as well as data center switching; enterprise routing portfolio interconnects public and private wireline and mobile networks, delivering highly secure, and reliable connectivity to campus, data center and branch networks; wireless products include wireless access points and controllers; and compute portfolio including the cisco unified computing system, hyperflex, and software management capabilities, which combine computing, networking, and storage infrastructure management and virtualization. In addition, it provides Internet for the future product consists of routed optical networking, 5G, silicon, and optics solutions; collaboration products, such as meetings, collaboration devices, calling, contact center, and communication platform as a service; end-to-end security product consists of network security, cloud security, security endpoints, unified threat management, and zero trust; and optimized application experiences products including full stack observability and network assurance. Further, the company offers a range of service and support options for its customers, including technical support and advanced services and advisory services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.","CVB Financial Corp. operates as a bank holding company for Citizens Business Bank, a state-chartered bank that provides banking and financial services to small to mid-sized businesses and individuals. It offers checking, savings, money market, and time certificates of deposit products for business and personal accounts; and serves as a federal tax depository for business customers. The company also provides commercial lending products comprising lines of credit and other working capital financing, accounts receivable lending, and letters of credit; agriculture loans to finance the operating needs of wholesale dairy farm operations, cattle feeders, livestock raisers, and farmers; lease financing services for municipal governments; commercial real estate and construction loans; and consumer financing products, including automobile leasing and financing, lines of credit, credit cards, home mortgages, and home equity loans and lines of credit. In addition, it offers various specialized services, such as treasury management systems for monitoring cash flow, merchant card processing program, armored pick-up and delivery, payroll services, remote deposit capture, electronic funds transfers, wires and automated clearinghouse, and online account access. Further, the company provides trust services through its CitizensTrust Division, such as fiduciary services, mutual funds, annuities, 401(k) plans, and individual investment accounts. As of December 31, 2021, it operated 58 banking centers located in the Inland Empire, Los Angeles County, Orange County, San Diego County, Ventura County, Santa Barbara County, and the Central Valley area of California; and three trust offices located in Ontario, Newport Beach, and Pasadena, as well as two loan production offices in California's Central Valley and the Sacramento area. The company was founded in 1974 and is headquartered in Ontario, California.","Commercial Vehicle Group, Inc., together with its subsidiaries, designs, manufactures, produces, and sells components and assemblies in North America, Europe, and the Asia-Pacific regions. It operates in four segments: Vehicle Solutions, Warehouse Automation, Electrical Systems, and Aftermarket &amp; Accessories. The company offers electrical wire harness assemblies that function as current carrying devices in providing electrical interconnections for gauges, lights, control functions, power circuits, powertrain and transmission sensors, emissions systems, and other electronic applications on commercial and
