other vehicles; and panel assemblies. It also offers electro-mechanical assemblies, such as box builds, complex automated and robotic assemblies, and large multi-cabinet control cabinets with power distribution and cabling; vinyl or cloth-covered appliqu\u00e9s, armrests, map pocket compartments, and sound-reducing insulations; instrument panels; and plastics decorating and finishing products. In addition, it provides cab structures; design products, including armrests, grab handles, storage systems, floor coverings, floor mats, sleeper bunks, headliners, wall panels, and privacy curtains; and mirrors, wipers, and controls used in commercial, military and specialty recreational vehicles. Further, it offers seats and seating systems, such as mechanical and air suspension, static and military seats, and bus, as well as seats for medium-and heavy-duty trucks (MD/HD trucks); office seating products; and seats, parts, and components for the aftermarket. The company supplies its products and systems for the commercial vehicle market comprising the MD/HD truck market; and MD/HD truck, bus, construction, mining, agricultural, military, industrial, municipal, off-road recreational, and specialty vehicle markets. Commercial Vehicle Group, Inc. was incorporated in 2000 and is headquartered in New Albany, Ohio.","CPI Aerostructures, Inc. engages in the contract production of structural aircraft parts for fixed wing aircraft and helicopters in the commercial and defense markets. The company also offers aero systems, such as reconnaissance pod structures and fuel panel systems; and supplies parts for maintenance, repair, and overhaul (MRO), as well as kitting contracts. In addition, it operates as a subcontractor for defense contractors and commercial contractors, as well as a contractor for the United States Department of Defense. Further, the company offers engineering, program management, supply chain management, kitting, and MRO services. Additionally, it offers machine gunner window assemblies, hover infrared suppression system module assemblies, wing sets and spares kits, lock assemblies, canopy activation drive shaft assemblies, rudder island and drag chute canister assemblies, composite electronics racks, structural wing components, fixed leading edges, and engine inlet assemblies. The company was formerly known as Consortium of Precision Industries, Inc. and changed its name to CPI Aerostructures, Inc. in July 1992. CPI Aerostructures, Inc. was incorporated in 1980 and is headquartered in Edgewood, New York.","DATA MODUL Aktiengesellschaft, Produktion und Vertrieb von elektronischen Systemen develops, manufactures, and distributes flatbed displays, monitors, electronic subassemblies, and information systems. It operates through two segments, Displays and Systems. The company manufactures and distributes TFT, touch, passive, epaper, customized, memory-in-pixel, and OLED displays. It also provides projected capacitive touch solutions, resistive touch screens, touch panels and sensors, and controller boards; firmware, cover glasses, and optical bonding solutions; human machine interface solutions; embedded components, single board computers, computer-on-modules, baseboards, memory and cooling solutions, and cables; and CPU boards, LCD controller boards, and embedded box PCs, as well as embedded computing design services. In addition, the company offers various monitors, panel PC solutions, and passenger information systems, as well as develops customized system solutions for various applications. It primarily serves customers in the mechanical engineering, medical device technology, automotive, industrial automation, and gaming industries in Germany and internationally. The company was founded in 1972 and is headquartered in Munich, Germany. DATA MODUL Aktiengesellschaft, Produktion und Vertrieb von elektronischen Systemen is a subsidiary of Arrow Central Europe Holding Munich GmbH.","Dynasty Ceramic Public Company Limited manufactures and sells ceramic wall and floor tiles in Thailand and internationally. It offers its products under the Dynasty, Tile Top, Jaguar, Value, Mustang, Chicken, Birdie, Ducky, Swan, M, Cosmo, Rover, and Monte brands. The company was formerly known as Royal Floor Tile Co. Ltd. Dynasty Ceramic Public Company Limited was founded in 1989 and is headquartered in Bangkok, Thailand.","Dime Community Bancshares, Inc. operates as the holding company for Dime Community Bank that provides various commercial banking and financial services. It accepts time, savings, and demand deposits from the businesses, consumers, and local municipalities. The company also offers commercial real estate loans; multi-family mortgage loans; residential mortgage loans; secured and unsecured commercial and consumer loans; home equity loans; and construction and land loans. In addition, it invests in Federal Home Loan Bank, Federal National Mortgage Association, Government National Mortgage Association, and Federal Home Loan Mortgage Corporation mortgage-backed securities, collateralized mortgage obligations, and other asset backed securities; U.S. Treasury securities; New York state and local municipal obligations; U.S. government-sponsored enterprise securities; and corporate bonds. Further, the company offers certificate of deposit account registry services and insured cash sweep programs; merchant credit and debit card processing, automated teller machines, cash management services, lockbox processing, online banking services, remote deposit capture, safe deposit boxes, and individual retirement accounts; investment products and services through a third-party broker dealer; and title insurance broker services. As of December 31, 2021, it operated 60 branch locations throughout Long Island and the New York City boroughs of Brooklyn, Queens, Manhattan, and the Bronx. Dime Community Bancshares, Inc. was founded in 1910 and is headquartered in Hauppauge, New York.","Delta Electronics (Thailand) Public Company Limited, together with its subsidiaries, researches and develops, manufactures, and distributes electronic products. It operates through Power Electronics, Infrastructure, and Automation segments. It offers inductors, RF inductors, transformers, networking products, EMI filters, solenoids, current sensing resistors, and power modules; switching power supplies, standard power modules, and lighting ballasts and LED drivers; DC brushless fans and blowers, motors, thermal management products, cabinet thermal solutions, and indoor air quality and automotive fans; EV/HEV powertrain solutions and power electronics components comprise of on-board chargers and DC/DC converters; and display and visualization, mobile power, industrial power, and medical power products, as well as healthcare devices. The company also provides industrial automation products and solutions, including drives and power quality products, motion control solutions, control systems, robots, software systems, and manufacturing equipment, as well as field devices that include temperature controllers, machine vision systems, power meters, and smart and vision sensors. In addition, it offers building automation products comprising building management and control system, LED lighting, intellegent surveillace, and building energy management system products; telecom power systems, networking systems, and UPS and datacenter infrastructure solutions; and EV charging and energy storage systems, renewable energy, industrial battery charging, healthcare devices, industrial equipment, energy IoT, and display and visualization products. Further, the company rents properties. It operates in the United States, China, Germany, india, Ireland, Singapore, Norway, Taiwan, the Netherlands, and internationally. The company was incorporated in 1988 and is based in Samut Prakan, Thailand.","Delta Corp Limited operates in the gaming and entertainment, and hospitality businesses in India and internationally. It operates through three segments: Casino Gaming, Online Skill Gaming, and Hospitality. The Casino Gaming segment operates offshore casinos, including Deltin Royale, Deltin JAQK, and King Casino in Goa; land based casinos, such as Deltin Suites Casino in Goa and Deltin Denzong in Sikkim; and Deltin Suites Casino in Kathmandu, Nepal. The Online Gaming segment operates Adda52.com, an online poker site; and Adda52Rummy, a rummy app. The Hospitality segment operates The Deltin, a five-star hotel, which include 176 rooms, 3 bars, and 3 gourmet restaurants located in Daman; and Deltin Suites, an all-suite hotel, which comprise 106 rooms, bar, and restaurants located in Goa. Delta Corp Limited was incorporated in 1990 and is based in Mumbai, India.","DFV Deutsche Familienversicherung AG operates as a digital insurance company in Germany. It offers property, accident, liability, legal expense, household, pet health, and electronics insurance products; and dental, outpatient and inpatient treatment, foreign travel health, sick day, supplementary long-term care, and state-aided care provision insurance products. The company was incorporated in 2006 and is based in Frankfurt, Germany.","Ditto (Thailand) Public Company Limited distributes document management solutions in Thailand. It also rents, distributes, and services photocopiers, printers, and technology products, as well as technology engineering services for various government agency projects. In addition, the company provides construction, mechanical and electrical engineering system, and information technology services. Ditto (Thailand) Public Company Limited was founded in 2013 and is headquartered in Bangkok, Thailand.","Doximity, Inc. operates a cloud-based digital platform for medical professionals in the United States. The company's platform provides its members with tools built for medical professionals, enabling them to collaborate with their colleagues, coordinate patient care, conduct virtual patient visits, stay up to date with the latest medical news and research, and manage their careers. It primarily serves pharmaceutical manufacturers and healthcare systems. The company was formerly known as 3MD Communications, Inc. and changed its name to Doximity, Inc. in June 2010. Doximity, Inc. was incorporated in 2010 and is headquartered in San Francisco, California.","Darden Restaurants, Inc., through its subsidiaries, owns and operates full-service restaurants in the United States and Canada. As of May 29, 2022, it owned and operated 1,867 restaurants, which included 884 under the Olive Garden brand, 546 under the LongHorn Steakhouse brand name, 172 under the Cheddar's Scratch Kitchen brand, 85 under the Yard House brand name, 62 under The Capital Grille brand, 45 under the Seasons 52 brand name, 42 under the Bahama Breeze brand, 28 under the Eddie V's Prime Seafood brand name, and 3 under the Capital Burger brand; and franchised 60 restaurants comprising 35 under the Olive Garden brand, 18 under the LongHorn Steakhouse brand name, 4 under the Cheddar's Scratch Kitchen brand, 2 under The Capital Grille brand name, and 1 under the Bahama Breeze brand.Darden Restaurants, Inc. was founded in 1968 and is based in Orlando, Florida.","Dassault Syst\u00e8mes SE provides software solutions and services worldwide. It offers SOLIDWORKS design software for 3D design, electrical and printed circuit board design, product data management, simulation, manufacturing, and technical communication; CATIA, an engineering and design software for product 3D computer-aided design; GEOVIA for modeling and simulating the earth; and BIOVIA that provides the scientific community with advanced biological, chemical, and materials experiences. The company also provides SIMULIA that delivers realistic simulation applications; DELMIA, which enables global industrial operations; 3DVIA that provides 3D space planning solutions; and ENOVIA that enables to plan and track the definition of success for customer. In addition, it offers Centric PLM, a product lifecycle management software solution; 3DEXCITE, a real-time 3D visualization software; NETVIBES, which enables organizations to gather, align, and enrich big data; 3DEXPERIENCE platform that provides organizations a holistic and real-time view of their business activities and ecosystem, as well as connecting people, ideas, data, and solutions together in a single environment; and MEDIDATA, a clinical research study software that provides evidences and insights to pharmaceutical, biotech, medical device, and diagnostic companies, as well as academic researchers. Further, the company provides consulting, deployment, outcome based, and training services. It primarily serves companies in the transportation and mobility; industrial equipment; aerospace and defense; high-tech; life sciences and healthcare; energy and materials; home and lifestyle; construction, cities, and territories; consumer packaged goods and retail; marine and offshore; and business services sectors through distributors and resellers. Dassault Syst\u00e8mes SE was incorporated in 1981 and is headquartered in V\u00e9lizy-Villacoublay, France.","Dynatrace, Inc. provides a software intelligence platform for dynamic multi-cloud environments. It operates Dynatrace, a software intelligence platform, which provides application and microservices monitoring, runtime application security, infrastructure monitoring, digital experience monitoring, business analytics, and cloud automation. Its platform allows its customers to modernize and automate IT operations, develop and release software, and enhance user experiences. The company also offers implementation, consulting, and training services. Dynatrace, Inc. markets its products through a combination of direct sales team and a network of partners, including resellers, system integrators, and managed service providers. It serves customers in various industries comprising banking, insurance, retail, manufacturing, travel, and software. The company operates in North America, Europe, the Middle East, Africa, the Asia Pacific, and Latin America. Dynatrace, Inc. was founded in 2005 and is headquartered in Waltham, Massachusetts.","Eason &amp; Co Public Company Limited manufactures and sells industrial and automotive paints primarily in Thailand. It offers packaging coatings for interior and exterior application to crown caps, ROPP, screw caps, lug caps, and other closures. The company also provides offset inks comprising metal decorating inks for 2-piece cans; and conventional and UV metal decorating inks for 3-piece cans. In addition, it offers motorcycle coatings, including poly urethane, acrylic, and air dry paints, as well as trades in industrial paints. The company was formerly known as Eason Paint Public Company Limited and changed its name to Eason &amp; Co Public Company Limited in May 2020. Eason &amp; Co Public Company Limited was incorporated in 1965 and is headquartered in Phan Thong, Thailand.","Enterprise Bancorp, Inc. operates as the holding company of Enterprise Bank and Trust Company that provides commercial banking products and services. It offers commercial and retail deposit products, including checking accounts, limited-transactional savings and money market accounts, commercial sweep products, and term certificates of deposit. The company also provides commercial real estate, commercial and industrial, commercial construction, residential, and consumer loans, as well as home equity loans and lines of credit. In addition, the company offers cash management services; wealth advisory and management services that include customized investment management and trust services to individuals, family groups, commercial businesses, trusts, foundations, non-profit organizations, and endowments; brokerage and management services to individual investors; insurance services; and voice, online, and mobile banking services. As of January 27, 2022, it had 26 full-service branches located in the Massachusetts communities of Acton, Andover, Billerica, Chelmsford, Dracut, Fitchburg, Lawrence, Leominster, Lexington, Lowell, Methuen, North Andover, Tewksbury, Tyngsborough, and Westford; and in the New Hampshire communities of Derry, Hudson, Nashua, Pelham, Salem, and Windham. The company was founded in 1989 and is headquartered in Lowell, Massachusetts.","ECS Botanics Holdings Ltd engages in the cultivation, manufacture, and sale of medicinal cannabis products. It also retails hemp wellness and food products; and engages in the agriculture business. The company is based in Launceston, Australia.","EDAG Engineering Group AG engages in the development of vehicles, derivatives, modules, and production facilities for the automotive and commercial vehicle industries worldwide. It operates through three segments: Vehicle Engineering, Production Solutions, and Electrics/Electronics. The Vehicle Engineering segment provides package and ergonomics, body assembly, surface design, and interior and exterior services; develops commercial vehicles, doors, covers, and lid systems, as well as head, rear, and small lamps; and technologies and lightweight designing services. This segment also offers vehicle integration services comprising functional integration and vehicle validation services, such as testing of individual components, modules, engines, motors, transmissions, and complete vehicles; models and vehicle solutions, including a range of styling, ideation, and design services, as well as creates test vehicles, sub-assemblies, and vehicle bodies for the physical validation of modules and systems; project management; and consulting and support services for quality-related matters. The Production Solutions segment provides body manufacturing and smart factory services, product design for manufacturability, coordinated technical building equipment and plant layout, individual production solutions, networking through smart logistics, digitalization, and networking in production; and process consulting and CAx development services, as well as consulting, conceptual, and realization services. The Electrics/Electronics segment develops electric and electronic systems comprising architecture and networks development, systems engineering, embedded systems, information technology, integration and system validation, functional safety and cyber security, and process and product data management services. The company was founded in 1969 and is based in Arbon, Switzerland. EDAG Engineering Group AG is a subsidiary of Aton Austria Holding GmbH.","Eimco Elecon (India) Limited manufactures and sells equipment for mining and construction sector in India. It offers side dump loaders, load haul dumpers, coal haulers, roof bolters, shuttle cars, continuous miner package, universal drill machines, articulated wheel loaders, foundation equipment, low profile dump trucks, rocker shovel loaders, and underground transport systems, as well as piling rigs, air motors, and chair lift man riding systems. The company also exports its products to South East Asia and Africa. Eimco Elecon (India) Limited was incorporated in 1974 and is headquartered in Vallabh Vidyanagar, India.","Companhia Paranaense de Energia - COPEL engages in the generation, transformation, distribution, and trading of energy to industrial, residential, commercial, rural, and other customers primarily in the State of Paran\u00e1, Brazil. The company operates through Power generation and transmission, Power distribution, Gas, and Power sale segments. It is also involved in the piped natural gas distribution. As of December 31, 2021, the company operated 20 hydroelectric plants, 30 wind plants, and 1 thermoelectric plant with a total installed capacity of 5,957 megawatts; and owned and operated 3,638 km of transmission lines and 204,957 km of distribution lines. It holds concessions to distribute electricity in 394 municipalities in the State of Paran\u00e1 and in the municipality of Porto Uni\u00e3o in the State of Santa Catarina. Companhia Paranaense de Energia \u0096 COPEL was founded in 1954 and is headquartered in Curitiba, Brazil.","Entergy Mississippi, LLC generates, transmits, and distributes, and sells coal and solar power primarily to retail and wholesale customers in Mississippi. It also provides gas services to customers. Entergy Mississippi, LLC was formerly known as Entergy Mississippi Power and Light, LLC and changed its name to Entergy Mississippi, LLC on December 01, 2018. The company was incorporated in 2018 and is based in Jackson, Mississippi. Entergy Mississippi, LLC operates as a subsidiary of Entergy Utility Holding Company, LLC.","EPAM Systems, Inc. provides digital platform engineering and software development services worldwide. The company offers engineering services, including requirements analysis and platform selection, customization, cross-platform migration, implementation, and integration; infrastructure management services, such as software development, testing, and maintenance with private, public, and mobile infrastructures for application, database, network, server, storage, and systems operations management, as well as monitoring, incident notification, and resolution services; and maintenance and support services. It also provides operation solutions comprising integrated engineering practices and smart automation; and optimization solutions that include software application testing, test management, automation, and consulting services to enable customers enhance their existing software testing and quality assurance practices, as well as other testing services that identify threats and close loopholes to protect its customers' business systems from information loss. In addition, the company offers business, experience, technology, data, and technical advisory consulting services; and digital and service design solutions, which comprise strategy, design, creative, and program management services, as well as physical product development, such as artificial intelligence, robotics, and virtual reality. It serves the financial services, travel and consumer, software and hi-tech, business information and media, life sciences and healthcare, and other industries. The company was founded in 1993 and is headquartered in Newtown, Pennsylvania.","Everi Holdings Inc. provides entertainment and technology solutions for the casino and digital gaming industries in the United States, Canada, the United Kingdom, Europe, the Caribbean, Central America, and Asia. It operates in two segments, Games and FinTech. The company offers local and wide-area progressive gaming products, such as classic mechanical reel games and video reel games, as well as TournEvent, a slot tournament terminal and system machine; and sells player terminals, licenses, game content, and related equipment. It also provides financial access services, such as funds dispensed, credit card and POS debit card financial access transactions; check warranty; CashClub, a software payments platform that provides gaming establishments with a personal computer workstation software user interface and point-of-sale terminal; CashClub Wallet, a digital payments platform for gaming establishments; fully integrated kiosks that provide multiple functions to the casino floor; loyalty kiosk and related equipment; and other integrated kiosk solutions. In addition, the company offers non-funds dispensing terminals that perform authorizations for credit card financial access and POS debit card financial access transactions; and database services. Further, it provides Everi Compliance solutions to assist casino operators with meeting regulatory requirements; Central Credit, a gaming patron credit bureau service; JackpotXpress, a jackpot payout and tax form management platform; and loyalty platform, as well as support and maintenance services. The company was formerly known as Global Cash Access Holdings, Inc. and changed its name to Everi Holdings Inc. in August 2015. Everi Holdings Inc. was founded in 1998 and is headquartered in Las Vegas, Nevada.","Fanhua Inc., together with its subsidiary, distributes insurance products in China. It operates through two segments, Insurance Agency and Claims Adjusting. The Insurance Agency segment provides property and casualty insurance products that primarily include individual accident, travel, homeowner, and indemnity medical insurance products; and life insurance products, such as individual health, individual whole life, individual term life, individual endowment life, and individual annuity, as well as participating insurance products. The Claims Adjusting segment offers pre-underwriting survey, claims adjusting, residual value disposal, loading and unloading supervision, and consulting services. The company also operates baoxian.com, an online insurance platform, which allows customers to search for, and purchase a range of insurance products; Lan Zhanggui, an all-in-one insurance sales and service platform; ehuzhu.com, an online mutual aid platform; and Chetong.net, an online claims services resource aggregating platform, as well as Fanhua RONS DOP, a digital marketing platform; Fanhua RONS Guanjia, a customer service platform; and Fanhua WeCom that enables agents to directly interact with existing and potential customers. It serves customers through insurance sales and service group, and insurance agencies, as well as sales and service branches and outlets, registered independent sales agents, and in-house claims adjustors. The company was formerly known as CNinsure Inc. and changed its name to Fanhua Inc. in December 2016. Fanhua Inc. was founded in 1998 and is headquartered in Guangzhou, China.","The First of Long Island Corporation operates as the holding company for The First National Bank of Long Island that provides financial services to small and medium-sized businesses, professionals, consumers, municipalities, and other organizations. The company offers business and small business checking, personal checking, negotiable order of withdrawal, interest on lawyer, escrow service, rent security, personal and nonpersonal money market, savings, time deposit, holiday club, and individual retirement accounts. It also provides commercial and residential mortgage, commercial and industrial, small business credit scored, Small Business Administration, construction and land development, consumer, and home equity lines of credit/loans, as well as commercial and standby letters of credit; debit or credit cards; and overdraft facilities. In addition, the company offers life insurance, trust, estate and custody, retail investment, bill payment, lockbox, ACH, safe deposit box rental, wire transfer, money order, checkbook printing, check, ATM, and online and mobile banking services, as well as investment securities, management, and advisory services. It operates 40 branches, including 17 branches in Nassau, 15 in Suffolk, 5 in Queens, 2 in Brooklyn, and 1 in Manhattan. The company was founded in 1927 and is headquartered in Glen Head, New York.","Farmers National Banc Corp., a financial holding company, operates in the banking, trust, retirement consulting, insurance, and financial management industries. It offers commercial and retail banking services, including checking, savings, and time deposit accounts; commercial, mortgage and installment, and home equity loans; home equity lines of credit, night depository, safe deposit box, money order, bank check, automated teller machine, Internet banking, travel card, E bond transaction, MasterCard and Visa credit cards, brokerage, and other services. The company also provides personal and corporate trust services in the areas of estate settlement, trust administration, and employee benefit plans; retirement services; property and casualty insurance products and services; and various insurance products through licensed representatives, as well as invests in municipal securities. It operates through 47 locations in northeastern region of Ohio and one location in southwestern Pennsylvania. The company was founded in 1887 and is based in Canfield, Ohio.","FNCB Bancorp, Inc. operates as the bank holding company for FNCB Bank that provides retail and commercial banking services to individuals, businesses, local governments, and municipalities in Northeastern Pennsylvania. The company offers checking, savings, money market, and certificate of deposit products. It also provides residential mortgage loans, and home equity term loans and lines of credit; construction, land acquisition, and development loans; commercial real estate loans; commercial and industrial loans; consumer loans, such as secured and unsecured installment loans, automobile financing, lines of credit, and overdraft protection loans; state and political subdivision loans and leases; and purchased loans. In addition, the company offers debit cards; mobile and telephone banking, check imaging, and electronic statement services; remote deposit capture, merchant, treasury, and purchasing card services; and wealth management services. As of January 28, 2022, it operated 17 community offices located in Lackawanna, Luzerne, and Wayne Counties. The company was formerly known as First National Community Bancorp, Inc. and changed its name to FNCB Bancorp, Inc. in October 2016. FNCB Bancorp, Inc. was founded in 1910 and is headquartered in Dunmore, Pennsylvania.","Forvia SE, together with its subsidiaries, manufactures and sells automotive technology solutions in France, Germany, other European countries, the Americas, Asia, and internationally. It operates through Seating, Interiors, Clean Mobility, Electronics, Lighting, and Lifecycle Solutions segments. The Seating segment designs and manufactures vehicle seats, seating frames, covers, and comfort solutions, as well as adjustment mechanisms. The Interior segment designs, manufactures, and assembles instrument panels, cockpits, and door panels and modules, as well as center consoles, and sustainable materials. The Clean Mobility segment designs and manufactures exhaust system solutions for passenger and commercial vehicles; fuel cell electric vehicles; and aftertreatment solutions for commercial vehicles, as well as zero-emissions solutions. The Electronics segment designs and manufactures display technologies, driver assistance systems, and cockpit electronics, as well as sensors and actuators, lighting/body electronics, energy management, and HMI/displays. The Lighting segment designs and manufactures lighting technologies. The Lifecycle Solutions segment provides solutions extending the vehicle lifecycle, as well as workshop equipment and special original equipment. The company was formerly known as Faurecia S.E. and changed its name to Forvia SE in June 2023. Forvia SE was incorporated in 1929 and is headquartered in Nanterre, France.","Flotek Industries, Inc. operates as a technology-driven chemistry and data company that serves customers across industrial, commercial, and consumer markets in the United States, the United Arab Emirates, and internationally. It operates in two segments, Chemistry Technologies (CT) and Data Analytics (DA). The CT segment designs, develops, manufactures, packages, distributes, delivers, and markets green specialty chemicals that enhance the profitability of hydrocarbon producers and cleans surfaces in commercial and personal settings to help reduce the spread of bacteria, viruses, and germs. This segment primarily serves integrated oil and gas, oilfield services, independent oil and gas, national and state-owned oil, geothermal energy, solar energy, and alternative energy companies. The DA segment designs, develops, produces, sells, and supports equipment and services that create and provide valuable information on the composition and properties of energy customers' hydrocarbon fluids. This segment's data platforms combine the energy industry's field-deployable, inline optical analyzer with proprietary cloud visualization and analytics. It sells its products directly through a mix of in-house sales professionals, as well as contractual agency agreements. The company was incorporated in 1985 and is headquartered in Houston, Texas.","Fleetwood Limited engages in the design, manufacture, and sale of modular accommodation units in Australia and New Zealand. It operates through three segments: RV Solutions, Building Solutions, and Community Solutions. The company also engages in the operation of accommodation villages; develops and commercialize keyless locks and energy management systems; and manufacture, installation, and distribution of recreational vehicle parts and accessories. It offers accommodation solutions for resources, education, affordable housing, mining, and corrections sectors; and provides caravan plumbing and electrical services, as well as supplies related parts. The company was formerly known as Fleetwood Corporation Limited and changed its name to Fleetwood Limited in November 2020. Fleetwood Limited was founded in 1964 and is headquartered in Subiaco, Australia.","First National Corporation operates as the bank holding company for First Bank that provides various commercial banking services to small and medium-sized businesses, individuals, estates, local governmental entities, and non-profit organizations in Virginia. The company's deposit products include checking, savings, money market, and individual retirement accounts, as well as certificates of deposit and treasury management solutions. Its loan products comprise construction loans, including residential, land acquisition, and development loans; 1-4 family residential real estate loans; and commercial real estate loans that are secured by commercial real estate, including multi-family residential buildings, office and retail buildings, hotels, industrial buildings, and religious facilities. The company's loan products also include commercial and industrial loans that are secured by business assets, such as accounts receivable, equipment, and inventory; home equity loans; and secured and unsecured consumer loans, such as lines of credit, automobile loans, deposit account loans, and installment and demand loans. In addition, it provides wealth management services, including estate planning, investment management of assets, trustee under an agreement, trustee under a will, and estate settlement. Further, the company offers title insurance and investment services; and holds other real estate owned and office sites, as well as provides internet and mobile banking, remote deposit capture, and other traditional banking services. It serves customers through 20 bank branch offices, a loan production office, and a customer service center, as well as through a network of ATMs. The company was founded in 1907 and is headquartered in Strasburg, Virginia.","Genpact Limited provides business process outsourcing and information technology (IT) services in India, rest of Asia, North and Latin America, and Europe. It operates through three segments: Banking, Capital Markets and Insurance; Consumer Goods, Retail, Life Sciences and Healthcare; and High Tech, Manufacturing and Services. The company offers CFO advisory services; and environmental, social, and governance (ESG) services, such as data management, carbon accounting, human rights assessment, sustainability diligence, and ESG reporting. It also provides finance and accounting services, which include accounts payable, such as document management, invoice processing, approval and resolution management, and travel and expense processing; invoice-to-cash services, including customer master data management, credit and contract management, fulfillment, billing, collections, and dispute management services; record to report services comprising accounting, treasury, tax, product cost accounting, and closing and reporting services; financial planning and analysis consisting of budgeting, forecasting, and business performance reporting; and enterprise risk and compliance services, including operational risks and controls. In addition, the company provides supply chain advisory services, and after-sales services; sourcing and procurement services comprising direct and indirect strategic sourcing, category management, spend analytics, procurement operation, and master data management; and sales and commercial services, including campaign, order, and dispute management, lead generation, pricing, and promotion optimization. Further, it offers IT services, which comprise end-user computing support, infrastructure management, application production support, and database management services; and transformation services that include digital solutions, consulting services, and analytics services and solutions. The company was founded in 1997 and is based in Hamilton, Bermuda.","Greif, Inc. engages in the production and sale of industrial packaging products and services worldwide. It operates in three segments: Global Industrial Packaging; Paper Packaging &amp; Services; and Land Management. The Global Industrial Packaging segment produces and sells industrial packaging products, including steel, fiber, and plastic drums; rigid and flexible intermediate bulk containers; closure systems for industrial packaging products; transit protection products; water bottles, and remanufactured and reconditioned industrial containers; and various services, such as container life cycle management, filling, logistics, warehousing, and other packaging services to chemicals, paints and pigments, food and beverage, petroleum, industrial coatings, agriculture, pharmaceuticals, mineral product, and other industries. This segment also offers flexible intermediate bulk containers and related services to the agriculture, construction, and food industries. The Paper Packaging &amp; Services segment produces and sells containerboards, corrugated sheets and containers, and other corrugated and specialty products to customers in the packaging, automotive, food, and building products markets; and produces and sells coated and uncoated recycled paperboard, and recycled fiber. This segment's corrugated container products are used to ship various products, such as home appliances, small machinery, grocery products, automotive components, books, and furniture, as well as various other applications. The Land Management segment engages in harvesting and regeneration of timber properties; and sale of timberland and special use properties. As of October 31, 2021, this segment owned approximately 175,000 acres of timber properties in the southeastern United States. The company was formerly known as Greif Bros. Corporation and changed its name to Greif, Inc. in 2001. Greif, Inc. was founded in 1877 and is headquartered in Delaware, Ohio.","Geospace Technologies Corporation designs and manufactures instruments and equipment used in the oil and gas industry to acquire seismic data in order to locate, characterize, and monitor hydrocarbon producing reservoirs. The company operates through three segments: Oil and Gas Markets, Adjacent Markets, and Emerging Markets. The Oil and Gas Markets segment offers wireless seismic data acquisition systems and reservoir characterization products and services, as well as traditional seismic exploration products, such as geophones, hydrophones, leader wires, connectors, cables, marine streamer retrieval and steering devices, and other seismic products. The Adjacent Markets segment provides industrial products, including imaging equipment, water meter products, remote shut-off valves and Internet of Things platform, and offshore cables, as well as seismic sensors for vibration monitoring and geotechnical applications, such as mine safety and earthquake detection applications; and electronic pre-press products that employ direct thermal imaging, direct-to-screen printing systems, and digital inkjet printing technologies targeted at the commercial and industrial graphics, textile, and flexographic printing industries. The Emerging Markets segment designs and sells products used for border and perimeter security surveillance, cross-border tunneling detection, and other products targeted at movement monitoring, intrusion detection, and situational awareness. This segment serves customers that include various agencies of the United States government, including the Department of Defense, Department of Energy, Department of Homeland Security, and other agencies. The company operates in Asia, Canada, Europe, the United States, and internationally. Geospace Technologies Corporation was founded in 1980 and is headquartered in Houston, Texas.","Gaming Innovation Group Inc., an iGaming technology company, together with its subsidiaries, provides solutions, products, and services to iGaming operators in Nordic countries, other European countries, and internationally. The company offers media services, such as operating various content rich websites, which empower potential players and connect them with their partners' casino or sports betting sites; and platform services, including providing gaming, betting, media, and turnkey platform solutions and services to operators and their customers, as well as specializes in taking land-based operators online through its omnichannel solution, which brings together the offline and online worlds through a shared loyalty system, wallet, and dual registration. It also provides Sportsbook, a sports betting omnichannel solution that offers a various digital content and sports events to players. In addition, the company offers managed service; omnichannel solutions; Data platform to enhance BI and make business decisions; Logic, a real-time rules engine that creates actionable business rules; marketing compliance solution; and Frontend solution. The company was founded in 2012 and is headquartered in St. Julian's, Malta.","Galilee Energy Limited, through its subsidiaries, engages in the exploration and production of oil and gas properties in Australia, the United States, and Chile. It primarily explores for coal seam gas. The company's flagship project is the Glenaras gas project located within the ATP 2019 permit, which covers an area of approximately 3,200 square kilometers in western Queensland's Galilee Basin. Galilee Energy Limited was incorporated in 1994 and is based in Brisbane, Australia.","Gorilla Technology Group Inc. provides video intelligence, Internet of Things (IoT) security, and edge content management hardware, software, and services in the Asia Pacific region. The company operates through three segments: Video IoT, Security Convergence, and Other segments. It offers intelligent video analytics AI models for various verticals, such as behavioral analytics, people/face recognition, vehicle analysis, object recognition, and business intelligence that can scan video for patterns and distinguish specific items using AI algorithms and metadata. The company also provides information technology (IT) and operational technology (OT) security convergence AI algorithms for system administrators and security engineers to detect suspicious behaviors in real time; network anomaly detection AI models; and endpoint malware and suspicious behavior detection AI models. In addition, it offers intelligent video analytics (IVA) appliances to analyze and turn unstructured video and picture data into structured data; IVAR appliance that provides insight into business and operations in a statistic dashboard; smart attendance to track employee health and safety, work hours, clock-ins/outs, and absenteeism, as well as to protect company assets and intellectual properties; event and video management system appliances to store event/object attributes in temporal-spatial big data database from Gorilla; and operation technology security appliance to monitor and control physical devices, processes, and infrastructure, as well as to protect industrial systems and networks from various threats. Further, the company provides smart retail SaaS for shopper demographics, visualized shopper behavior, and advanced data analytics, smart city and transportation SaaS for traffic management, public safety, and planning data; and endpoint security SaaS that protects endpoints against security threats. Gorilla Technology Group Inc. was incorporated in 2001 and is based in Taipei, Taiwan.","Gorilla Technology Group Inc. provides video intelligence, Internet of Things (IoT) security, and edge content management hardware, software, and services in the Asia Pacific region. The company operates through three segments: Video IoT, Security Convergence, and Other segments. It offers intelligent video analytics AI models for various verticals, such as behavioral analytics, people/face recognition, vehicle analysis, object recognition, and business intelligence that can scan video for patterns and distinguish specific items using AI algorithms and metadata. The company also provides information technology (IT) and operational technology (OT) security convergence AI algorithms for system administrators and security engineers to detect suspicious behaviors in real time; network anomaly detection AI models; and endpoint malware and suspicious behavior detection AI models. In addition, it offers intelligent video analytics (IVA) appliances to analyze and turn unstructured video and picture data into structured data; IVAR appliance that provides insight into business and operations in a statistic dashboard; smart attendance to track employee health and safety, work hours, clock-ins/outs, and absenteeism, as well as to protect company assets and intellectual properties; event and video management system appliances to store event/object attributes in temporal-spatial big data database from Gorilla; and operation technology security appliance to monitor and control physical devices, processes, and infrastructure, as well as to protect industrial systems and networks from various threats. Further, the company provides smart retail SaaS for shopper demographics, visualized shopper behavior, and advanced data analytics, smart city and transportation SaaS for traffic management, public safety, and planning data; and endpoint security SaaS that protects endpoints against security threats. Gorilla Technology Group Inc. is headquartered in London, the United Kingdom.","GUD Holdings Limited, through its subsidiaries, engages in the manufacture and importation, distribution, and sale of automotive products, pumps, pool and spa systems, and water pressure systems in Australia, New Zealand, Thailand, South Korea, France, and the United States. It operates through Automotive, Auto Pacific Group, and Davey segments. The Automotive segment offers automotive and heavy-duty filters for cars, trucks, and agricultural and mining equipment; and fuel pumps and associated products for the automotive after-market. The Auto Pacific Group segment manufactures and markets towing, trailering, functional accessories, and associated products for the automotive aftermarket and original equipment manufacturer customers. The Davey segment provides pumps and pressure systems for household and farm water; water transfer pumps; swimming pool products; spa bath controllers; and pumps and water purification equipment. The company was incorporated in 1958 and is based in Altona North, Australia.","Gurit Holding AG, together with its subsidiaries, develops, manufactures, and sells advanced composite materials, composite tooling equipment, and kitting services in Switzerland and internationally. The company operates through Manufacturing Solutions, Kitting, Composite Materials, and Aerospace segments. It offers pre-impregnated materials, structural core products, adhesives, and liquid and filled systems. The company also provides reinforcements; ancillaries products; PRIME infusion systems for single-operation moulding of carbon yacht masts; filling and fairing solutions, including S-Fill 15 and 600 minute epoxy filler system; multi-purpose epoxy systems; tooling products, such as tooling pastes, gelcoats, laminating systems, and infusion resins; coating products; natural flax fibre products; and B\u00b3 SmartPac, a construction solution that enables builders to manufacture composite components, as well as Hi-Panels, which are epoxy infused composite panels. In addition, it offers ancillary products, including filler powders, hollow spheres, short fibres, flow modifiers, solvents, pigments, and pumps and dispense equipment, application and processing items and pigments. Further, the company provides composite engineering, contact tooling, manufacturing, and technical services. It serves the wind, aerospace, automotive, marine, industrial, rail, and building and construction industries. The company was founded in 1835 and is headquartered in Wattwil, Switzerland.","Hamilton Beach Brands Holding Company, together with its subsidiaries, designs, markets, and distributes small electric household and specialty housewares appliances in the United States and internationally. It offers air fryers, blenders, food processors, coffee makers, indoor electric grills, irons, juicers, mixers, slow cookers, toasters, and toaster ovens. The company also provides air purifiers under the TrueAir brand; consumer products under the Hamilton Beach and Proctor Silex brands; commercial products for restaurants, fast food chains, bars, and hotels under the Hamilton Beach Commercial and Proctor Silex Commercial brands; and personal care products under the Brightline brand, as well as products under the Hamilton Beach Professional in the premium market. In addition, it offers countertop appliances under the Wolf Gourmet brand; garment care products under CHI brand; farm-to-table and field-to-table food processing equipment under the Weston brand; cocktail delivery system under the Bartesian brand; and supplies private label products. The company sells its products through a network of mass merchandisers, e-commerce retailers, national department stores, variety store and drug store chains, specialty home retailers, distributors, restaurants, bars, hotels, and other retail outlets. Hamilton Beach Brands Holding Company was founded in 1904 and is headquartered in Glen Allen, Virginia.","Healius Limited provides specialty diagnostic services to consumer and practitioners in Australia. The company operates through four segments: Pathology, Imaging, Day Hospitals, and Others. It offers diagnostic imaging services, private medical laboratory, and pathology services. It also provides cataract surgery, colonoscopy, gastroscopy, plastic and cosmetic surgery, skin cancer removal, IVF egg collection, and gynaecological surgery services under the Laverty Pathology, Dorevitch Pathology, QML Pathology, Western Diagnostic Pathology, Genomic Diagnostic, Vetpath Laboratory, Vetnostics, QML Vetnostics, TML Vetnostics, ASAP Laboratory, Abbott Pathology, TML Pathology, IQ, Pathology, Kossard, Gastrolab, and Agilex Biolabs; Lumus Imaging; and Montserrat brands. It operates 2,105 pathology sites; 11 day hospital sites; and 134 imaging sites. The company was formerly known as Primary Health Care Limited and changed its name to Healius Limited in December 2018. Healius Limited was incorporated in 1994 and is based in Sydney, Australia.","Hansen Technologies Limited develops, integrates, and supports billing systems software for the energy and utilities, and communications and media sectors. It provides Create-Deliver-Engage suite, a set of software applications; and consulting services related to billing systems, as well as sells billing applications. The company also offers various professional services in relation to customer billing systems and IT outsourced services covering facilities management, systems and operations support, network services, and business continuity support; license, support, and maintenance services; and sells hardware and software. In addition, it provides software products services, such as architecture consulting, solution delivery, systems integration, managed, software learning and training, and product support services; cloud and hosting services; and data protection and disaster recovery services. The company operates in Australia, New Zealand, Asia, North America, Central America, Latin America, Europe, the Middle East, and Africa. Hansen Technologies Limited was founded in 1971 and is headquartered in Melbourne, Australia.","Hywin Holdings Ltd., through its subsidiaries, provides wealth management, insurance brokerage, and asset management service in China. It distributes private market investment products comprising asset-backed products, such as real estate securitization products, and equity investments in real estate projects or private project companies; venture capital, private equity, and hedge funds; and supply chain financing products, cash management products, and funds managed by its subsidiaries. The company also offers public market investment products, including money market funds, such as government bonds, central bank bills, term deposits, certificates of deposits, and corporate commercial papers; government bonds, corporate bonds, convertible bonds, and other traded debt instruments; and equities and multi-strategy funds. In addition, it provides individual whole life insurance, individual term life insurance, universal life insurance, individual health insurance, and annuity insurance products, as well as critical illness insurance comprising personal accident insurance products; discretionary and advisory mandates to ultra-high-net-worth clients; and overseas property investment services for residential properties, as well as client referrals to overseas property developers. Further, the company manages and distributes a range of private funds to professional investors; and offers information technology services, including transaction process management, data analysis, and system maintenance services to asset management service and financial product providers. The company was founded in 2006 and is headquartered in Shanghai, China. Hywin Holdings Ltd. is a subsidiary of Grand Lead Group Limited.","ICL Group Ltd, together with its subsidiaries, operates as a specialty minerals and chemicals company worldwide. It operates in four segments: Industrial Products, Potash, Phosphate Solutions, and Innovative Ag Solutions (IAS). The Industrial Products segment produces bromine out of a solution that is a by-product of the potash production process, as well as bromine-based compounds; produces various grades of potash, salt, magnesium chloride, and magnesia products; and produces and markets phosphorous-based flame retardants and other phosphorus-based products. The Potash segment extracts potash from the Dead Sea; mines and produces potash and salt; produces Polysulphate; produces, markets, and sells magnesium and magnesium alloys, as well as related by-products, including chlorine and sylvinite; and sells salt. The Phosphate Solutions segment uses phosphate commodity products to produce specialty products; produces and markets phosphate-based fertilizers, as well as sulphuric acid, green phosphoric acid, and phosphate fertilizers; and manufactures thermal phosphoric acid for various industrial end markets, such as oral care, cleaning products, paints and coatings, water treatment, asphalt modification, construction, and metal treatment. It also develops and produces functional food ingredients and phosphate additives for use in the processed meat, poultry, seafood, dairy, beverage, and baked goods markets; and produces milk and whey proteins for the food ingredients industry. The IAS segment develops, manufactures, markets, and sells fertilizers based primarily on nitrogen, potash, and phosphate, including water soluble specialty, liquid, soluble, and controlled-release fertilizers. It sells its products through marketing companies, agents, and distributors. The company was formerly known as Israel Chemicals Ltd. and changed its name to ICL Group Ltd in May 2020. The company was founded in 1968 and is headquartered in Tel Aviv, Israel.","IDFC Limited, together with its subsidiaries, engages in the investment activities in India. The company operates through Financing and Asset Management segments. It is also involved in the portfolio management, mutual fund, and other alternative funds activities; and provides investment banking and brokerage services. The company was formerly known as Infrastructure Development Finance Company Limited and changed its name to IDFC Limited in July 2012. IDFC Limited was incorporated in 1997 and is based in Mumbai, India.","IDP Education Limited engages in the placement of students into education institutions in Australia, the United Kingdom, the United States, Canada, New Zealand, and Ireland. Its services include counselling, application processing, pre-departure guidance, student placement and examinations, English language teaching, client relations, online student recruitment, and shared services. The company is also involved in the distribution and administration of International English Language Testing System tests for study, work, and migration purposes. In addition, it operates English language schools; and provides digital marketing and event services. IDP Education Limited was founded in 1969 and is headquartered in Docklands, Australia.","IGO Limited operates as an exploration and mining company that engages in discovering, developing, and operating assets focused on metals to enable clean energy in Australia. It owns and operates a 100% interest in the Nova nickel-copper-cobalt operation located to the east northeast of Norseman in the Great Western Woodlands of Western Australia; a 100% interest in the Cosmos nickel operation located to the north of Leinster in Western Australia; and a 100% interest in the Forrestania nickel operation located to the east of Perth in Western Australia. The company also focuses on investing in lithium mines, as well as holds 100% interest in the downstream processing refinery at Kwinana in Western Australia to produce battery grade lithium hydroxide. In addition, it owns and operates various projects, including Fraser Range, Kimberley, Paterson, Copper Coast, Frontier, Raptor, and Western Gawler projects. The company was formerly known as Independence Group NL and changed its name to IGO Limited in January 2020. IGO Limited was incorporated in 2000 and is headquartered in Perth, Australia.","Triple i Logistics Public Company Limited, together with its subsidiaries, provides domestic and international freight forwarding and integrated logistics services. It operates through Air Freight; Sea and In-Land Freight Logistics Management; Chemical and Hazardous Goods Logistics; and Other Management Services segments. The company offers air freight services, such as wholesale air freight, forwarding, general sales agency for airlines, and airport cargo terminal services; sea freight and inland transportation services, including shipping line agency, less than container load, and inland container transport services; logistics management, and warehouse and distribution services; and chemical and specialty logistics services, such as hazardous and dangerous goods logistics integrating, and dangerous goods packaging solutions. It also provides packaging services. In addition, the company offers office rental and other management services. Triple i Logistics Public Company Limited was incorporated in 2017 and is headquartered in Bangkok, Thailand.","Iluka Resources Limited engages in the exploration, project development, mining, processing, marketing, and rehabilitation of mineral sands. The company operates through Jacinth-Ambrosia/Mid West, Cataby/South West, Sierra Rutile, and United States/Murray Basin segments. It produces zircon; titanium dioxide products of rutile and synthetic rutile; and ilmenite, as well as activated carbon and iron concentrate products. The company also engages in the exploration of rare earths elements, such as monazite and xenotime. Its products are used in technology, construction, medical, lifestyle and industrial applications. It has operations in Australia, China, rest of Asia, Europe, the Americas, and internationally. The company was formerly known as Westralian Sands Limited and changed its name to Iluka Resources Limited in May 1999. Iluka Resources Limited was incorporated in 1954 and is headquartered in Perth, Australia.","Infosys Limited, together with its subsidiaries, provides consulting, technology, outsourcing, and next-generation digital services in North America, Europe, India, and internationally. It provides application development and management, independent validation, product engineering and management, infrastructure management, enterprise application management, and support and integration services. The company's products and platforms include Finacle, a core banking solution; Edge suite of products; Infosys Nia, an artificial intelligence platform; Infosys McCamish - an insurance platform; Wingspan, a customizable learning platform; Stater mortgage servicing platform; Panaya automation suite; and Skava, an e-commerce suite. The company serves clients in the financial services and insurance, life sciences and healthcare, manufacturing, retail, consumer packaged goods and logistics, hi-tech, communications, telecom OEM, media, energy, utilities, resources, services, and other industries. It has collaboration agreements with Rolls-Royce, BP plc, Newmont Corporation, RXR Realty, Majesco Limited, and Centre for Accessibility Australia; and a strategic partnership with The Economist Group Limited to enable and enhance sustainability solutions through a business-to-business model. The company was formerly known as Infosys Technologies Limited and changed its name to Infosys Limited in June 2011. Infosys Limited was incorporated in 1981 and is headquartered in Bengaluru, India.","Intellect Design Arena Limited provides software development and related services for banking, insurance, and other financial services in India and internationally. It offers platforms and products, such as iGTB, a suite of transaction banking solutions that includes digital transaction banking, trade and supply chain finance, liquid management, payment, and virtual account management solutions; iGCB, an end-to-end contextual banking suite for retail and corporate banking solution, which consists of digital core, digital lending, quantum core, and cards; iRTM, a risk, treasury, and capital markets platform that supports straight-through processing (STP) and various asset classes over a configurable and scalable platform; Intellect SEEC, an insurance solution; and Intellect WealthQube, a solution for wealth managers, private bankers, advisory firms, and financial advisors. Intellect Design Arena Limited was incorporated in 2011 and is based in Chennai, India.","Incitec Pivot Limited manufactures and distributes industrial explosives, industrial chemicals, and fertilizers in Australia, the United States, Canada, Turkey, and France. The company manufactures and distributes fertilizers, including di/mono-ammonium phosphate, ammonia, granulated ammonium sulphate, urea, and single super phosphate, as well as imports and sells fertilizers. It also manufactures and sells industrial explosives, such as ammonium nitrate and related products and services to the mining, quarrying, and construction industries; and manufactures, imports, and sells industrial chemicals to the agriculture and specialist industries. The company was founded in 1831 and is headquartered in Southbank, Australia.","\u00cdslandsbanki hf., together with its subsidiaries, provides commercial banking products and services to the retail and corporate sectors in Iceland. The company provides personal banking services comprising online banking, online chat, personal advisory, digital and personalized services to retail customers. It also offers business banking products and services to small and medium-sized enterprises, and asset financing services under the Ergo brand. In addition, the company provides corporate and investment banking services consisting of financial and investment banking services to large companies, pension and investment funds, institutional investors, and high net worth individuals. Further, the company offers securities and foreign currency, investment advice, corporate finance, lending, and private banking services. The company was founded in 1905 and is headquartered in K\u00f3pavogur, Iceland.","Icelandic Salmon AS engages in processing, production, and sale of seafood and seafood-based products. The company is involved in the salmon farming activities. It distributes its products worldwide. The company was formerly known as Arnarlax AS and changed its name to Icelandic Salmon AS in October 2020. Icelandic Salmon AS was founded in 2009 and is headquartered in Kverva, Norway. Icelandic Salmon AS is a subsidiary of SalMar ASA.","Frasers Centrepoint Trust (\u0093FCT\u0094) is a leading developer-sponsored retail real estate investment trust (\u0093REIT\u0094) and one of the largest suburban retail mall owners in Singapore with total assets of approximately S$6.7 billion. FCT's current property portfolio comprises 11 retail malls9 and an office building located in the suburban regions of Singapore, near homes and within minutes to transportation amenities. The retail portfolio has over 2.3 million square feet of net lettable area with over 1,500 leases with a strong focus on providing for necessity spending, food &amp; beverage and essential services. The portfolio comprises Causeway Point, Northpoint City North Wing (including Yishun 10 Retail Podium), Anchorpoint, YewTee Point, Changi City Point, Waterway Point (40%-interest), Tiong Bahru Plaza, White Sands, Hougang Mall, Century Square and Tampines 1) and an office property (Central Plaza). FCT's malls enjoy stable and recurring shopper footfall supported by commuter traffic and residential population in the catchment. FCT also holds a 31.15% stake in Hektar Real Estate Investment Trust, a retail-focused REIT in Malaysia listed on the Main Market of Bursa Malaysia Securities Berhad. FCT is index constituent of several benchmark indices including the FTSE EPRA/NAREIT Global Real Estate Index Series (Global Developed Index), FTSE ST Real Estate investment Trust Index, MSCI Singapore Small Cap Index and the SGX iEdge S-REIT Leaders Index. Listed on the Main Board of the Singapore Exchange Securities Trading Limited since 5 July 2006, FCT is managed by Frasers Centrepoint Asset Management Ltd., a real estate management company and a wholly-owned subsidiary of Frasers Property Limited.","JB Hi-Fi Limited, together with its subsidiaries, retails home consumer products. The company operates through three segments: JB Hi-Fi Australia, JB Hi-Fi New Zealand, and The Good Guys. It provides computers, such as laptops, desktop PCs, iPads, tablets, eBook readers, monitors and projectors, printers and ink, storage devices, keyboards and mouse, computer accessories, as well as software, and home internet and wi-fi products; televisions; headphones, speakers, and audio devices; and smart home appliances. The company also offers mobile phones; gaming devices, such as Xbox, Nintendo, PlayStation, and PC and retro gaming devices; music and vinyl products; movies and TV shows; and collectibles and merchandise, including apparel, card and board games, and jigsaw puzzles. In addition, it provides content creator gears for vloggers and influences, game streamers, podcasters, and music producers and DJs; cameras; drones and e-scooters; and fitness, health, and wellbeing products, such as smart watches, fitness trackers, massagers, health monitors, air treatment devices, sleep solutions, smart drink bottles, as well as shavers and trimmers, and hair and oral care products. Further, the company offers home appliances consisting of washers and dryers, fridges and freezers, dishwashers, vacuuming and cleaning products, small kitchen appliances, microwaves, coffee and beverages machines and accessories, and heating, cooling, and air treatment products. Additionally, it provides information technology and consulting services. As of June 30, 2022, the company sold its products through branded retail store network comprising 199 JB Hi-Fi/JB Hi-Fi Home stores in Australia; 14 JB Hi-Fi stores in New Zealand; and 106 The Good Guys stores in Australia, as well as online. JB Hi-Fi Limited was founded in 1974 and is based in Southbank, Australia.","Kajaria Ceramics Limited manufactures and sells ceramic and vitrified tiles under the Kajaria, Kerovit, and Eternity brands in India. The company's products include ceramic wall and floor tiles, polished vitrified tiles, glazed vitrified tiles, sanitary ware and faucets, and plywood and laminates, as well as tile adhesives, epoxy and unsanded grout, and tiles cleaner. It also exports its products to approximately 35 countries. The company was incorporated in 1985 and is headquartered in New Delhi, India.","KCE Electronics Public Company Limited, together with its subsidiaries, manufactures and distributes electric printed circuit boards (PCBs) under the KCE trademark worldwide. It operates through three segments: Manufacturing and Distributing of Prepreg and Laminate, Manufacturing and Distributing of Printed Circuit Board, and Manufacturing and Distributing of Chemical. The company's PCBs are manufactured from copper clad laminate that are used in various applications, including automotive, industrial, computer, and telecom systems. It also manufactures and distributes chemicals products, and prepreg and laminate products, as well as engages in the rental of buildings. The company was formerly known as Kuang Charoen Electronics Company Limited. KCE Electronics Public Company Limited was founded in 1982 and is based in Bangkok, Thailand.","Koppers Holdings Inc. provides treated wood products, wood preservation chemicals, and carbon compounds in the United States, Australasia, Europe, and internationally. The company operates through three segments: Railroad and Utility Products and Services (RUPS), Performance Chemicals (PC), and Carbon Materials and Chemicals (CMC). The RUPS segment procures and treats crossties, switch ties, and various types of lumber used for railroad bridges and crossings. It also provides rail joint bars to join rails together for railroads; transmission and distribution poles for electric and telephone utilities; and pilings. This segment also provides railroad services, such as engineering, design, repair, and inspection services for railroad bridges. The PC segment develops, manufactures, and markets copper-based wood preservatives, including micronized copper azole, micronized pigments, alkaline copper quaternary, amine copper azole, and chromated copper arsenate for decking, fencing, utility poles, construction lumber and timbers, and various agricultural uses; and supplies fire-retardant chemicals for pressure treatment of wood primarily in commercial construction. The CMC segment manufactures creosote for the treatment of wood or as a feedstock in the production of carbon black; carbon pitch, a raw material used in the production of aluminum and steel; naphthalene for use as a feedstock in the production of phthalic anhydride and as a surfactant in the production of concrete; phthalic anhydride for the production of plasticizers, polyester resins, and alkyd paints; and carbon black feedstock for use in the production of carbon black. The company serves the railroad, specialty chemical, utility, residential lumber, agriculture, aluminum, steel, rubber, and construction industries. Koppers Holdings Inc. was founded in 1988 and is headquartered in Pittsburgh, Pennsylvania.","Kriti Nutrients Limited engages in the manufacture and sale of soyabean seeds under the Kriti brand in India and internationally. It offers edible oils, such as refined sunflower oil, soya bean oil, filtered groundnut oil, and mustard oil; soya lecithin; protein-based nuggets/TVP, full fat soya flour, defatted flakes/ grits/ flour toasted, defatted flakes/ grits/ flour untoasted, super HyPro SBM, and soya hulls; and acid oil and fatty acids. The company serves food, pharmaceutical, aquaculture and poultry, and dairy industries. It also exports its products. The company was founded in 1992 and is based in Indore, India. Kriti Nutrients Limited is a subsidiary of Sakam Trading Private Limited.","Founded in 1997, Gladstone Land is a publicly traded real estate investment trust that acquires and owns farmland and farm-related properties located in major agricultural markets in the U.S. and leases its properties to unrelated third-party farmers. The Company, which reports the aggregate fair value of its farmland holdings on a quarterly basis, currently owns 127 farms, comprised of approximately 94,000 acres in 13 different states, valued at approximately $1.0 billion. Gladstone Land's farms are predominantly located in regions where its tenants are able to grow fresh produce annual row crops, such as berries and vegetables, which are generally planted and harvested annually. The Company also owns farms growing permanent crops, such as almonds, apples, figs, olives, pistachios, and other orchards, as well as blueberry groves and vineyards, which are generally planted every 10 to 20-plus years and harvested annually. The Company may also acquire property related to farming, such as cooling facilities, processing buildings, packaging facilities, and distribution centers. The Company pays monthly distributions to its stockholders and has paid 93 consecutive monthly cash distributions on its common stock since its initial public offering in January 2013. The Company has increased its common distributions 20 times over the prior 23 quarters, and the current per-share distribution on its common stock is $0.0449 per month, or $0.5388 per year.","Land and Houses Public Company Limited engages in the property development activities in Thailand and the United States. It operates in two segments, Real Estate Business, and Rental and Service Business. The company's Real Estate Business segment develops and sells single detached houses, townhouses, and residence condominium projects. Its Rental and Service Business segment is involved in the rental of shopping malls, hotels, and apartments. The company also offers project administration and management, and investment advisory services. Land and Houses Public Company Limited was founded in 1973 and is headquartered in Bangkok, Thailand.","Linc Limited manufactures and markets writing instruments and stationery products in India and internationally. The company offers gel, ball, roller, retractable ball, and fountain pens; markers/hi-lighters; stationery, including pencils, geometry boxes, printed pencils, erasers, mechanical pencils, and files and folders; and disinfectants under the Linc brand. It also imports and distributes stationery products. The company was formerly known as Linc Pen &amp; Plastics Limited and changed its name to Linc Limited in October 2021. Linc Limited was founded in 1976 and is headquartered in Kolkata, India.","Lojas Quero-Quero S.A. engages in the general retail trade activities in Brazil. It offers building materials, household appliances, and furniture. The company also provides credit card, extended warranties, and financial services. As of December 31, 2021, it operated approximately 465 stores in 377 cities. The company was founded in 1967 and is headquartered in Cachoeirinha, Brazil.","Loomis AB (publ) provides solutions for the distribution, handling, storage, and recycling of cash and other valuables in Sweden and internationally. The company offers a range of solutions for cash in transit, cash management services, physical foreign currency, ATMs, and international valuables logistics, as well as operates Loomis Pay, an end-to-end payment platform for merchants. It serves banks, retailers, and other operators. As of February 3, 2022, the company operated through a network of approximately 400 branches. Loomis AB (publ) was founded in 1852 and is headquartered in Stockholm, Sweden.","The Liberty SiriusXM Group, through its subsidiaries, engages in the entertainment business in the United States and Canada. It features music, sports, entertainment, comedy, talk, news, traffic, weather channels, podcast, and infotainment services through proprietary satellite radio systems, as well as streamed through applications for mobile and home devices, and other consumer electronic equipment. It also offers connected vehicle services; a suite of data services that include graphical weather, fuel prices, sports schedules and scores, and movie listings; and traffic information services, which provide information as to road closings, traffic flow and incident data to consumers with compatible in-vehicle navigation systems, and real-time weather services in vehicles, boats, and planes. In addition, the company operates a music, comedy, and podcast streaming platform. Further, it offers ad-supported radio services; Pandora Plus, a radio subscription service; and Pandora Premium, an on-demand subscription service. Additionally, the company distributes satellite radios through automakers and retailers, as well as through its website. As of December 31, 2021, it served approximately 34.0 million subscribers through Sirius XM and approximately 6.4 million subscribers through Pandora. The Liberty SiriusXM Group is headquartered in Englewood, Colorado. The Liberty SiriusXM Group is a subsidiary of Liberty Media Corporation.","LTIMindtree Limited, a technology consulting and digital solutions company, provides information technology services and solutions in India, North America, Europe, and internationally. The company operates through Banking, Financial Services &amp; Insurance; Hi-Tech, Media &amp; Entertainment; Manufacturing &amp; Resources; Retail, CPG &amp; Travel, Transport &amp; Hospitality; and Health &amp; Public Services. It offers cloud and infrastructure services, consulting, cyber security, data and insights, digital engineering, disruptive SaaS, enterprise application, platform operation, RPA, and testing services. The company serves various industries, such as banking and financial services, energy, utilities, healthcare, Hi-tech, insurance, life sciences, manufacturing, retail and consumer packaged goods, travel, transport, and hospitality, as well as communications, media, and entertainment industries. LTIMindtree Limited has a strategic collaboration agreement with Amazon Web Services, Inc.; a strategic partnership with eClinicalHealth Limited to enhance digital innovation in clinical trials management process for patient centric drug development; and a strategic collaboration with CAST AI to help businesses optimize their cloud investments. The company was formerly known as Larsen &amp; Toubro Infotech Limited and changed its name to LTIMindtree Limited in November 2022. The company was incorporated in 1996 and is based in Mumbai, India. LTIMindtree Limited operates as a subsidiary of Larsen &amp; Toubro Limited.","LexinFintech Holdings Ltd., through its subsidiaries, offers online consumer finance services in the People's Republic of China. The company operates Fenqile.com, an online consumption and consumer finance platform that offers installment purchase and personal installment loans, as well as provides online direct sales with installment payment terms; and Le Hua Card, a scenario-based lending. It also provides technology-driven platform services to increase revenues, manage financial risks, enhance operat
