ing efficiency and service quality, enhance collections, and reduce overall costs; Maiya application, a location-based services shopping experience with buy-now and pay-later options; and Juzi Licai, an online investment platform. In addition, the company offers technical support and consulting, software development, financing guarantee, and financial technology services. The company was formerly known as Staging Finance Holding Ltd. and changed its name to LexinFintech Holdings Ltd. in March 2017. LexinFintech Holdings Ltd. was incorporated in 2013 and is headquartered in Shenzhen, the People's Republic of China.","Vedant Fashions Limited engages in manufacture and trading of wedding and celebration wear in India and internationally. The company's products include men's ethnic and celebration wear items, such as Indo-western, sherwanis, and kurtas; jackets and accessories; women's ethnic and celebration wear items consisting of lehengas, sarees, stitched suits, and kurtis; and lehengas, gowns, frocks, kurtas, suits and accessories for kids. It offers its products under the Manyavar, Twamev, Manthan, Mohey and Mebaz brands. It sells its products through a network of franchise-owned exclusive brand outlets, multi-brand outlets, and large format stores; and online platforms, including its website, www.manyavar.com and mobile application. The company was incorporated in 2002 and is headquartered in Kolkata, India.","Mattel, Inc., a children's entertainment company, designs and produces toys and consumer products worldwide. The company operates through North America, International, and American Girl segments. It offers dolls and accessories, as well as content, gaming, and lifestyle products for children under the Barbie, Monster High, American Girl, Polly Pocket, Spirit, and Enchantimals brands; dolls and books under the American Girl brand name; die-cast vehicles, tracks, playsets, and accessories for kids of all ages, and collectors under the Hot Wheels, Monster Trucks, Matchbox, CARS, and Mario Kart brand names; and infant, toddler, and preschool products comprising content, toys, live events, and other lifestyle products under the Fisher-Price and Thomas &amp; Friends, Power wheels, and Fireman Sam brands. The company also provides action figures, building sets, and games under the Masters of the Universe, MEGA, UNO, Lightyear, Jurassic World, WWE, and Star Wars brands; and licensor partner brands, including Disney, NBCUniversal, WWE, Microsoft, Nickelodeon, Warner Bros, and Sanrio. It sells its products directly to consumers through its catalog, website, and proprietary retail stores; retailers, including discount and free-standing toy stores, chain stores, department stores, and other retail outlets; and wholesalers, as well as through agents and distributors. Mattel, Inc. was founded in 1945 and is headquartered in El Segundo, California.","MCOT Public Company Limited, together with its subsidiaries, engages in the mass media business in Thailand. It operates through Television business, Radio broadcasting business, Digital terrestrial television broadcasting business, and Digital and new businesses segments. The company provides digital terrestrial television (TV) broadcasting network services, including a high definition variety and standard definition family channels with programs comprising news and situation report, entertainment, edutainment, general knowledge, and sports; and engages in the production, marketing, and management of broadcasting various informative and entertaining radio programs through a network of 62 central and regional radio stations broadcasting in FM and AM frequencies in the areas of politics, economy, society, foreign affairs, technology, life balance, music, sports, tourism, health and recreation activities, and news reports, as well as public and local interest programs. It is also involved in the production, gathering, storage, and dissemination of news and information through various media platforms, including Modernine Television Station, 9 MCOT HD Channel 30, and radio station network, as well as electronic media comprising website, social media, cooperation, and news exchange with foreign news agencies and other media channels. In addition, the company offers satellite TV rental services; television network services; digital media services through the internet and other platforms; and operates academic and training institute that provides a range of mass media training courses. MCOT Public Company Limited was founded in 1977 and is headquartered in Bangkok, Thailand.","Mount Gibson Iron Limited, together with its subsidiaries, engages in the mining, crushing, processing, transportation, and sale of hematite iron ore in Australia. The company primarily holds interests in the Extension Hill mine and Shine mine deposit in the Mid-West region of Western Australia, as well as operates haulage of the ore through road and rail for export from the Geraldton Port. It is also involved in the mining and direct shipment of hematite iron ore at the Koolan Island mine site in the Kimberley region of Western Australia; and the treasury management activities. Mount Gibson Iron Limited was incorporated in 1938 and is headquartered in West Perth, Australia.","Hello Group Inc. provides mobile-based social and entertainment services in the People's Republic of China. It operates Momo platform that includes its Momo mobile application, as well as various related properties, features, functionalities, tools, and services. The company's Momo mobile application connects people and facilitates interactions based on location and interests; and various recreational activities, including live talent shows, short videos, and social games, as well as other video- and audio-based interactive experiences, such as online parties, mobile karaoke, and user participated reality shows. It also operates Tantan, a social and dating application, which enables users to find and establish romantic connections, and meet interesting people; and provides live video, quick chat, value-added, mobile marketing, and other services, as well as mobile games and audio chatrooms. In addition, it allows its platform's users to livestream a variety of content and activities that comprise talent shows, such as singing, dancing, and talk shows, as well as casual chatting, and other forms of interactions between broadcasters and viewers. The company was formerly known as Momo Inc. and changed its name to Hello Group Inc. in August 2021. Hello Group Inc. was incorporated in 2011 and is headquartered in Beijing, the People's Republic of China.","Moshi Moshi Retail Corporation Public Company Limited engages in the retail and wholesale of lifestyle products in Thailand. It sells home furnishings, bags, pens, pencils, notebooks, stickers, rulers, folders, plush toys, fashion items, t-shirts, long sleeves, shorts, pajamas, beauty accessories, hats, scarves, sunglasses, shoes, perfumes, hand creams, and body lotions. The company also offers IT equipment, bluetooth speakers, headphones, mobile phone chargers, toys, food and drink products, cloth masks, keychains, eyebrow pencils, lipsticks, candies, COVID-19 testing kits, rugs, picture frames, and artificial plants. In addition, the company sells its products online. The company was founded in 2000 and is based in Bangkok, Thailand.","Motilal Oswal Financial Services Limited offers financial services in India. It operates through Broking and Other Related Activities, Fund Based Activities, Asset Management and Advisory, Investment Banking Services, and Home Finance segments. The company offers broking and distribution services, such as equities, derivatives, commodities, currencies, mutual funds, insurance products, and other investment products; primary equity offerings; and depository, portfolio management, and asset management services. It also provides private wealth management services, such as equity, alternate, credit solutions, estate planning, will making, and property advisory services; and home loans. In addition, the company offers institutional broking services, including cash and derivatives; private equity services; and investment banking advisory and transaction solutions, including private placement of equity, mergers and acquisitions advisory, and equity capital markets transactions. It serves high net worth individuals; and mutual funds, foreign institutional investors, financial institutions, and corporate clients. Motilal Oswal Financial Services Limited was founded in 1987 and is headquartered in Mumbai, India. Motilal Oswal Financial Services Limited operates as a subsidiary of Passionate Investment Management Private Limited.","Motorcar Parts of America, Inc. manufactures, remanufactures, and distributes heavy-duty truck, industrial, marine, and agricultural application replacement parts. The company offers rotating electrical products, including alternators and starters; wheel hub assemblies and bearings; and brake-related products comprising brake calipers, brake boosters, brake rotors, brake pads, and brake master cylinders. It also offers test solutions and diagnostic equipment for electric vehicle powertrain development and manufacturing, including electric motor test systems, e-axle test systems, advanced power emulators, and charging unit test systems, as well as test systems for alternators, starters, belt starter generator, and bench-top testers, as well as turbochargers and test services for electric vehicle inverters. The company sells its products to automotive retail chain stores and warehouse distributors, as well as various automobile manufacturers for their aftermarket programs and warranty replacement programs in North America. Motorcar Parts of America, Inc. was founded in 1968 and is headquartered in Torrance, California.","Mphasis Limited operates as an information technology solutions provider that specializes in cloud and cognitive services worldwide. The company operates through Banking and Financial Service; Logistics and transportation; Technology Media and Telecom; Insurance; and Others segments. It offers application, blockchain, business process, cognitive, cyber security, DevOps, digital, enterprise automation, design, infrastructure, modernization, data, product engineering, and cloud, as well as governance, risk, and compliance services. The company serves banking and capital markets, asset management, corporate banking, investment banking, mortgage, retail banking, and wealth management and brokerage industries, as well as insurance, healthcare and life sciences, payments, hospitality, travel and transportation, communications, energy and utilities, logistics, manufacturing, oil and gas, and public sectors. Mphasis Limited was incorporated in 1992 and is based in Bengaluru, India.","Metro Systems Corporation Public Company Limited, together with its subsidiaries, engages in trading computers and equipment, software, supplies, and office equipment, as well as provision of related services in Thailand. The company provides server, storage, and network for IT infrastructure; backup, modernized application, and IBM i solutions for infrastructure; hardware, contractual, supplies, and outsourcing printing and services solutions for digital printing; and compute, network, storage, HCI, private, hybrid, public cloud, middleware and other, database, API, and backup and DR, as well as operating systems for digital infrastructure. It also offers businesses transformation, architecture design, application development, and infrastructure and managed service for digital transformation services; workforce and unified collaboration, mobility workforce, business process automation, and IT process management for digital collaboration; and SOLIDWORKS 3D CAD, simulation, electrical design, SOLIDWORKS product data management, and technical communication for designed and engineering solutions. In addition, the company provides data integration tools, data platform, BI and data visualization, advance analytics and AI/ML, and data scientist platform for data and analysis. Further, it offers end point, network, server and data, cloud, and mobility security solutions; and training and services. Additionally, the company provides office supplies, as well as engages in the sale, and maintenance and services of computer and computer programs. Metro Systems Corporation Public Company Limited was founded in 1985 and is headquartered in Bangkok, Thailand.","MSC Industrial Direct Co., Inc., together with its subsidiaries, distributes metalworking and maintenance, repair, and operations (MRO) products and services in the United States, Canada, Mexico, and the United Kingdom. Its MRO products include cutting tools, measuring instruments, tooling components, metalworking products, fasteners, flat stock products, raw materials, abrasives, machinery hand and power tools, safety and janitorial supplies, plumbing supplies, materials handling products, power transmission components, and electrical supplies. The company offers approximately 1.9 million stock-keeping units through its catalogs and brochures; e-commerce channels, including its Website, mscdirect.com; inventory management solutions; and call-centers and branches. It operates through a distribution network of 28 branch offices, 11 customer fulfilment centers, and seven regional inventory centers. The company serves individual machine shops, Fortune 1000 manufacturing companies, and government agencies, as well as manufacturers of various sizes. MSC Industrial Direct Co., Inc. was founded in 1941 and is headquartered in Melville, New York.","Mt Monger Resources Limited, through its subsidiaries, engages in the exploration of mineral tenements in Western Australia. It explores for gold, base metals, lithium, nickel, cobalt, graphite, and rare earth elements. The company holds interests in the Mt Monger Gold project that comprises six granted exploration licenses, two pending exploration licenses, and three granted prospecting licenses covering an area of approximately 100 square kilometers; and the East Laverton Gold Project that consists of twelve exploration licenses covering an area of approximately 3,000 square kilometers located in Western Australia. It also holds interests in the Ravensthorpe project tenements comprising eleven granted exploration licenses and one exploration license application covering an area of approximately 1,500 square kilometers located within the Albany-Fraser Orogen of Western Australia. In addition, the company holds an option agreement to explore and acquire a 100% interest in the Albion gold project that comprises a total area of 4 graticular blocks located near Norseman in Western Australia. Mt Monger Resources Limited was incorporated in 2020 and is based in West Perth, Australia.","Multiplan Empreendimentos Imobili\u00e1rios S.A. engages in the planning, development, construction, and sale of real estate projects in Brazil. The company develops residential or commercial properties, including urban shopping malls. It is also involved in the purchase and sale of real estate properties, as well as acquisition and disposal of real estate rights, and its operation through leasing. In addition, the company provides management and administrative services for own or third party shopping malls; technical advisory and support services concerning real estate matters; and civil construction, construction works execution, and engineering and related services. Further, it engages in the planning, development, management, promotion, and intermediation of real estate projects; import and export of goods and services related to its activities; generation and sale of electric power; and acquisition of ownership interests and share control in other entities. The company was founded in 1974 and is based in Rio de Janeiro, Brazil.","NFC Public Company Limited, together with its subsidiaries, engages in the sale of chemical products and other chemical related services in Thailand. The company produces and sells ammonia, ammonium hydroxide, and sulfuric acid. It also offers wharf frontage, warehousing, logistics and liquid storage, yard, and port services. The company was formerly known as NFC Fertilizer Public Company Limited and changed its name to NFC Public Company Limited in June 2017. NFC Public Company Limited was incorporated in 1982 and is headquartered in Bangkok, Thailand.","NGL Energy Partners LP engages in the transportation, storage, blending, and marketing of crude oil, natural gas liquids, refined products / renewables, and water solutions. The company operates in three segments: Water Solutions, Crude Oil Logistics, and Liquids Logistics. The Water Solutions segment transports, treats, recycles, and disposes produced and flowback water generated from oil and natural gas production; aggregates and sells recovered crude oil; disposes solids, such as tank bottoms, and drilling fluid and muds, as well as performs truck and frac tank washouts; and sells produced water for reuse and recycle, and brackish non-potable water. The Crude Oil Logistics segment purchases crude oil from producers and marketers, and transports it to refineries for resale at pipeline injection stations, storage terminals, barge loading facilities, rail facilities, refineries, and other trade hubs; and provides storage, terminaling, and transportation services through pipelines. The Liquids Logistics segment supplies natural gas liquids, refined petroleum products, and biodiesel to commercial, retail, and industrial customers in the United States and Canada through its 24 terminals, third-party storage and terminal facilities, and nine common carrier pipelines, as well as through fleet of leased railcars. This segment is also involved in the marine export of butane through its facility located in Chesapeake, Virginia. NGL Energy Holdings LLC serves as the general partner of the company. The company was founded in 1940 and is headquartered in Tulsa, Oklahoma.","Noble Development Public Company Limited, together with its subsidiaries, develops and sells real estate properties in Thailand. The company offers construction, rental and service, and construction consulting services. Its properties comprise land plots, single detached houses, townhouses, and condominium units. In addition, the company provides project management and after housing delivery services. The company was founded in 1991 and is headquartered in Bangkok, Thailand.","NOV Inc. designs, constructs, manufactures, and sells systems, components, and products for oil and gas drilling and production, and industrial and renewable energy sectors worldwide. The company operates through three segments: Wellbore Technologies, Completion &amp; Production Solutions, and Rig Technologies. It also provides solids control and waste management equipment and services; portable power generation products; drill and wired pipes; drilling optimization and automation services; tubular inspection, repair, and coating services; instrumentation; measuring and monitoring services; downhole and fishing tools; steerable technologies; and drill bits. The company offers equipment and technologies for hydraulic fracture stimulation, including downhole multistage fracturing tools, pressure pumping trucks, blenders, sanders, hydration and injection units, flowline, and manifolds; coiled tubing units, and wireline units and tools; connections and liner hangers; onshore production consists of composite pipe, surface transfer and progressive cavity pumps, and artificial lift systems; and offshore production, such as floating production systems and subsea production technologies, as well as manufactures industrial pumps and mixers. It also provides substructures, derricks, and masts; cranes; jacking systems; pipe lifting, racking, rotating, and assembly systems; mud pumps; pressure control equipment; drives and generators; rig instrumentation and control systems; mooring, anchor, and deck handling machinery; equipment components for offshore wind construction vessels; and pipelay and construction systems. NOV Inc. offers spare parts, repair, and rentals as well as comprehensive remote equipment monitoring, technical support, field service, and customer training. The company was formerly known as National Oilwell Varco, Inc. and changed its name to NOV Inc. in January 2021. NOV Inc. was founded in 1862 and is based in Houston, Texas.","Nexus Minerals Limited engages in the exploration of mineral properties in Western Australia. It explores for gold and copper deposits. The company holds interests in the Wallbrook, Pinnacles, and Mt Celia gold projects located to the 22east of Kalgoorlie in the Eastern Goldfields; and Bethanga porphyry copper gold project tenements covering and area of approximately 194 square kilometers located in northeast Victoria. The company was formerly known as Hemisphere Resources Limited. Nexus Minerals Limited was incorporated in 2006 and is based in West Perth, Australia.","Nyesa Valores Corporaci\u00f3n, S.A., together with its subsidiaries, develops real estate projects in Spain and internationally. It purchases and sells plots, buildings, urban management, and lease heritage assets. The company also produces, transforms, and commercializes industrial products related to the construction sector. In addition, it operates hotel establishments and provides business consulting services. The company was formerly known as Industrias del Besos, S.A. and changed its name to Nyesa Valores Corporaci\u00f3n, S.A. in June 2010. Nyesa Valores Corporaci\u00f3n, S.A. was founded in 1950 and is headquartered in Madrid, Spain.","Far East Orchard Limited, an investment holding company, engages in the hotel operations and property investment activities in Singapore, Australia, New Zealand, the United Kingdom, and internationally. The company primarily develops residential, commercial, hospitality, and purpose-built student accommodation properties. It also owns and operates hospitality assets, including hotels. In addition, the company's investment portfolio includes offices at Tanglin Shopping Centre, as well as medical suites at Novena Medical Center and Novena Specialist Center. Further, it manages and leases properties. The company was formerly known as Orchard Parade Holdings Limited and changed its name to Far East Orchard Limited in July 2012. The company was incorporated in 1967 and is headquartered in Singapore. Far East Orchard Limited is a subsidiary of Far East Organization Pte. Ltd.","Oceania Healthcare Limited, together with its subsidiaries, owns and operates various retirement village and aged care centers in New Zealand. The company operates through three segments: Care Operations, Village Operations, and Other. It provides rest home, hospital, and dementia; independent living and rental properties for retirement villages; and provides support services, which includes administration, marketing, and operations. The company was formerly known as Retirement Care (NZ) Limited and changed its name to Oceania Healthcare Limited in September 2014. Oceania Healthcare Limited was incorporated in 2005 and is based in Auckland, New Zealand.","Omega Flex, Inc., together with its subsidiaries, manufactures and sells flexible metal hoses and accessories in North America and internationally. It offers flexible gas piping for use in residential and commercial buildings, as well as its fittings; and corrugated medical tubing for use in hospitals, ambulatory care centers, dental, physician and veterinary clinics, laboratories, and other facilities. The company sells its products under the TracPipe, CounterStrike, AutoSnap, AutoFlare, DoubleTrac, DEF-Trac, and MediTrac brand names. It serves various markets, including construction, manufacturing, transportation, petrochemical, pharmaceutical, and other industries. The company sells its products through independent sales representatives, distributors, original equipment manufacturers, and direct sales, as well as through its website. The company was formerly known as Tofle America, Inc. and changed its name to Omega Flex, Inc. in 1996. Omega Flex, Inc. was incorporated in 1975 and is based in Exton, Pennsylvania.","Omnicell, Inc., together with its subsidiaries, provides medication management solutions and adherence tools for healthcare systems and pharmacies the United States and internationally. The company offers point of care automation solutions to improve clinician workflows in patient care areas of the healthcare system; XT Series automated dispensing systems for medications and supplies used in nursing units and other clinical areas of the hospital, as well as specialized automated dispensing systems for operating room; Omnicell Interface Software that offers interface and integration between its medication-use products or supply products, and a healthcare facility's in-house information management systems; and robotic dispensing systems for handling the stocking and retrieval of boxed medications. It also provides central pharmacy automation solutions, including automated storage and retrieval systems, such as XR2 Automated Central Pharmacy System; IV compounding robots and workflow management systems; inventory management software; and controlled substance management systems. In addition, the company provides single-dose automation solutions that fill and label a variety of patient-specific, single-dose medication blister packaging based on incoming prescriptions; fully automated and semi-automated filling equipment for institutional pharmacies to warrant automated packaging of medications; and medication blister card packaging and packaging supplies to enhance medication adherence in non-acute care settings. Further, it offers EnlivenHealth Patient Engagement, a web-based nexus of solutions. The company was formerly known as Omnicell Technologies, Inc. and changed its name to Omnicell, Inc. in 2001. Omnicell, Inc. was incorporated in 1992 and is headquartered in Mountain View, California.","Patterson Companies, Inc. engages in distribution of dental and animal health products in the United States, the United Kingdom, and Canada. The company operates through three segments: Dental, Animal Health, and Corporate segments. The Dental segment offers consumable products, including infection control, restorative materials, and instruments; basic and advanced technology and dental equipment; practice optimization solutions, such as practice management software, e-commerce, revenue cycle management, patient engagement solutions, and clinical and patient education systems. It also provides a range of related services comprising software and design services, maintenance and repair, and equipment financing. The Animal Health segment distributes biologicals, pharmaceuticals, vaccines, parasiticides, diagnostics, prescription and non-prescription diets, nutritional's, consumable supplies, equipment, and software, as well as value-added services. This segment also provides private label portfolio of products to veterinarians, producers, and retailers under the Aspen, First Companion, and Patterson Veterinary brands. The Corporate segment offers customer financing services; and sells other miscellaneous products. It serves dentists, laboratories, institutions, other healthcare professionals, veterinarians, other animal health professionals, production animal operators, and animal health product retailers. The company was formerly known as Patterson Dental Company and changed its name to Patterson Companies, Inc. in June 2004. Patterson Companies, Inc. was founded in 1877 and is headquartered in Saint Paul, Minnesota.","Pantera Minerals Limited engages in the exploration and development of mineral properties in Australia. It explores for iron ore, copper, manganese, and polymetallic deposits. The company holds an 80% interest in the Yampi iron ore project comprising one granted exploration license and four exploration license applications covering an area of approximately 640 square kilometers (km2); and 100% interest in the Yampi copper, which comprises exploration license that covers an area of 17 km2 located in the Buccaneer Archipelago of the Kimberley Region of Western Australia. It also holds 100% interests in the Weelarrana manganese project comprising two granted exploration licenses that covers an area of approximately 242 km2 and four tenement applications that covers an area of 525 km2 located in the Ashburton region of Western Australia; 100% interest in the Frederick Polymetallic project that comprises one exploration license covering an area of approximately 88 km2 located in the Upper Gascoyne region of Western Australia; and 80% interest in the Hellcat project comprising four granted exploration licenses that covers an area of approximately 422 km2 and one exploration license application covering an area of 128 km2 located in the Mid-West region of Western Australia. The company was incorporated in 2020 and is based in West Perth, Australia.","Personal Group Holdings Plc provides short-term accident and health insurance services, SaaS products, and salary sacrifice technology products in the United Kingdom. The company operates through Affordable Insurance, Other Owned Benefits, Benefits and Platform, and Pay and Reward segments. It offers insurance products, including hospital plans, convalescence plans, and death benefit plans; and consultancy and software solutions on pay and reward services, as well as a suite of cloud-based Saas tools. The company also operates HAPI, a proprietary digital platform that allows employees to access financial, physical, mental, and social benefits; and Let's Connect, which enables employers to provide a benefit scheme that allows their employees to access consumer technology and other products from manufacturers through salary sacrifice. Personal Group Holdings Plc was founded in 1984 and is based in Milton Keynes, the United Kingdom.","Pinthong Industrial Park Public Company Limited develops and manages industrial estates and logistics parks. The company manages and develops real estate properties and factory buildings, as well as provides warehouses for rent. It serves in Japan, Thailand, China, and Taiwan. Pinthong Industrial Park Public Company Limited was founded in 1995 and is based in Chonburi, Thailand.","Planet Labs PBC designs, constructs, and launches constellations of satellites with the intent of providing high cadence geospatial data delivered to customers through an online platform worldwide. The company offers Open Geospatial Consortium, a cloud-native proprietary technology that performs critical processing and overall harmonizing of images for time series and data fusion and analysis; and space-based hardware and related software systems. It serves agriculture, mapping, forestry, and finance and insurance, as well as federal, state, and local government bodies. The company was incorporated in 2010 and is headquartered in San Francisco, California.","Plurilock Security Inc. operates an identity-centric cybersecurity company in the United States and Canada. It operates in two divisions, Technology and Solutions. The company offers Plurilock DEFEND, an enterprise continuous authentication platform that confirms user identity or alerts security teams to detected intrusions in real time; and Plurilock ADAPT, a standards-based login MFA platform, which provides added login security without relying on fingerprint scans, SMS codes, authenticator apps, hardware tokens, or other intrusive legacy MFA requirements. It also offers services and resells IT and cybersecurity industry products and technologies. The company serves financial services, healthcare, critical infrastructure, and government and military industries. Plurilock Security Inc. is headquartered in Vancouver, Canada.","Provident Financial Holdings, Inc. operates as the holding company for Provident Savings Bank, F.S.B. that provides community banking services to consumers and small to mid-sized businesses in the Inland Empire region of Southern California. Its deposit products include checking, savings, and money market accounts, as well as time deposits; and loan portfolio consists of single-family, multi-family, commercial real estate, construction, mortgage, commercial business, and consumer loans. The company also offers investment services comprising the sale of investment products, such as annuities and mutual funds; and trustee services for real estate transactions. It operates through 12 full-service banking offices in Riverside County and one full-service banking office in San Bernardino County. The company was founded in 1956 and is based in Riverside, California.","Public Storage, a member of the S&amp;P 500 and FT Global 500, is a REIT that primarily acquires, develops, owns and operates self-storage facilities. At September 30, 2020, we had: (i) interests in 2,504 self-storage facilities located in 38 states with approximately 171 million net rentable square feet in the United States, (ii) an approximate 35% common equity interest in Shurgard Self Storage SA (Euronext Brussels:SHUR) which owned 239 self-storage facilities located in seven Western European nations with approximately 13 million net rentable square feet operated under the \u0093Shurgard\u0094 brand and (iii) an approximate 42% common equity interest in PS Business Parks, Inc. (NYSE:PSB) which owned and operated approximately 28 million rentable square feet of commercial space at September 30, 2020. Our headquarters are located in Glendale, California.","Far East H-Trust is a Singapore-Focused Hotel and Serviced Residence Hospitality Trust listed on the Main Board of The Singapore Exchange Securities Trading Limited (\u0093SGX-ST\u0094). Comprising Far East Hospitality Real Estate Investment Trust (\u0093Far East H-REIT\u0094) and Far East Hospitality Business Trust (\u0093Far East H-BT\u0094), Far East H-Trust was listed on the SGX-ST on 27 August 2012 and has a portfolio of 13 properties totaling 3,143 hotel rooms and serviced residence units valued at approximately S$2.65 billion as at 31 December 2019. Managed by FEO Hospitality Asset Management Pte. Ltd. and FEO Hospitality Trust Management Pte. Ltd. (collectively, the \u0093Managers\u0094) and sponsored by members of Far East Organization Group (the \u0093Sponsor\u0094), Far East H-Trust seeks to provide Stapled Securityholders with regular, stable and growing distributions on a quarterly basis. Far East H-Trust is listed on the FTSE ST Mid Cap Index.","Quadient S.A. provides business solutions for customers through digital and physical channels in France and internationally. The company offers customer experience management, business process automation, mail-related solutions, and parcel locker solutions. It provides Quadient Inspire, a software solution that helps businesses design, manage, and send personalized, omnichannel communications in large volumes. The company also offers Quadient Impress, a multichannel outbound document management platform; YayPay, account receivable process automation solutions; and Beanworks, accounts payable solution automating error-prone manual processes. In addition, it provides lines of software and hardware for preparing and sending mails in low and high volumes. Further, the company operates a pick-up, drop-off solution that offers businesses and people who need to manage their deliveries and returns. Additionally, it distributes print finishing equipment, such as guillotines, binding machines, laminating machines, and paper folding machines; provides professional and maintenance services; shipping software solutions; and automated packaging solutions. It serves financial services, healthcare, higher education, insurance, public sectors/government, retail, service providers, shipping carriers, telecommunications, and utilities industries. The company was formerly known as Neopost S.A. and changed its name to Quadient S.A. in September 2019. Quadient S.A. was founded in 1924 and is headquartered in Bagneux, France.","Quality Houses Public Company Limited, together with its subsidiaries, engages in the property development business in Thailand. It operates in four segments: Real Estate Business, Hotel Business, Rental Business, and Others. The company develops and sells land and houses, and condominium units; rents residential, hotels, and office buildings; and services residential buildings, as well as manages public utilities and real estate business of landowners. It also engages in hotel operations; lease of land; management for rental properties, including hotels, serviced apartments, rental office buildings, and rental residential projects; manufacture and sale of ready-made concrete sheets; and manufacture and distribution of precast concrete. The company was incorporated in 1983 and is headquartered in Bangkok, Thailand.","Qualys, Inc. provides cloud-based information technology (IT), security, and compliance solutions in the United States and internationally. The company offers Qualys Cloud Apps, which includes Vulnerability Management; Vulnerability Management, Detection and Response; Threat Protection; Continuous Monitoring; Patch Management; Multi-Vector Endpoint Detection and Response; Certificate Assessment; SaaS Detection and Response; Secure Enterprise Mobility; Policy Compliance; Security Configuration Assessment; PCI Compliance; File Integrity Monitoring; Security Assessment Questionnaire; Out of-Band Configuration Assessment; Web Application Scanning; Web Application Firewall; Global Asset Inventory; Cybersecurity Asset Management; Certificate Inventory; Cloud Inventory; Cloud Security Assessment; and Container Security. Its integrated suite of IT, security, and compliance solutions delivered on its Qualys Cloud Platform enables customers to identify and manage IT assets, collect and analyze IT security data, discover and prioritize vulnerabilities, recommend and implement remediation actions, and verify the implementation of such actions. The company also provides asset tagging and management, reporting and dashboards, questionnaires and collaboration, remediation and workflow, big data correlation and analytics engine, and alerts and notifications, which enable integrated workflows, management and real-time analysis, and reporting across IT, security, and compliance solutions. The company offers its solutions through its sales teams, as well as through its network of channel partners, such as security consulting organizations, managed service providers, resellers, and consulting firms. It serves enterprises, government entities, and small and medium-sized businesses in various industries, including education, financial services, government, healthcare, insurance, manufacturing, media, retail, technology, and utilities. The company was incorporated in 1999 and is headquartered in Foster City, California.","FreightCar America, Inc., through its subsidiaries, designs, manufactures, and sells railcars and railcar components for the transportation of bulk commodities and containerized freight products primarily in North America. It operates in two segments, Manufacturing and Parts. The company offers a range of freight cars, including open top hoppers; covered hopper cars; gondolas; triple hoppers and hybrid aluminum/stainless steel railcars; ore hopper and gondola railcars; ballast hopper cars; aggregate hopper cars; intermodal flats; and non-intermodal flat cars. It also provides railcars, including coal cars, bulk commodity cars, coil steel cars, and boxcars; and woodchip hoppers, aluminum vehicle carriers, and articulated bulk container railcars. In addition, the company sells used railcars; leases, rebuilds, and converts railcars; and sells forged, cast, and fabricated parts for various railcars. It also exports its manufactured railcars to Latin America and the Middle East. The company's customers primarily include financial institutions, railroads, and shippers. FreightCar America, Inc. was founded in 1901 and is headquartered in Chicago, Illinois.","Randon S.A. Implementos e Participa\u00e7\u00f5es develops and sells transportation solutions. It operates through three segments: Vehicles and Implements, Auto Parts, and Services. The company manufactures and sells truck bodies, trailers, and semitrailers in the areas of bulk, tankers, dry cargos, tippers, silos, refrigerators, sugarcane, forestry, sider models, load everything, and vans; and hopper, gondola, tank, general cargo, platform, telescopic, and others. It also provides railroad cars, off-road trucks, backhoe loaders and other road implements, and special vehicles; sells spare parts and components; and produces and sells friction materials, suspensions, axles, brake, and coupling and rolling systems, as well as products and components for motion control and vehicle testing. In addition, the company provides financial and digital services; and develops and manages experimental research projects and technological solutions in automation and industrial robotics. It operates sales and service network in approximately 120 countries, including Brazil, Argentina, India, Uruguay, Holland, Colombia, Peru, Chile, Mexico, Canada, the United States, Africa, and Mercosur. The company was formerly known as Randon Participa\u00e7\u00f5es S.A. and changed its name to Randon S.A. Implementos e Participa\u00e7\u00f5es in November 2003. Randon S.A. Implementos e Participa\u00e7\u00f5es was founded in 1949 and is headquartered in Caxias do Sul, Brazil.","Revolution Bars Group plc operates premium bars located in towns or city center high streets across the United Kingdom. Its bars offer food and drinks. As of November 15, 2021, the company operated 67 bars, including 49 bars under the Revolution and 18 under the Revoluci\u00f3n de Cuba brand names. Revolution Bars Group plc was founded in 1991 and is headquartered in Ashton-Under-Lyne, the United Kingdom.","Resource Development Group Limited provides contracting, remedial, and construction services to the resource, infrastructure, energy, government, utilities, and defense sectors in Australia. The company offers multi-disciplinary construction and remedial services, such as civil, SMPT, E&amp;I, and non-process infrastructure building works; ancillary and protective maintenance services; EPCM, PMC, or integrated team project delivery solutions; EPC project delivery solutions; design and construct package delivery solutions; and optimizing services comprising debottlenecking existing operations. It also holds interest in the Ant Hill and Sunday Hill manganese project; the Lucky Bay Garnet project and associated power infrastructure project, including seven wind turbines; and offers construction and plant modification services. The company was incorporated in 2011 and is headquartered in Perth, Australia. Resource Development Group Limited operates as a subsidiary of Mineral Resources Limited.","Reitmans (Canada) Limited primarily engages in the retail sale of women's wear apparel in Canada. It also offers apparel for men. The company serves customers through retail and e-commerce channels. As of April 21, 2022, it operated 404 stores, including 237 Reitmans, 90 Penningtons, and 77 RW&amp;CO. The company was founded in 1926 and is headquartered in Montreal, Canada.","Realia Business, S.A., together with its subsidiaries, engages in property management and homebuilding activities in Spain and internationally. It develops, manages, operates, and leases office buildings, shopping centers, commercial premises, and industrial buildings; and provides land management services. It has a land portfolio of 6,946,216 gross square meters and 1,752,340 square meters of buildable land. The company was founded in 2000 and is headquartered in Madrid, Spain.","The RMR Group Inc., through its subsidiary, The RMR Group LLC, provides business and property management services in the United States. The company provides management services to its four publicly traded real estate investment trusts and three real estate operating companies. It also provides investment advisory services. The company was formerly known as REIT Management &amp; Research Inc. and changed its name to The RMR Group Inc. in September 2015. The RMR Group Inc. was founded in 1986 and is headquartered in Newton, Massachusetts.","Rockwell Automation, Inc. provides industrial automation and digital transformation solutions in the United States and internationally. The company operates in three segments, Intelligent Devices, Software &amp; Control, and Lifecycle Services. Its solutions include hardware and software products, and services. The Intelligent Devices segment offers drives, motion, safety, sensing, industrial components, and configured-to-order products. The Software &amp; Control segment provides control and visualization software and hardware, information software, digital twin and simulation software, and network and security infrastructure solutions. The Lifecycle Services segment provides consulting, professional services and solutions, and connected and maintenance services. The company sells its solutions primarily through independent distributors in relation with its direct sales force. It serves discrete end markets, including automotive, semiconductor, warehousing and logistics, and other discrete markets, as well as general industries comprising printing and publishing, marine, glass, fiber and textiles, airports, and aerospace; hybrid end markets, such as food and beverage, life sciences, household and personal care, and tire, as well as eco industrial, including water/wastewater, waste management, mass transit, and renewable energy; and process end markets comprising oil and gas, mining, metals, chemicals, pulp and paper, and others. Rockwell Automation, Inc. was founded in 1903 and is headquartered in Milwaukee, Wisconsin.","SMT Scharf AG engages in the development, manufacture, and service of transportation equipment and logistics systems for underground mining and tunnel construction. The company operates through four segments: Coal Mining, Mineral Mining, Tunnel, and Other Industries. It offers monorail and duorail systems, chairlift systems, segment cranes, lifting devices, explosive and placement devices, drilling and splitting tools, construction site cranes, battery and diesel locomotives, muckmasters, lift working platform, cable drive, mini climbers, light electric vehicles, and climbing locomotive products. The company's products are primarily used in hard coal, gold, platinum, copper, nickel, and salt mining activities. It has operations in Germany, Russia and rest of CIS states, Poland, China, Africa, the United States, and internationally. SMT Scharf AG was founded in 1941 and is headquartered in Hamm, Germany.","Sandy Spring Bancorp, Inc. operates as the bank holding company for Sandy Spring Bank that provides commercial and retail banking, mortgage, private banking, and trust services to individuals and businesses. It operates through three segments: Community Banking, Insurance, and Investment Management. The Community Banking segment offers financial products and services, including various loan and deposit products. Its loan products include commercial real estate loans, commercial construction loans, and other commercial loans; residential real estate loans; and consumer loans comprising home equity loans and lines, installment loans, and personal lines of credit. The Insurance segment provides general insurance agency services and annuities, such as commercial, personal, and medical liability lines. The Investment Management segment offers investment management and financial planning, including cash flow analysis, investment review, tax and retirement planning, insurance analysis, and estate planning to individuals, families, small businesses, and associations. It also provides personal trust and wealth management services. The company operates a network of approximately 50 locations in Maryland, Northern Virginia, and Washington D.C. Sandy Spring Bancorp, Inc. was founded in 1868 and is headquartered in Olney, Maryland.","STMicroelectronics N.V., together with its subsidiaries, designs, develops, manufactures, and sells semiconductor products in Europe, the Middle East, Africa, the Americas, and the Asia Pacific. The company operates through Automotive and Discrete Group; Analog, MEMS and Sensors Group; and Microcontrollers and Digital ICs Group segments. The Automotive and Discrete Group segment offers automotive integrated circuits (ICs); and discrete and power transistor products. The Analog, MEMS and Sensors Group segment provides industrial application-specific integrated circuits (ASICs) and application-specific standard products (ASSPs); general purpose analog products; custom analog ICs; wireless charging solutions; galvanic isolated gate drivers; low and high voltage amplifiers, comparators, and current-sense amplifiers; MasterGaN, a solution that integrates a silicon driver and GaN power transistors in a single package; wireline and wireless connectivity ICs; touch screen controllers; micro-electro-mechanical systems (MEMS) products, including sensors or actuators; and optical sensing solutions. The Microcontrollers and Digital ICs Group segment offers general purpose and secure microcontrollers; radio frequency (RF) and electrically erasable programmable read-only memories; and RF, digital, and mixed-signal ASICs. It also provides assembly and other services. The company sells its products through distributors and retailers, as well as through sales representatives. It serves automotive, industrial, personal electronics and communications equipment, and computers and peripherals markets. STMicroelectronics N.V. was incorporated in 1987 and is headquartered in Geneva, Switzerland.","Shriro Holdings Limited, together with its subsidiaries, manufactures and distributes kitchen appliances and consumer products in Australia and New Zealand. The company offers home appliances, watches, calculators, electronic musical instruments, audio equipment, heaters, fans, laundry products, consumer electronics, car audio, amplifiers, professional DJ, hi-fi speakers, and heating and cooling products. In addition, it provides barbeques and accessories. The company markets and distributes its products under its own brands, including Omega, Robinhood, Everdure, and Omega Altise; and third party owned brands, such as Casio, Blanco, and Pioneer. Shriro Holdings Limited was founded in 1982 and is headquartered in Chatswood, Australia.","Shriram Finance Limited, a non-banking finance company, primarily provides commercial vehicle financing services in India. It offers commercial vehicle loans for commercial goods vehicles, passenger vehicles, tractors and farm equipment, and construction equipment. The company also provides business loans; fixed and recurring deposits; and working capital loans, including tyre, tax, fuel, and toll finance, as well as vehicle insurance and repair/top-up loans. In addition, it offers challan discounting services; life and general insurance products; consumer finance services; emergency credit line guarantee schemes; stock broking services; and chit and mutual funds. As of March 31, 2022, it operated a network of 1,854 branches. The company also offers its products through 775 rural centers; and partnerships with 500 private financiers. It primarily serves first time buyers, driver-turned-owners, and small road transport operators. The company was formerly known as Shriram Transport Finance Company Limited and changed its name to Shriram Finance Limited in November 2022. Shriram Finance Limited was incorporated in 1979 and is headquartered in Mumbai, India.","Schulz S.A. manufactures and sells air compressors and automotive components in Brazil and internationally. The company offers diaphragm, piston, oil less, screw, booster, and scroll compressors; compressor pumps; lubricants; condensate separators; air dryers; filters; condensate drains; water/oil separators; pneumatic tools; high pressure washers; electric spray guns; wet and dry vacuums; bench and column equipment; power generators; combustion engines; automotive line 12V; electric and cordless tools; hand tools; spare parts; and accessories. Its products are used for residential, professional, and industrial applications. The company was incorporated in 1963 and is headquartered in Joinville, Brazil.","Siebert Financial Corp., through its subsidiaries, engages in the retail discount brokerage and investment advisory businesses in the United States and Internationally. It offers discount brokerage services, including self-directed trading, wealth management, financial advice, market making and fixed income investment, stock borrow, equity compensation plans, securities lending, equity stock plan, and market making services; independent retail execution services; and retail customer services. The company also offers self-directed retirement accounts, as well as lends customers a portion of the market value of marginable securities held in the customer's account. In addition, the company provides data technology platform that offers various services, such as email and messaging, market data systems and third party trading systems, business productivity tools, and customer relationship management systems. Further, it offers a Robo-Advisor platform that provides clients with an automated wealth management solution; and various insurance products, such as fixed annuities, personal insurance, property and casualty insurance, natural disaster insurance, and life and disability. The company has 12 branch offices in the United States. Siebert Financial Corp. was incorporated in 1934 and is headquartered in New York, New York.","Silk Logistics Holdings Limited provides port-to-door landside logistics and supply chain services in Australia. It operates in two segments, Port Logistics and Contract Logistics. The company offers port logistics services, including wharf cartage; and contract logistics services, such as warehousing and distribution. It serves retail, fast moving consumer goods, light industrial, food, and other industries. Silk Logistics Holdings Limited was incorporated in 2013 and is headquartered in Port Melbourne, Australia.","Saunders International Limited engages in the design, fabrication, construction, and maintenance of bulk liquid storage facilities, tanks, and road and rail bridges in Australia. The company also manufactures precast concrete products for transport infrastructure projects; and provides a range of specialized services for the maintenance of commercial, industrial, and marine infrastructure and assets. In addition, it engages in the designing, engineering, procurement, and construction of fuel and chemical storage terminals, water reservoirs and pumping stations, mineral processing plants, bridge construction works, precast concrete, concrete foundation works for heavy industry, foundation systems, jetty and wharves construction, building and construction management, bridges and marine structures, and water infrastructure, as well as coal bins, hoppers, and associated steel works. Further, the company provides various asset services comprising turn key solutions, shutdowns and refurbishment, furnace and boiler maintenance, pressure welding, air heater overhauls and upgrades, general base line maintenance, refinery and industrial services, pumps and steam valve overhaul, high performance coatings and linings, abrasive blasting and protective coatings, and structural strengthening services, as well as services related to fabrication, general, structural, piping, and pressure equipment. Additionally, it provides electrical instrumentation, and automation and control services. The company offers its products and services to oil and gas, mining and mineral processing, infrastructure, aviation, defense, new energy, power, and water/wastewater industries. Saunders International Limited was founded in 1951 and is based in Rhodes, Australia.","Srinanaporn Marketing Public Company Limited produces and distributes soft drinks and snacks in Thailand. The company offers ready to drink jellies under the Jele and Jele Beautie brand names; squid snacks under the Bento brand; biscuit sticks and seaweed sticks under the Lotus brand name; and coconut juice, soy milk, tamarind, grape juice, black lemon tea, and melon drinks under the Magic Farm brand. It also provides wafers under the Chocky brand; biscuits under the Bakery House, Dorkbua, and Lotus brand names; and mineral water under the AQUAVITZ brand. The company exports its products to Laos, Cambodia, Vietnam, Indonesia, Malaysia, Myanmar, the Philippines, Singapore, China, etc. Srinanaporn Marketing Public Company Limited was founded in 1975 and is headquartered in Bangkok, Thailand.","Soitec S.A. designs and manufactures semiconductor materials worldwide. Its products are used to manufacture chips that are used in smart phones, tablets, computers, IT servers, and data centers, as well as electronic components in cars, connected devices, and industrial and medical equipment. It offers Fully Depleted Silicon-On-Insulator (FD-SOI) for automotive radar and processors, and PD-SOI and FinFET-SOI products for high-performance computing markets. The company also offers RF-SOI substrates for front-end module devices, as well as 4G LTE and new 5G sub-6 GHz/ mmWave smartphones. In addition, it offers power-SOI products that address the requirements for integrating high and low voltage functions in power IC devices for automotive and industry markets. Further, the company offers Smart photonics-SOI products for optical networking; Smart Imager-SOI products for next generation 3D image sensing; Auto Smartsic for green mobility; Connect RF-GaN for 5G infrastructure architecture and smartphone power amplifier markets; Connect-POI engineered substrates for high performance surface acoustic wave filter; and Gallium Nitride (GAN) Epitaxial wafers for energy efficient power management system. Soitec S.A. was incorporated in 1992 and is headquartered in Bernin, France.","Spark New Zealand Limited, together with its subsidiaries, provides telecommunications and digital services in New Zealand. It offers telecommunications, information technology, media, and other digital products and services, including mobile services; voice services; broadband services; internet sports streaming services; cloud, security, and service. The company also provides IT infrastructure, business cloud, business and outsourced telecommunications, software, big data analytics, data center, and international wholesale telecommunications services. In addition, it offers local, national, and international telephone and data services; finance products; group insurance products; and mobile phone repair services. Further, the company retails telecommunications products and services; and distributes equipment. It serves consumers, households, small businesses, government, and large enterprises. The company was formerly known as Telecom Corporation of New Zealand Limited and changed its name to Spark New Zealand Limited in August 2014. Spark New Zealand Limited was incorporated in 1987 and is headquartered in Auckland, New Zealand.","SpartanNash Company distributes and retails grocery products. It operates in three segments: Food Distribution, Military, and Retail. The Food Distribution segment offers approximately 65,000 stock-keeping units, such as dry groceries, produce, dairy products, meat, delicatessen items, bakery goods, frozen food, seafood, floral products, general merchandise, beverages, tobacco products, health and beauty care, and pharmacy products to independent retailers, national retailers, food service distributors, e-commerce providers, and corporate owned retail stores. This segment also offers various value-added services to retailers. The Military segment sells and distributes grocery products to 160 military commissaries and approximately 400 exchanges located in 39 states across the United States and the District of Columbia, Europe, Cuba, Puerto Rico, Honduras, Iraq, Kuwait, Bahrain, Qatar, and Djibouti. The Retail segment primarily operates 145 corporate owned retail stores and 36 fuel centers, primarily under the banners of Family Fare, Martin's Super Markets, D&amp;W Fresh Market, VG's Grocery, and Dan's Supermarket. SpartanNash Company also markets and distributes private brand items primarily under the Our Family brand name. The company was formerly known as Spartan Stores, Inc. and changed its name to SpartanNash Company in November 2013. SpartanNash Company was founded in 1917 and is headquartered in Grand Rapids, Michigan.","Strike Energy Limited explores for and develops oil and gas resources in Australia. The company primarily focuses on the Project Haber, Ocean Hill, Perth Basin Geothermal, Walyering, West, and South Erregulla projects located in the Perth Basin. Strike Energy Limited was incorporated in 1997 and is based in West Perth, Australia.","Super Retail Group Limited engages in the retail of auto, sports, and outdoor leisure products in Australia and New Zealand. It offers automotive parts and accessories, handyman items, and tools and equipment, and marine and motorbike products, including batteries, car care products, exterior accessories, hand and power tools, in-car navigation systems, in-car stereo equipment, lighting and electrical products, oils, filters and additives, outdoor equipment and accessories, seat covers and interior accessories, spare parts, paints and panels, and performance products. The company also provides footwear, fitness and sports equipment, apparel, and related accessories; fishing products, such as lures, rods and reels, tackle boxes, fishing nets, and other products; camping products, including tents, ropes, pegs, cooking equipment, and clothing and hiking gears, as well as boating products comprising fishing rod holders, bilge pumps, fish-finders, etc. In addition, it offers apparel and equipment for mountain climbers, campers, hikers, and others; and products for travel, touring, outdoor, garage, and shed, as well as vehicles for adventure activities. The company sells its products under the Supercheap Auto, rebel, BCF, and Macpac brands; and offers its products online. It operates 716 stores. Super Retail Group Limited was founded in 1972 and is based in Strathpine, Australia.","SurgePays, Inc., a financial technology and telecommunications company, provides services to the underbanked community in the United States. Its blockchain platform utilizes a suite of financial and prepaid products to convert corner stores and bodegas into tech-hubs for underbanked neighborhoods. The company offers voice and SMS text messaging services to subsidized and direct retail prepaid customers, as well as to low-income consumers. It also offers subsidized mobile broadband services to consumers in California, Colorado, Florida, Illinois, Maryland, Mississippi, Missouri, Nevada, New Jersey, Ohio, Oklahoma, Rhode Island, Tennessee, and Texas, as well as prepaid wireless plans. In addition, the company provides marketing business intelligence, plaintiff generation, and case load management solutions primarily to law firms in the mass tort industry. Further, it operates a bilingual operations center offering the Company with sales support, customer service, IT infrastructure design, graphic media, database programming, software development, revenue assurance, lead generation, and other various operational support services. The company is headquartered in Bartlett, Tennessee.","SurgePays, Inc. operates as a technology and telecommunications company. It offers mobile broadband services to consumers. The company's fintech platform utilizes a suite of financial and prepaid products to convert corner stores and bodegas into tech-hubs for underbanked neighborhoods. The company also provides ShockWave, an end-to-end cloud-based Software as a Service offering an Omnichannel customer relationship management, billing system, and carrier integrations to the telecommunication and broadband industry. In addition, the company provides Surge Blockchain software, a back-office marketplace offering wholesale consumable goods direct to convenience stores who are transacting on the SurgePays Fintech platform. Further, it offers lead generation and case management solutions primarily to law firms in the mass tort industry. The company was incorporated in 2006 and is headquartered in Bartlett, Tennessee.","Salzgitter AG, together with its subsidiaries, engages in steel and technology businesses worldwide. It operates through five segments: Strip Steel, Plate/Section Steel, Mannesmann, Trading, and Technology. The Strip Steel segment manufactures branded and special steels, such as hot-rolled strip steel and steel sheets, sections, tailored blanks, and components for the construction industry. The Plate/Section Steel segment produces various high-grade heavy plates for engineering, shipbuilding, and mechanical engineering, as well as trades in scrap. The Mannesmann segment is involved in the manufacture of line pipes, HFI-welded tubes, precision and stainless-steel tubes, and spiral-welded and longitudinal-welded large-diameter pipes; and seamless and welded tubes for the energy, automotive, and mechanical engineering sectors. The Trading segment operates a European sales network, as well as trading companies and agencies worldwide. The Technology segment engages in the provision of machinery and plants for the filling and packaging of beverages, as well as special machinery engineering for shoe manufacturing and elastomer production. The company also provides IT, facility management, logistics, automotive engineering, and research and development services, as well as supplies raw materials. Salzgitter AG was founded in 1858 and is headquartered in Salzgitter, Germany.","TransAct Technologies Incorporated designs, develops, and markets transaction-based and specialty printers and terminals in the United States and internationally. Its thermal printers and terminals to generates labels, coupons, and transaction records, such as receipts, tickets, and other documents, as well as printed logging and plotting of data. The company also provides consumable products, including POS receipt paper, inkjet cartridges, ribbons, and other printing supplies, as well as replacement parts and accessories; maintenance and repair services; and refurbished printers. In addition, it offers EPICENTRAL print system, a software solution that enables casino operators to create promotional coupons and marketing messages, and print them at the slot machine; and technical support services, as well as spare parts and accessories. Further, the company provides BOHA! terminal that combines hardware and software components in a device that includes an operating system, touchscreen, and one or two thermal print mechanisms. It markets its products under the BOHA!, AccuDate, Epic, Ithaca, EPICENTRAL, and Printrex brands for food service technology, point of sale automation, casino and gaming, lottery, and oil and gas markets, as well as government. The company sells its products to original equipment manufacturers, value-added resellers, and distributors, as well as directly to end-users through its Webstore transactsupplies.com. TransAct Technologies Incorporated was incorporated in 1996 and is headquartered in Hamden, Connecticut.","Tanla Platforms Limited, together with its subsidiaries, provides cloud communication services for mobile operators and enterprises in India and internationally. It offers SMS Campaign Manager, which helps in sending instant messages whether promotional or transactional to all your customers at one go; Two-Factor Authentication; Boomering provides international calling options; and Omni Communication, a platform enables gapless changeover between communication channels for customer journeys and an unsurpassed brand. The company also provides cloud voice services, including Hosted IVR solution that enables enterprises to design, build, and update custom IVR applications using a web interface; Voice Broadcast technology that enables enterprises to initiate and deploy personalized interactive voice broadcasts; Free Ring, a solution for engaging and interactive communications with customers and prospects; and Source Trace, which enables enterprises and agencies to track inbound calls back to the marketing source. In addition, it offers IoT platform, which enables businesses to connect, collect, and curate. Further, it provides Trubloq, a block chain enabled communication platform as a service (CPaaS) stack; and Wisely, which delivers communication services for CPaaS ecosystem. The company was formerly known as Tanla Solutions Limited and changed its name to Tanla Platforms Limited in October 2020. The company was incorporated in 1995 and is headquartered in Hyderabad, India.","Tata Elxsi Limited provides product design and engineering, and systems integration and support services in India, the United States, Europe, and internationally. The company operates through two segments, Software Development and Services; and Systems Integration and Support. It offers technology consulting, new product design, development, and testing services; and consumer insights and strategy, visual design and branding, product and packaging design, user experience design, service experience design, and transportation design, as well as content and 3D animation services. The company also provides engineering services for connected, autonomous, and shared and electric vehicles; consumer research, prototyping, and automotive exteriors and interiors styling services; body and chassis systems, driveline, and powertrain systems; automotive software engineering services; validation service; and AI-enabled smart annotation platform for automotive industry. In addition, it offers shopping, bill payment, gaming, movie watching, and video conferencing services; distribution and delivery solutions; ad monetization services; OTT/IPTV and test automation platforms; intelligent network and transformation operations; network orchestration, SDN/SD-WAN, android TV, and RDK services for communications industry; integrated design and engineering, and regulatory compliance services, as well as digital health products and solutions. Further, the company provides technology solutions and services for smart home appliances, electric off-highway vehicles, autonomous vehicles, connected systems, integrated digital rail systems, and semiconductors. Additionally, it implements and integrates systems and solutions for computing, CAD/CAM/CAE/PLM, broadcast, virtual reality, storage, and disaster recovery; and provides professional services for the maintenance and support of IT infrastructure. Tata Elxsi Limited was incorporated in 1989 and is headquartered in Bengaluru, India.","The Tata Power Company Limited engages in the generation, transmission, distribution, and trading of electricity in India and internationally. It operates through Generation, Renewables, Transmission and Distribution, and Others segments. The Generation segment generates power from hydroelectric and thermal sources, such as coal, gas, and oil. The Renewables segment generates power from renewable energy sources, which include wind and solar. The Transmission and Distribution segment transmits and distributes electricity; sells power to retail customers through distribution network and related ancillary services. The Others segment offers project management contracts/infrastructure management, and property development services, as well as rents oil tanks. The company also manufactures and sells solar photovoltaic cells and modules, and pumps; operates electric vehicle charging stations and coal mines; generates electricity through waste heat sources; trades in power; and provides engineering, procurement, and construction, as well as logistics services. In addition, it offers microgrid, rooftop solar, and home automation solutions. The company has an installed capacity of 14,110 MW. The Tata Power Company Limited was founded in 1915 and is based in Mumbai, India.","Codex DNA, Inc., a synthetic biology company, manufactures and sells synthetic biology instruments, reagents, and associated products and related services, primarily to pharmaceutical and academic laboratories worldwide. Its solutions include BioXp system that empowers researchers to go from a digital DNA sequence to endpoint-ready synthetic DNA; BioXp portal, an online portal that offers an intuitive guided workflow and design tools for building new DNA sequences and assembling them into vectors of choice; BioXp kits that contain building blocks and reagents, including its Gibson Assembly branded reagents, for specific synthetic biology workflow applications; Cloud-based scripts; Benchtop reagents that contain all the reagents necessary to proceed with a specific synthetic biology workflow on the benchtop using products generated on the BioXp system; Biofoundry Services, which enable a customer to order and receive the BioXp system endpoint-ready products, such as genes, clones, cell-free amplified DNA, and variant libraries; and short oligo ligation assembly enzymatic DNA synthesis. It also serves government institutions, contract research organizations, and synthetic biology companies. The company was formerly known as SGI-DNA, Inc. and changed its name to Codex DNA, Inc. in March 2020. Codex DNA, Inc. was incorporated in 2011 and is headquartered in San Diego, California.","Target Hospitality Corp. operates as a specialty rental and hospitality services company in North America. The company operates through four segments: Hospitality &amp; Facilities Services - South, Hospitality &amp; Facilities Services - Midwest, Government, and TCPL Keystone. It owns a network of specialty rental accommodation units with approximately 15,528 beds across 27 communities, which include 26 owned and 1 leased; and operates 1 community not owned or leased by the company. Target Hospitality Corp. also provides catering and food, maintenance, housekeeping, grounds-keeping, security, health and recreation, workforce community management, concierge, and laundry services. It serves the U.S. government, government contractors, investment grade natural resource development companies, and energy infrastructure companies. The company was founded in 1978 and is headquartered in The Woodlands, Texas.","TPI Polene Power Public Company Limited generates and distributes electricity in Thailand. The company operates through Energy &amp; Utilities, and Petrol and Gas Stations segments. It operates municipal solid waste fired, coal-fired, waste-to-energy, and waste-heat recovery power plants; and petrol and natural gas (NGV) service stations. The company sells its electricity to the electricity generating authority of Thailand. As of December 31, 2021, it operated 8 power plants with a total installed power generation capacity of 440 megawatt, as well as 8 petrol stations, 3 fuel and natural gas stations, and 1 gas station under the TPIPP brand. The company was incorporated in 1991 and is headquartered in Bangkok, Thailand. TPI Polene Power Public Company Limited operates as a subsidiary of TPI Polene Public Company Limited.","The Practical Solution Public Company Limited engages in the provision of solutions for information technology systems. The Company offers system integration services, including consulting, design, procurement, installation, and distribution of products and equipment for computer network infrastructure, wireless LAN, cyber and network security, unified communication, data center, and network management system solutions. It also provides system maintenance services comprising preventive and collective maintenance, and warranty services, as well as cabling services, onsite maintenance and repair services, and software system design and development services. In addition, the company is also involved in distribution third-party products by operating as a business partner with product owners comprising Cisco, NetApp, Palo Alto Networks, Symantec, VMware, Fortinet, etc. It serves telecommunications, automotive, oil and refinery, cement, hospitals, financial institutions, educational institutions, and logistics industries. The company was founded in 2004 and is headquartered in Bangkok, Thailand.","Trisul S.A. engages in the construction and development of real estate properties in Brazil. It is also involved in the subdivision of plots of land; and purchase and sale of properties. The company develops real estate projects, including with ownership interest of third parties. The company was founded in 2007 and is based in S\u00e3o Paulo, Brazil.","Thai Rung Union Car Public Company Limited engages in the car assembly and modification, and the manufacture and distribution of parts and molds primarily in Thailand. It operates through three segments: Car Assembly and Other Related Car Services; Manufacture of Equipment for Production of Car Accessories; and Sales of Cars, and Car Service Centre Business. The company offers tooling products, including dies and molds, and assembly jigs and checking fixtures; auto parts, such as metal stamping or press parts for use in producing or assembling motor vehicles, motorcycles, industrial, construction and agricultural machinery, and electrical appliances; plastic vacuum mould parts for auto accessories; and auto seats. It also provides contract assembly, vehicle modification, and vehicle painting services; and after-sales services. In addition, the company is involved in the sale of cars, car accessories, and spare parts; repairing and refitting vehicles body; and manufacture of truck bodies, such as dump-trucks, cargo vans, trailers, concrete mixer trucks, refrigerated trucks, industrial machinery, excavators, construction equipment, agricultural machinery, and tractors. Thai Rung Union Car Public Company Limited was founded in 1967 and is headquartered in Bangkok, Thailand.","Singapore Land Group Limited, an investment holding company, engages in the development of properties for investment and trading in Singapore and internationally. The company operates through Property Investment, Property Trading, Hotel Operations, Technology Operations, and Others segments. It develops and leases commercial office, retail space, and residential properties. The company also offers property management services; invests in and operates hotels; invests in retail centers; distributes computers and related products; retails computer hardware and software; and provides information technology, systems integration, and networking infrastructure services. In addition, it invests in shares, and provides marketing management and other related services. The company was incorporated in 1963 and is based in Singapore. Singapore Land Group Limited is a subsidiary of UOL Group Limited.","Under Armour, Inc., together with its subsidiaries, engages in the developing, marketing, and distributing performance apparel, footwear, and accessories for men, women, and youth. The company offers its apparel in compression, fitted, and loose fit types. It also provides footwear products for running, training, basketball, cleated sports, recovery, and outdoor applications. In addition, the company offers accessories, which include gloves, bags, headwear, and sports masks; and digital subscript
