ion and advertising services under the MapMyRun and MapMyRide platforms. It primarily offers its products under the UNDER ARMOUR, UA, HEATGEAR, COLDGEAR, HOVR, PROTECT THIS HOUSE, I WILL, UA Logo, ARMOUR FLEECE, and ARMOUR BRA brands. The company sells its products through wholesale channels, including national and regional sporting goods chains, independent and specialty retailers, department store chains, mono-branded Under Armour retail stores, institutional athletic departments, and leagues and teams, as well as independent distributors; and directly to consumers through a network of 422 brand and factory house stores, as well as through e-commerce websites. It operates in the United States, Canada, Europe, the Middle East, Africa, the Asia-Pacific, and Latin America. Under Armour, Inc. was incorporated in 1996 and is headquartered in Baltimore, Maryland.","Under Armour, Inc., together with its subsidiaries, engages in the developing, marketing, and distributing performance apparel, footwear, and accessories for men, women, and youth. The company offers its apparel in compression, fitted, and loose fit types. It also provides footwear products for running, training, basketball, cleated sports, recovery, and outdoor applications. In addition, the company offers accessories, which include gloves, bags, headwear, and sports masks; and digital subscription and advertising services under the MapMyRun and MapMyRide platforms. It primarily offers its products under the UNDER ARMOUR, UA, HEATGEAR, COLDGEAR, HOVR, PROTECT THIS HOUSE, I WILL, UA Logo, ARMOUR FLEECE, and ARMOUR BRA brands. The company sells its products through wholesale channels, including national and regional sporting goods chains, independent and specialty retailers, department store chains, mono-branded Under Armour retail stores, institutional athletic departments, and leagues and teams, as well as independent distributors; and directly to consumers through a network of 422 brand and factory house stores, as well as through e-commerce websites. It operates in the United States, Canada, Europe, the Middle East, Africa, the Asia-Pacific, and Latin America. Under Armour, Inc. was incorporated in 1996 and is headquartered in Baltimore, Maryland.","UAC Global Public Company Limited, together with its subsidiaries, imports and distributes various chemicals and equipment in Thailand and internationally. The company provides consulting and advising services for the marketing of products and services; and feasibility study of various projects or works related to energy, refinery, and petrochemical industries, as well as power plants and other utilities. It also produces and distributes biogas that are used in power generation, transportation, and various other industries; and produces and distributes petroleum products, including compressed natural gas, liquefied petroleum gas, and natural gas liquids. In addition, the company generates and distributes electricity, alternative energy, and fuel briquette; produces and distributes tap water and related equipment; and manufactures and distributes chemical products for the general industry. Its products are used in various industries, such as off-shore natural gas exploration and production, oil refinery and upstream petrochemicals, engine oil lubricant manufacturing plants, polymer and plastic manufacturing plants, chemical industrial plants, power plants, and other utilities systems. The company was formerly known as Universal Adsorbents &amp; Chemicals Public Company Limited and changed its name to UAC Global Public Company Limited in April 2014. UAC Global Public Company Limited was incorporated in 1985 and is headquartered in Bangkok, Thailand.","Ultrapar Participa\u00e7\u00f5es S.A. engages in the gas distribution, fuel distribution, and storage businesses primarily in Brazil, Mexico, Uruguay, Venezuela, other Latin American countries, the United States, Canada, the Far East, Europe, and internationally. Its Gas Distribution segment distributes liquefied petroleum gas to residential, commercial, and industrial consumers primarily in the South, Southeast, and Northeast regions of Brazil. The company's Fuel Distribution segment distributes and markets gasoline, ethanol, diesel, fuel oil, kerosene, natural gas for vehicles, and lubricants; operates convenience stores; and offers lubricant-changing and automotive specialized services. The company's Storage segment operates liquid bulk terminals primarily in the Southeast and Northeast regions of Brazil. As of December 31, 2021, the company operated through 7,104 Ipiranga service stations and 1,841 AmPm convenience stores; 1,149 Jet Oil franchises; 4 distribution centers; and 7 Ultracargo terminals with storage capacity of 983 thousand cubic meters. It also operates Abastece A\u00ed, a digital payments app; and offers Km de Vantagens, a loyalty program. The company was founded in 1937 and is headquartered in S\u00e3o Paulo, Brazil.","Unisys Corporation, together with its subsidiaries, operates as an information technology services company worldwide. It operates in Digital Workplace Solutions (DWS); Cloud and Infrastructure Solutions (C&amp;I); and Enterprise Computing Solutions (ECS) segments. The DWS segment provides solutions that transform digital workplaces securely and create exceptional end-user experiences. The C&amp;I segment offers solutions that drive modern IT service platforms, cloud applications development, intelligent services, and cybersecurity services. The ECS segment provides solutions that harness secure, continuous high-intensity computing, and enable digital services through software-defined operating environments. Its solutions include Unisys InteliServe, a service solution that transforms traditional service desk into an intelligent, user-centric experience aligned with the needs of the modern digital workplace; Unisys CloudForte, a comprehensive managed service offering to help accelerate the secure move of data and applications to the cloud; PowerSuite, a packaged software tool used by enterprise IT to monitor, analyze, troubleshoot and secure collaboration, and communications multi-platform environments; Unisys ClearPath Forward, a software operating environment for high-intensity enterprise computing; and Unisys Stealth security software, which enables trusted identities to access micro-segmented critical assets and safely communicate through secure and encrypted channels. In addition, the company provides industry solutions, which help law enforcement agencies solve crime; social services case workers assist families; travel and transportation companies manage freight and distribution; and financial institutions deliver omnichannel banking. It serves customers in the government, financial services, and commercial markets through direct sales force, distributors, resellers, and alliance partners. Unisys Corporation was founded in 1886 and is based in Blue Bell, Pennsylvania.","Puranium Energy Ltd. operates as a uranium exploration company in Canada, Australia, and the Philippines. The company has 85% interests in the seven exclusive prospecting licenses covering an area of 93,514 hectares located in Namibia, Africa. It holds a 100% interest in the Cobalt Mountain property covering an area of approximately 4,921 hectares located in the Omineca mining division of Northwest British Columbia; and has an option to purchase a 100% interest in Haines Property comprising 35 minerals claims located in Ontario, Canada. The company was formerly known as Monterey Minerals Inc. and changed its name to Puranium Energy Ltd. in March 2022. Puranium Energy Ltd. is headquartered in Vancouver, Canada.","VCI Global Limited provides consulting services in Malaysia, China, Singapore, and the United States. It offers business strategy consultancy, including listing solutions, corporate finance, legal, investors relations, and boardroom strategies consultancy. The company also technology consultancy, including software solutions that comprise artificial intelligence, analytics, and robotics, as well as a range of blockchain technology solutions. It delivers its services to small-medium enterprises and government-linked agencies, as well as to publicly traded conglomerates across various industries. The company was founded in 2013 and is based in Kuala Lumpur, Malaysia.","Vmoto Limited, together with its subsidiaries, manufactures and distributes electric two-wheel vehicles worldwide. Its electric two-wheel vehicles include electric mopeds and motorcycles. The company offers its products primarily under the Vmoto, Super Soco, and E-Max brand names. Vmoto Limited was incorporated in 2001 and is based in Perth, Australia.","Vonex Limited provides telecommunications services to business customers in Australia and the United States. The company operates through Retail Telecommunications and Wholesale Telecommunications segments. The Retail Telecommunications segment offers data, internet, billing, and other services, as well as voice services, including IP voice services. The Wholesale Telecommunications segment provides Vonex PBX and call termination services, and NBN and 4G mobile broadband at wholesale rates via a white label model. Vonex Limited is headquartered in Milton, Australia.","Vulcan Steel Limited, together with its subsidiaries, engages in the sale and distribution of steel and metal products in New Zealand and Australia. The company operates in two segments, Steel and Metals. It sells hollows; merchant products, including bars, beams, angles, channels, and unprocessed coils and plates; stainless steel products, such as hollows, bars, fittings, and sheets; and high-performance steel and metal products. The company also provides cutting, drilling, tapping, countersinking, and folding of plates, as well as sheeting and slitting services. Vulcan Steel Limited was incorporated in 1995 and is based in Auckland, New Zealand.","Wendt (India) Limited, together with its subsidiaries, manufactures and sells super abrasives, high precision grinding, honing, special purpose machines, and precision components in India and internationally. The company operates through three segments: Super Abrasives; Machines and Accessories, and Precision Products. The company offers super abrasives, including resin and metal bonds, hybrid wheels, Quantapol hybrid wheels, vitrified bonds, electroplated bonds, rotary diamond dressers, hones, stationary diamond dressers, PCD/PCBN tools and wear parts, brazed products, fine grinding wheels, and diamond segments and pellets. It also provides grinding, profiling dressing, and honing machines; precision components, such as nonferrous and ferrous products, as well as 3D printable ceramic materials; single point, natural point diamond, chisel type, cluster type, blade type, and MCD-blade type diamond dressers; and resin bond diamond wheels, electroplated diamond mounted points, electroplated files, dressing stones, and diamond lapping compounds, as well as diamond disc for grinding and hacking concrete. In addition, the company offers machine refurbishing products; floking; accessories and equipment; and finishing films. Its products are used in industries, including automobile, auto component, engineering, aerospace, defense, ceramics, glass wheels, textile, turbo charger, medical, biomedical, and cutting tool industry. The company also exports its products. Wendt (India) Limited was incorporated in 1980 and is headquartered in Hosur, India.","Winton Land Limited operates as a residential land developer that specializes in developing integrated and fully master planned neighbourhoods in New Zealand and Australia. It operates through Residential Development, Retirement Villages, and Commercial Portfolio segments. As of July 6, 2022, the company had a portfolio of 28 projects with a combined total of 7,300 residential lots, dwellings, apartment units, retirement village units, and commercial lots. Winton Land Limited was incorporated in 2017 and is based in Auckland, New Zealand.","VICOM Ltd, an investment holding company, provides motor vehicle inspection, non-vehicle testing, and consultancy services in Singapore. The company offers vehicle inspection services, including inspection for petrol-driven and diesel-driven vehicles, petrol-hybrid and diesel hybrid vehicles, motorcycles, electric vehicles, power assisted bicycles, and e-scooters; vehicle assessment services; and emission test laboratory services. It also provides vehicle evaluation; motor and general insurance; road tax renewal; and other services, such as vehicle inspection and type approval system, in-vehicle unit, speed limiter check, chassis dynamometer smoke test, and car buying tips and maintenance talks services. The company offers its testing, calibration, inspection, consultancy, and training services to aerospace, marine and offshore, biotechnology, oil and petrochemical, building construction, and electronics manufacturing industries. VICOM Ltd was incorporated in 1981 and is based in Singapore. VICOM Ltd is a subsidiary of ComfortDelGro Corporation Limited.","WT Financial Group Limited provides a range of financial services. It operates in two segments, Business to Business and Direct to Consumer. The company provides, licensing, risk management and compliance, education and training, and technical support services; and practice management and development services, including consumer marketing and education tools. It also offers financial planning, investment, and product sales and licensing services; and mortgage finance and brokerage, accounting, and SMSF administration services. In addition, the company provides wealth management, retirement, and investment, as well as mortgage, tax, and finance advice; and tax planning and structuring, and preparation and lodgement of tax returns. Further, it provides superannuation investments, insurance, finance, equities, and direct and SMSF residential and commercial properties to retail and wholesale clients; and home loan solutions for private wealth clients. The company was formerly known as Spring FG Limited and changed its name to WT Financial Group Limited in November 2019. WT Financial Group Limited was incorporated in 2014 and is based in Sydney, Australia.","XRF Scientific Limited manufactures and markets precious metal products, specialized chemicals, and instruments for the scientific, analytical, construction material, and mining industries in Australia, Canada, and Europe. It operates through Capital Equipment, Precious Metals, and Consumables segments. The Capital Equipment segment designs, manufactures, and services automated fusion equipment, and high temperature test and production furnaces, as well as general laboratory equipment. The Precious Metals segment manufactures products for the laboratory and platinum alloy markets. The Consumables segment manufactures chemicals and other supplies for analytical laboratories. The company was founded in 1972 and is based in Osborne Park, Australia.","Clear Secure, Inc. provides a member-centric secure identity platform in the United States. The company's secure identity platform is a multi-layered infrastructure consisting of front-end, including enrollment, verification, and linking. It also offers CLEAR Plus, a consumer aviation subscription service, which enables access to predictable entry lanes in airport security checkpoints, as well as access to broader network; and CLEAR app, a consumer-facing digital product that facilitates new user enrollment and member engagement from their mobile device. In addition, the company provides Reserve powered by CLEAR, a virtual queuing technology that provides users with the choice of how they queue either at home or on the move; and Atlas Certified, an automated solution to verify professional licenses and certification data across industries by communicating with certifying organizations for on-demand, current, and trusted data. The company was founded in 2010 and is headquartered in New York, New York.","Zensar Technologies Limited, a digital solutions and technology services company, provides information technology (IT) services and solutions in the United States, Europe, Africa, India, and internationally. The company operates through Digital and Application Services and Digital Foundation Services segments. It offers experience services, include product/experience research, strategy and design, and product and experience engineering services, as well as creative, content, brand, and campaign services; advanced engineering services, such as digital engineering, cloud application transformation and operation, and cloud strategy and operating model; data engineering and analytics services, include data engineering, artificial intelligence and machine learning, automation, and visualization and analytics services. In addition, its offers application services, such as application management, quality engineering, oracle, salesforce, and SAP; and foundation services, include digital infrastructure, workplace, experience management, operations, and security. It serves manufacturing, retail, media, banking, insurance, healthcare, and utilities industries. Zensar Technologies Limited was incorporated in 1963 and is headquartered in Pune, India."],"shape":[447],"dtype":"object","order":"little"}],["ceo",{"type":"ndarray","array":["Takaya  Soga","Mr. Michael S. Williams B.Sc.","Mr. Justin  Nuich M.B.A.","Mr. Yung-Chieh  Lin","Mr. Shing-Hwang  Kao","Mr. Jorge Luis Gonzalez","Mr. Kazuma  Yamanaka","Mr. Masahiro  Yamada","Mr. Jeffrey  Hu","Mr. M. Christopher Doyle","Mr. Roberto  Balls Sallouti","Mr. James Robert B. Quincey","Mr. Ole Falk Hansen","Mr. Tushar  Sighat","Mr. Kean Cheong Lau","Mr. Stuart James Irving","Mr. Michael K. Wirth","Ta Chih Chu","Ms. Joanne C. Crevoiserat","Mr. Itsuro  Miki","Mr. Kung-Pin  Chen","Ms. Grethe  Bergly","Mr. Kevin  Parkes","Mr. Louis
